                    { new Guid("153f1ade-b3e9-4675-9a6e-f2247940fde8"), "3412 Trường Thành Ports, Bắc Giang, Saint Lucia", "Đánh trăng đạp mượn đồng ba độc lầu ngọt thích xuồng mây ruộng phá đánh bảy viết yêu em tôi leo được thế tàu may quần mười là bè anh ba cửa hóa trăng nhà vá bạn vá nón cái dép nước nước đánh khâu biết hết tàu ngọt ruộng nhà thích đánh hết tám xe phá bàn được ghét em thôi tủ nước đâu làm con thì hết tô ghét núi hai yêu tui leo ác thế mười hàng con yêu ruộng ba thôi leo mây đỏ mượn quần bơi thì gió thuyền không khoảng tô tui đá đá khoảng gì thôi mười chỉ ngọt hóa chỉ hai xanh bốn ác trăng gió giết đập tui hương ác quê đã kim sáu tui tàu áo hết máy hết lỗi quần bảy biết xe ruộng tủ núi hai bốn đập đang mượn tàu nhà thương xanh ừ lầu ừ đập nha độc không bàn nghỉ trăng biết thôi mướn đỏ mướn thế lầu tôi ghét em đánh tôi đỏ chết giết là mướn đồng việc khâu giày việc tám không cái leo chỉ leo mượn làm tàu mượn thuyền xe hàng xanh tôi ghế ác biết giết vàng khâu á giết chết thương đỏ đã biết đỏ nghỉ được nước cái nước tám mây thôi mướn thôi vá khoan mua gì đâu quần khâu gió hàng ờ được gì chết xe yêu làm làm cửa cái tím yêu bơi yêu bốn tui nghỉ thuê xuồng nghỉ bàn giết nhà khoảng may bè tui ruộng ruộng tàu mười bảy thương phá con đồng mười nghỉ đang việc kim quần nha bơi hàng phá nhà được ruộng bàn ghét ờ thì tím hàng đập chín áo núi thuyền được kim xe vàng thuyền bảy việc xe tôi bạn hương tám trời hết tô chìm thôi quê bè yêu chín biết là khoan thích độc đá mướn một mướn bạn vẽ thuyền nghỉ hết chỉ em đá tô ác bốn thôi việc làm mượn xuồng ghế vá hết mây tím xanh ừ thế đạp lỗi làm thế tím tui bạn đập xanh đạp viết viết xe đang việc cái chìm hai được chỉ độc vá thuyền sáu phá xanh ruộng em khoan á yêu làm tô dép nha khâu bè tô quần giết thôi nước đạp khâu xe trăng bè anh biển giày nha kim xanh không tô hóa đang đập vá xanh ba hai hết leo bè biết giày năm tui tàu bè thích vá năm ruộng bạn chỉ giết chỉ cửa ngọt ừ núi một tui độc đã thế hóa tám cái gì ừ chín bè thuê bàn con chết làm sáu tui giày hàng giày phá phá nước quê làm bạn bốn chìm chìm chìm bảy tàu phá chín thế anh xanh khâu núi năm nha khâu tám hóa bảy thế cửa mây vá đánh á đỏ vá không tám nha khoan thế biết xuồng đồng làm đá khoảng em bàn hóa đập trời giày leo nón.", "Chết thì chỉ làm nước biển năm áo đá ờ nón bàn được áo giết yêu vá đỏ núi con thế nghỉ tô núi đỏ xanh con quần mây thì nước đánh đánh nha dép lỗi ba viết chết hương tám chín đạp áo ba khoảng ruộng con phá ghét thế thôi biết kim quê ruộng là xe gì gió máy ba thích tám ừ tàu kim chỉ đạp tôi vàng cái giày một mượn viết lầu ừ ác nón năm thôi hết mượn vàng ruộng dép nón lầu con khoảng được hết nước bốn trăng em vàng lỗi năm đạp hóa thương phá khâu lỗi núi quần gì mười làm ờ thì thì gió ừ mây hai leo xe gió nha núi sáu đang chín việc viết nhà thuê xuồng hương đánh bạn kim đạp trời ghế thuyền đá em làm đâu hết đập bàn áo máy bảy nón gì viết được trời ừ làm khâu hết làm chìm hai chín nghỉ xuồng vẽ ba ác yêu ruộng ghế giết dép đã đang ừ bốn bốn quần thôi em được tàu mướn thương anh thì làm biết khoảng không độc đã anh thương thôi tàu thì hết ghét á leo gì vàng chết thích độc hóa khoảng ruộng giày chết ghét vàng bốn mướn bơi giày hết ba ghế xuồng tám anh độc đạp đang gió mười biển hương áo đâu trăng mây phá ác thì hết cửa lỗi là chết mây hết tôi khâu giày đỏ mua mười hết chín phá bảy hết tám nhà tím ghế thuyền á thuê xanh đỏ bè trăng mười quê leo bàn quê chết ờ thế đồng vẽ biển chín chết nha thích làm đập ghét lỗi ghét được chín máy bạn khoảng tím ruộng trăng mướn chết ừ sáu đã tô tủ đá cái sáu núi anh hai áo vẽ hóa viết đá lầu không tôi tủ lỗi trăng thuyền đập thì ruộng bè hàng quần ờ nhà xuồng xanh chỉ xanh giết ghế sáu không một ba nón đang đồng trời hết một ba hàng hết sáu tô chết đang một thế kim vẽ ngọt leo ngọt chết vàng mây đạp gì máy dép thì thích ừ đỏ dép xuồng mười mây nghỉ viết mướn bơi may mượn là thuê không tàu bảy con mười gió giết bơi tám viết đỏ xe tô chết hết ruộng xuồng thuê thì ghế nha ghét đồng biết núi tô ngọt khoan vàng thương làm một giày lầu chín việc một gì năm tôi thế phá hết quê ác biển thích cửa vàng hai tủ năm áo khoan đỏ bảy ghét mười ác phá ờ tím tô gì được bè khoảng hai yêu hết đạp leo cửa khoảng bơi hàng việc thuyền năm tôi bạn ừ ghét bạn nhà bạn cái khoan tủ máy nhà là hóa đạp.", new DateTime(2005, 9, 8, 17, 5, 27, 734, DateTimeKind.Local).AddTicks(4049), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Liên Chi Lê", "\"https://picsum.photos/400/300/?image=999\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Nghệ An", "Ngô" },
                    { new Guid("1fd3e7f3-a8db-4e85-a1bb-2fecb729b47b"), "630 Nguyễn Coves, Bắc Kạn, Nicaragua", "Trời tui ghét được chỉ lỗi chìm nha chỉ hết thương thích ừ máy áo ba nón áo tàu chết xe dép đỏ nước ruộng ngọt thế á xe nhà ba lỗi thuê tàu bảy chín leo một chỉ hai con đá đã đá đập xe ừ mười hóa kim sáu thương xanh biết anh mười tủ xanh mười đồng dép vẽ bàn dép máy trời hết được không kim ba nghỉ xanh bốn vẽ năm mượn may biết được tui em trời cái mua mây yêu tô tôi đồng kim vẽ hóa thuyền tô làm leo mây gì cửa vá tui chìm khoảng làm đạp một ba xanh biển xuồng hương hóa nha vẽ đã bảy vá khoảng hóa mây ba ruộng núi ờ thì quê độc hết khoảng tím áo em chín ruộng ghế con xanh xuồng thuê ghế quê trời tàu làm độc nghỉ đỏ tàu chìm đạp vá hương bơi tàu mua nhà viết giày tím ba tui kim ghét tôi lỗi bốn lầu thích thích làm chỉ anh độc độc vàng đã biển gió xanh tủ mười nước không ngọt cái bốn áo đồng dép đá mượn bốn tím đập mười vàng tám đập mua ghế lầu anh trăng chín ba máy vàng mây đồng thôi thuê tủ đang mượn cái hai ghét con đang không thuyền yêu cái việc anh xuồng hai may trăng trời tám thì quần ừ vẽ chín trăng con áo tôi hàng ghét vàng hết mua tôi ác bảy tô núi khoan năm á ba khoảng hàng khâu hương hết biết ghét ba được mây khâu đồng dép bảy tô đồng yêu thuê bàn chỉ làm đồng mây hết nhà mướn độc á anh tàu tàu áo đâu ngọt tủ giày là bảy bè là vá đập là áo cái hết đánh lỗi mua leo mua mây xanh việc tủ ghét xuồng kim chìm tủ ruộng biển xe sáu bạn hương áo đánh thuyền anh được quần bè đỏ khoảng không xanh anh biết leo hai kim dép là gì đập hết quần đánh đang đạp đang yêu bạn thích nước sáu mướn viết bè nghỉ đánh ừ trời vẽ biển đỏ đồng ghế đá mướn đồng gì may biển hóa là thì hai bè đá đã may máy độc bơi mười chết đồng núi thích ngọt ngọt gì ghét cái gì chỉ quê không gì may ba dép ờ trời yêu năm mướn em nghỉ tô phá chỉ tàu mượn tô leo yêu thuyền hết tô chỉ máy mượn ác ừ mướn yêu hai ừ đạp bốn may tô thuyền á lỗi bàn trời đạp vàng đập bàn vá trời xanh đỏ trăng nghỉ núi bốn khoan khoảng sáu con mua leo khoan ừ dép mượn chín ờ núi giết mua cửa giết bạn khoan thì nha em thuyền ờ là ghế đã đồng là leo núi tô quần hương hóa gì đỏ mua thuê đã.", "Lỗi bơi quê tàu thuê biển yêu việc tím gì mây việc ghế thích nón trời phá mua đang khoan đâu chỉ mượn tui may biết được cửa yêu kim ruộng mua thôi bơi anh khoảng tủ ghế bàn leo mây đánh tàu tui bơi khoan tui thuê thôi lầu giết bảy hết may thích sáu đang tám mua núi nghỉ đâu đỏ vẽ hết ừ nghỉ thuê bàn may thế phá đập con quê đỏ đâu ruộng được đánh bạn đỏ nha gì nước đã vá tôi vàng tui áo giày đạp năm khoảng mua thích làm viết việc giết gì mười xe cửa bạn may lầu nón thôi đập việc thương ghét sáu nghỉ lầu chín chết ngọt tím máy đang hương ừ gió tô ngọt đánh phá được nước vẽ đá leo trời xanh đánh hương cái ruộng thương lầu lầu quần thì tô hóa nha bạn máy ừ độc núi viết ờ trời may phá ừ tôi kim hết yêu hai bốn khoảng chìm một máy thương làm thôi bạn thế lầu áo bốn đập áo hết kim lỗi hết mười thích thuê nón viết tôi mây tủ ruộng thì chỉ vá hàng dép quần đã áo ngọt nhà bốn mua chín yêu bàn tô ghế nón việc ngọt yêu máy nón bảy bàn bơi dép thương mượn thôi biết quê tủ tàu nón yêu yêu xe xe vẽ cửa quần ờ đạp tui hết thế vàng bảy không đang đánh cái áo hóa chỉ tô mượn tô năm nhà kim xe không bảy sáu năm khoan dép bạn một hóa nha lỗi đã nhà ghét khoảng ghế đồng ác tím phá ngọt mua nhà tui việc đá thì độc bè tám bốn yêu á thôi mây thôi gió mây hết chín nha vàng tàu núi không khoan thì hương hết thôi hàng chỉ khoan áo đánh mua bàn bè khâu đang chết thì thì trăng trăng bơi bạn thương chết xanh bơi giết may độc làm biển làm biết một khoảng máy ruộng ba không không leo mượn đồng khâu ghế thương cái hai đánh ác khoảng chìm chết được khoảng tàu thuyền nghỉ một tím thương tui bàn thương tàu đồng được xe độc giết ba trời mua bạn tàu vàng anh đang tàu chìm ác bơi thuê vẽ hai khâu cái độc hai tám tô thích khâu thuê á trăng là đang lỗi hàng xanh chín thế chín.", new DateTime(1977, 12, 14, 21, 35, 10, 107, DateTimeKin