                    { new Guid("2afa00a2-4d7e-4806-80bb-5c5ed9ca98d3"), "044 Huân Võ Hill, Đà Nẵng, Litva", "Ruộng đâu tủ ác bảy leo ác núi chết bảy mướn xuồng tô nước bốn việc lầu xanh yêu năm tím trăng ác bảy hàng bơi vá thương thích con không vàng chín bè phá sáu lỗi phá khoan xe máy là xuồng tủ kim xanh ngọt đạp vàng làm giày kim vá tám xanh thích yêu dép thì gió hương đồng trời khoan tám hóa thôi quê mua gì bốn tủ trăng khoảng thôi thuê chỉ độc lỗi bàn cửa hết đang may chín đập là đá ờ chết hương ngọt ngọt hết vàng thích giết máy việc chín hương gì biển việc chỉ tô lầu việc xanh ngọt tủ lỗi tô mây sáu sáu mây mướn hai nha đã bơi khâu thuê viết được đánh trăng yêu gió khâu đâu hết đạp làm biển ngọt tôi đâu tủ cửa chín hai đang con khâu biển đạp con thương bàn đạp đạp hai đạp được hàng vá sáu viết nha áo cửa mướn kim núi đang mượn leo bảy đập ác mượn cửa máy leo khoan vàng trời ruộng may đồng áo thì đánh bạn ba tô ruộng sáu gió biển mây lỗi giết đập xanh nước thôi thì cái tám đang chỉ hàng ghế tím xuồng vá cái vẽ hóa giày giày thích thì gió hai mượn ừ đánh đang giết lỗi bốn ngọt bàn hóa vẽ kim nghỉ ờ tím chìm tàu đá lầu khoan việc đạp vá ghét vẽ ghế nghỉ nghỉ thuê đá đạp viết ừ anh máy thế bơi xuồng đánh đỏ giết ba em lầu được năm thương biết bơi khâu chìm thôi bàn vá là đạp thuyền sáu nón phá tủ giày là hết đỏ giết chỉ ruộng vàng mượn việc phá đánh tô độc khoan thương mây con ngọt may giày ờ con trăng thuyền mười hết thì bảy khâu cửa vá được mướn vẽ tím máy xanh yêu thuyền hàng mua hàng con nón dép sáu trăng được biển tám nón lầu mượn hết tôi may thương hai gió biển lỗi ngọt núi năm ngọt bạn bốn áo hết chỉ làm hàng á núi á khoan viết vá mười mười giày mượn đá đang xanh khoảng bảy mượn thì đồng đã thì chỉ yêu gì trăng quần lỗi đang đỏ hóa thương việc anh gió tám khoan đá biển tui chín đạp đâu đâu mướn thương đang đâu nha mây hàng bơi hóa máy nha mua giết phá hóa thương thì năm cái biết cửa lầu khoảng đỏ nước biển làm đâu vàng cái tám mây chỉ nghỉ tím năm chỉ lỗi nước làm đang yêu nha bơi việc ừ may chỉ trời vá vàng hương tám ác nước quần quê mây đã hương viết viết.", "Viết khoảng chết lầu yêu ờ ghét chín giày đang đã đạp tím dép giày nghỉ độc bè chết mười lầu ruộng quần hóa phá yêu vẽ gió tàu tím đâu trăng đá ờ biết đập thuyền nước hết ghét tui thế hai chín đâu chín thế sáu bốn tô thích ác quần cái yêu hết đá kim không chỉ nón khâu bạn núi biển thuyền hai ác thôi chìm độc vàng bơi tím làm chỉ được được áo tám áo chỉ việc nước khâu chìm thì á tím em thuê đã biết ba yêu hết thích bè bốn ác vẽ hương khâu chín ghét chỉ ba thuê đạp tám thì cửa đạp mượn bạn hết ghét mười chín bảy quê leo hương ruộng ờ bơi tôi nước hai đánh xuồng thì ba xanh đồng dép làm quê tủ ngọt ba ruộng lầu tô nón biển cửa là anh sáu làm nha đã chín ngọt mượn đập ghế nhà nghỉ đá tím hai làm độc không máy anh ừ ừ may á nước núi không cái khâu hết bè nón gió khoan đánh con hết mướn bốn hương áo đá gì vẽ thương sáu thuê máy quần chìm lầu thương là anh ghét cái ruộng độc xe phá lỗi anh bạn thôi ờ là bè giày hương ác ghế ghế kim ờ dép xuồng không thì mây yêu em tô yêu hóa nghỉ quần năm bè anh đang nước ghế hết kim tàu gió không được chìm lầu mua bốn thì đánh quần bạn bảy ngọt chết đồng chết sáu yêu kim thế gió hai ruộng cái chìm sáu mướn trời thế con nước thế núi ác cửa biết một hương tô vá biết ác thuyền biết phá núi khâu thì tô nha một tàu một trăng trăng quê trời chín hết nha xuồng đá được đồng ác là mây việc đỏ trăng em mười cửa em mượn thuê mười cái làm giày tàu xanh cái trăng ngọt tám nghỉ chín may hàng ờ anh thích đỏ không độc kim dép tôi quần năm đã gì bạn mượn nhà hương khoan biết xe mượn ghế ghét khoan gió không xanh hai lỗi ờ nhà á bàn khâu đạp nón làm may tám được nghỉ ghế bàn thuyền bàn tôi vàng chết xanh thì vẽ viết giày ờ là đập việc đã nước thuyền bè đang chỉ mây phá khâu ghế á hết ác xe khoan mây được hàng làm viết anh bảy kim là thuê xe thuyền mười nước mướn nghỉ bạn mười ghét ác xanh anh may gì không thuyền em thích gì năm hai nha năm nha thuê áo biết tủ chín vá bảy phá lỗi mượn anh ruộng đang đập ruộng hàng cái áo quê mượn hết đâu chín sáu nghỉ đã năm bè nón bạn đồng.", new DateTime(1970, 4, 28, 4, 3, 7, 667, DateTimeKind.Local).AddTicks(4729), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hồng Thắm Đinh", "\"https://picsum.photos/400/300/?image=429\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Cần Thơ", "Dương" },
                    { new Guid("45c09569-32f5-442c-ac25-3e9802b957ca"), "531 Thụy Du Drives, Quảng Bình, Serbia", "Vàng tủ hết yêu con anh lầu con mười độc mướn nhà hết hương ba nghỉ xuồng độc mượn đánh làm biết thích sáu con bè trời núi bảy con xanh bảy ghét chìm khâu khâu lỗi năm tàu độc viết leo tám đâu mây chìm đạp thuê đâu xuồng chín giày con thuyền núi đá vàng giày anh đỏ may giết biển dép mướn tím xuồng xanh hai khâu áo chết phá thuyền chết mây giày thôi bảy đỏ á mây leo dép đánh gió thế vá lầu tô bảy nón xanh tím chín bơi ờ đang ghế nước nghỉ ghế chỉ giày ruộng quê vá xuồng tím bạn nha trời anh tàu mười á xanh quê máy con cái kim quần ừ giày ghét núi lầu lầu vẽ con quần khoan thích tủ cửa á núi mượn mây trời tủ khâu máy vẽ nước nước quần đánh bảy khâu bàn viết cái làm thôi đồng nước bè khâu nón ba giết xuồng hết đập là hết viết ba con tám đá làm đập hết hương bàn mua bàn ác tô ghét ác bảy tô tô quần con trời bè đá giết vẽ giết đồng đánh hết hương độc thuê ghét gió lỗi núi đập đập thích tôi yêu mây ghét bàn biển sáu biển nhà hai hai mười quần thế cái khoảng anh áo bơi ngọt ghét độc gió năm bảy không ừ ruộng tui bốn năm việc thôi thích phá ờ áo ghét em dép tàu mượn ngọt làm ừ may năm cửa xuồng chìm thương xe hết chìm áo nón ờ thuyền vẽ nón mua được thôi trăng em máy lầu máy không bạn leo ngọt xuồng lầu ác làm mượn chìm đánh đánh hàng bạn tô thì bè ác á may xanh con tím bàn một việc sáu máy mua chìm lỗi nghỉ ngọt thuyền đã bàn thế biển kim ruộng ghế ờ làm là yêu hai hai leo viết em sáu chìm ừ tủ nhà xe tám thương biết ngọt ruộng gió khoảng giày trời thương đâu tui nha hàng nước đỏ một quần tàu kim nghỉ quê mượn khoảng cửa phá ờ trời tui thích tàu quê ruộng bạn sáu chìm tui thôi khâu ruộng thuê khâu được thuyền là quê bạn ghét đạp tím là gió vá ờ đá trời tôi viết ừ trăng may áo mười là quần hai may sáu vẽ quê trời áo.", "Giết tám gì trời làm xanh tôi tôi nghỉ kim xuồng hương một ghét bàn là viết áo hàng chết xuồng bè chỉ vẽ là hàng trăng là leo kim á nghỉ yêu đánh trời lỗi bơi hóa làm nhà xanh chỉ dép hương tủ lỗi chết thuyền khoan quê ờ mướn đá hàng việc ghét đá đánh nhà tui đỏ xuồng chín phá bạn em cái may núi bơi dép ghét thuyền thế đang là tôi lầu giết là hàng bốn đâu đang được phá ghét gì xuồng được được dép cửa thì việc tím bốn em cái tủ chỉ ruộng may tàu là đạp áo việc đánh bốn tám độc tui đã chết thương hai hai tím thì yêu bàn em được hai mười hóa chỉ chỉ lỗi vẽ bảy bơi quần giết xanh tô làm bàn giết tủ chín chín tui cái dép biển tui ờ năm ờ con làm á con đồng tím đánh cái thích sáu tôi em leo quần lỗi khâu gió giết khâu ghế chìm hóa kim mười mười tui đạp trời khâu ngọt ngọt phá mây sáu thuê đánh kim đánh hai một tủ xuồng đã ác bạn nón kim mua ba nước con gió sáu nha máy bạn biết thuê áo nhà nón giày quê lầu nha mười tám xuồng hết xe đập đá kim hai đập việc làm mây năm trời ruộng độc chìm tô xe thôi anh anh bạn giày được nước vá hết ghế dép đập đang không tám sáu thuyền năm em tô áo ngọt độc chết độc ghét mượn lầu đã xe thương gió gió được khoảng gì xuồng hai đâu thuyền xanh á đá mây bốn đã mua giày đồng vàng tủ đâu lỗi không chết thương xe anh ngọt nước tô cửa gì chìm bốn viết hương chỉ gió viết biển viết biển áo sáu biết bơi xuồng tủ yêu vẽ nón gì ngọt tím kim thôi yêu đỏ biển không đánh mượn thôi kim nước đã gió đá đánh độc ác đạp thuê một làm mười tím là hai quê chết tím hết chìm là đỏ vẽ hóa đang đánh may cửa nhà tủ thôi tủ bảy hai xe bốn ác thôi quần em quần đỏ khâu núi kim ác thuê chỉ một chỉ ác chìm xe quê thương đồng tủ khoan biết xe ba phá nón mượn thích xe ác không đập đã thuyền mây làm việc em độc ngọt nghỉ vá chỉ vẽ mượn tô thương.", new DateTime(1948, 11, 7, 11, 18, 5, 253, DateTimeKind.Local).AddTicks(8217), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Tâm Nhi Dương", "\"https://picsum.photos/400/300/?image=736\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hậu Giang", "Phùng" },
                    { new Guid("4f1c13d4-2c93-4ca8-9ea5-a40283630f29"), "87865 Dương Crest, Hà Nội, Mông Cổ", "Yêu cái là ghế ờ thuê bảy thuê một lỗi lỗi xuồng giày tím năm tui chỉ chín hết hóa không hàng bàn chết giết giày đánh chín được cái viết nghỉ máy bè độc dép vàng thích sáu ba chết quần biết ờ vẽ đá nón hai thuê bơi đánh hóa chín yêu hai hàng tím bảy trời cửa đỏ hết nhà hóa thương một nghỉ chỉ mượn hai mây đạp phá thuyền đạp yêu tô dép chìm tô chín đập mua hàng kim đập đá hương núi quê đâu không thích làm lầu trời thì hết tủ quần thương xanh quần ngọt may ghét làm năm mượn cái bàn yêu yêu biết đồng không ngọt nhà thích ác thì đập ừ tàu ghét không thì mây quần năm tôi hết hết đã yêu hết ghế chìm hương nón sáu giết con thì giày bàn anh gì máy máy ghét hết khoảng giết khoảng quê biết bàn mây ác hương đã thuê năm núi thuyền thế đánh hai hóa gió mượn độc khoảng giết hết đạp chìm khoảng quê tủ lỗi đá đang mướn đã con đã bàn vàng núi viết gì đã khoan mây em trăng bạn bè xuồng leo mây việc con nước nước đánh hương hai nha ba ờ ờ áo đồng hóa nón con đang vàng một đánh núi vá hương lầu xanh phá năm nghỉ ruộng mây biển nước bơi mướn thích nghỉ hàng xanh cái lầu thích đập hết đỏ đỏ tôi em leo tủ đâu anh chết xanh bơi dép năm hương bảy ừ gió độc vàng bơi cửa cửa núi hai mướn chín ghế bơi ác tím bơi năm vẽ lỗi tủ đang chìm là vàng trời tôi biển không thích đạp tám chín nón gì con núi chín mua tôi vẽ hết trời chết là tui không thế đá gì mướn đang đá tím sáu thích con xe tui hai việc hai một vẽ anh ờ ghế xanh tàu tô leo bơi nhà khâu thuyền viết hết tô bảy mượn xanh trăng biển đỏ anh cửa kim khoảng ác máy ngọt đánh anh nghỉ tô năm nước đang lầu mười xe hương thế sáu vẽ ác hàng gió ừ chín quê tám lỗi mua độc thương phá thương á là không bạn cửa con nghỉ bạn khoảng đồng sáu nghỉ được đánh xuồng độc biển xanh thuyền hết làm dép đỏ anh bốn ừ nghỉ gì nghỉ ghế một hết nón nha anh mướn xe là làm thôi chết chìm chín không đang hàng làm độc một.", "Hàng bàn anh ba gì là ừ quê mượn nước tàu bốn mượn lỗi thì khoan em á viết hai thương không đập nước mướn hết mười nhà khâu đồng ác chìm ác quê lầu thương yêu ghế đang đạp việc việc thôi thế bạn chìm kim tàu độc nước kim cửa bàn chìm vàng mười là con trời không hóa dép ghét áo một đánh sáu thích năm dép con mây kim áo xuồng cái năm hai áo biết đâu không đập không hàng việc chết ờ ruộng nha bè độc hương thuyền ruộng ba trời mua tám khoảng thì mượn được vá ừ chết anh anh cửa bạn ghét dép bè viết hương hai hương giết ba chìm nước bàn đã máy đâu ba viết việc cái chìm á nhà lầu hai áo bảy áo bạn thôi quê tô tàu thương xanh biển ngọt dép được hết quê ngọt chỉ tám khoảng mua vá chỉ tôi vàng ruộng áo quần thuyền cái hai hương giết bè thuyền con hết ghét thuyền quần đang ruộng nón dép gì chết quê ngọt vẽ được bè vàng mượn vẽ đã ruộng em ờ mướn quê việc á tím nón vẽ ba bạn vá quê khoan thôi chết đâu xuồng tôi tủ yêu được đang kim tôi trời tàu hết ghét hết là đâu đánh độc dép bạn trăng chết nghỉ khâu tui bảy tủ tô bạn khoan khâu bơi mười anh bạn đã đánh hàng máy khâu đâu phá khâu độc tủ đập đâu dép con viết thì ghế thuê hóa hết ừ cửa xanh hóa vàng năm là vàng gió mười hóa áo cái mua đạp làm trăng quần khâu vẽ ngọt ờ núi ác ừ nước hai mua đang tủ mượn được mây làm một thì con ruộng xe cái đá cái biển ác thuê lỗi vàng kim sáu kim hóa giết ừ thuyền tui dép ghế ghế hết nhà thôi chín chỉ nước chín phá quê nha nước ờ núi áo cửa tủ may vá một cửa giết gió em bốn may tủ chín tôi việc phá đạp tím phá lầu giết khâu hương khoan việc bàn tui mây gió bàn cái vẽ nước ba bạn máy biết phá trời vàng không hương đỏ dép chỉ con nhà việc nước khâu chín tôi chết leo khâu may bốn chìm gió giày được không mười khâu quần leo hai mượn nhà đâu hết núi đã thì vá giày hai hai đánh ghét vẽ giết bảy đánh hai phá đánh quê em đã ngọt ngọt nghỉ tám thì tôi độc đạp ba bốn trời kim giày xanh cửa nghỉ tám bè lỗi độc em khoan thích thôi đã lỗi yêu khoảng ừ.", new DateTime(1948, 10, 30, 23, 9, 44, 688, DateTimeKind.Local).AddTicks(8617), null, new 