                    { new Guid("569d9d7a-3268-4d04-9bae-7ee7f2c875d6"), "110 Thy Trúc Flats, Đà Nẵng, Algérie", "Á bè quần vàng đồng sáu đánh độc mây thích gió yêu nón tàu năm ruộng hương yêu ngọt thuyền mười dép khoảng độc chín kim đập tím nghỉ xanh đồng mướn tui ác mười leo tám biết hóa hương vá anh lầu mua đỏ con đánh hết đã tô được tàu bảy mướn nha thuê cửa nón ghế xe vá vá nước đang làm chín thế quần cửa dép ghế bè hương ừ viết quần giết tàu nghỉ hàng thuyền leo mượn hóa vá ừ xuồng ruộng hương quần hóa anh thuyền độc leo thế mua bảy vàng ờ đâu nón vẽ ác tủ chín đỏ cái chết thuyền đâu hai đánh quê trời ba xe là độc mua độc hai ngọt chết mua làm làm giết quê em yêu xanh năm sáu thuyền kim đâu cái ghét nhà việc nước mười quê vá tủ tôi áo bè mướn làm cửa bè cái thương chín yêu ừ hương ruộng bốn ác năm năm chìm leo khoảng là yêu thích khoan đã nón hàng là phá bè mua chín khoan xanh đang mướn ác núi đồng lỗi ác thích ngọt ngọt leo chín xanh đã giết đang á bàn làm mười dép ghét mua ừ ừ tàu gì vá đập bạn ác á ờ đỏ đập đồng nhà khâu tô trăng hương tím chín áo tím xuồng ghét nhà tôi phá hàng nước trời ruộng độc tàu biết á bảy dép làm đang nha biết vàng vàng trời đâu đá bảy mua nghỉ nha tui nhà trời tui đỏ hàng lầu không bè bàn xe hai phá ruộng đá đồng hóa thì quê mười thuê núi việc đồng ba thuyền lỗi nhà quần áo mua chết là mướn lỗi hết mười đập quần đỏ được ba bốn được ờ chết con thích leo tủ quê ừ viết chỉ leo bảy ừ hóa tàu nhà đã đá ờ ác á kim khoảng mười ghế khoan ba nước con áo biển đạp biết giết mượn vàng đồng vá á kim là em anh làm gió ghét thôi mượn kim bàn chín bốn mướn xe vàng là thuê thì may mây là việc bè gì xuồng độc thì trời khoan nghỉ hàng quê không nhà thì trời ruộng một núi tô nha thôi quê hàng yêu mua mướn cửa mười được ruộng vá vàng giết đạp phá mượn khoan giày vàng gì ghế dép gì ác quần.", "Giày trăng tám tám cái gì đạp bảy là mướn mây đang bàn bạn chết tô là ừ cái không anh máy chỉ ghét bạn may mua gì vá được đỏ chín đạp bơi nha nón viết vá chết biển biển không đồng đạp vá đạp mua vàng một giày quần làm nhà lỗi trăng lầu may đập đã năm đánh việc dép biết đồng khoan nha đạp ghế ba dép tủ chỉ chỉ sáu khoan hóa cái nón mướn bốn hóa leo thuê chỉ tôi bàn bàn bè đạp ác đánh tui khoảng leo xe nước biển vàng đập á may tủ biết tàu tàu đạp phá thì khoan làm mười đỏ thôi khâu á việc ác tám khoảng sáu tôi chìm trời tôi được khoảng máy bạn quê tám á hóa mướn mướn xuồng gì đã thuyền làm thuyền được không giày hàng chìm vẽ biết máy bạn năm phá không lỗi ba hết năm ghế quê đạp đỏ dép vá kim chết lầu đồng đang đâu nha đâu phá mượn đánh tô em đang năm ác bơi sáu xanh viết may tàu đánh một đâu hết thì bơi mượn biển hết mây yêu được may đỏ chết trời hương độc tôi không đồng bơi hóa chết hết ngọt vá đánh em đá ác là khoan con hết cửa mượn chìm ba nha trời năm chìm đỏ mua đồng nón đã em trăng tám gì viết hương đá chín chỉ vá hết đạp thôi bảy bơi năm ờ hết ruộng may ghế yêu bảy quần máy hương trăng khâu máy áo mười bàn bàn bạn núi giết bơi may một không ghế mây ghế em tím đập chết vẽ mười vá ghét khâu đồng bơi á thôi bốn hai thì núi biển khâu xe nghỉ biết bạn thuê việc bốn máy vá hương năm phá làm nón là ghét hết bốn đập bàn cái không bốn đá vẽ núi vẽ hết ngọt việc nước mua xe thì mây yêu tô chín nghỉ yêu mướn giết bàn ba lầu đạp mua thuyền chỉ tui đạp cái thôi giày năm được phá bạn ghế á anh anh khâu ruộng thôi hai kim gió ba mượn giết kim khâu ngọt xanh con nón chết leo mây mua xuồng xe nhà cửa con kim đập ruộng làm trăng là một anh vá em may một thuê viết núi anh không may bảy bạn cái ghế hương bảy ghế nón.", new DateTime(1994, 10, 15, 3, 30, 51, 518, DateTimeKind.Local).AddTicks(2850), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hải Miên Đinh", "\"https://picsum.photos/400/300/?image=737\"", null, new DateTimeOffset(new DateTime(1, 1, 1,