                    { new Guid("676c7534-9b77-4dce-8000-b438bfe3e5c0"), "739 Lê Walk, Đắk Nông, Séc", "Đồng khoảng bảy ba bè thuê mua biển một nha thích chín leo ác lầu tôi bạn đỏ kim được đang đạp thuyền biển con thương một trời độc là giày ác khâu dép sáu xe tô tám xuồng không tủ khâu hóa viết á bơi thuyền nhà bạn hóa được nha dép giày bè ghét hết đánh khoảng hương may bạn yêu á máy một vàng hết bơi hết ruộng may thuyền mười làm mây đánh hóa xe máy ngọt đánh mướn xe tám được gió giết chìm biết hết yêu tám là ừ đạp thuyền việc đâu phá khoảng lỗi đã hương thương đồng đạp hóa tôi kim khâu quần đập biết được đồng đâu khoảng khoảng đâu biết đánh được ba gió bảy đã đạp lỗi làm ghét gió ừ hương sáu nước ghế mua ngọt thôi anh bơi kim quê trăng ngọt thuyền bảy hàng nghỉ biển đang bảy hương biết á mượn đập bè là hết núi hàng tàu năm đánh thuyền thế việc thuê hết ờ áo thế ruộng chết tui được viết chín đồng mây giày đá bốn thôi sáu chín đánh biển đồng ba hết bè giết mây ghét đạp nón là biết đồng nón xuồng bè ngọt lầu hết may thì bè cái hàng quê bạn tím thì nha ờ bảy quần sáu kim gió mây mây ờ mười nhà đang ngọt thương xanh ba năm độc tủ mua bàn hóa hương được hương chết mượn đạp tàu trời nhà độc không xanh khâu ờ đạp độc lỗi đã thuê ghế thương trăng yêu xe á lầu làm đánh tám biết biết ác được không bàn trời em bàn đạp vàng giết anh quê lỗi làm ghế việc không ngọt khoảng chín sáu vá mua vàng chỉ thương thuê giết thích mua hết tui nón tui đạp bè làm cửa ghét tàu thương tủ bè việc đá quê bơi thích viết đá đỏ đỏ biển may hết biển anh một ờ đập tám vá độc yêu bè vá ờ nón năm độc leo làm bảy may tui quần việc thích nha bạn gì thích hết trăng khoan giết đã mướn hóa tủ trời bạn mướn độc con gì là bốn mây đã bạn bảy áo xe viết bảy cái đập nghỉ nha biết biển bàn hết vá đánh núi á thích chín mua núi khâu vá đã gì con hóa đang chết dép hết khâu nghỉ may thuê kim không bàn sáu xe nhà lầu đâu năm dép đá khâu nghỉ mượn đâu đã núi thuê yêu quần con vàng tím nghỉ đỏ quần đánh giày yêu anh dép ờ đâu chín may vá tám khoảng cái thích gì bơi đánh ngọt.", "Đập mướn nhà thế nha không bảy thôi trời may máy khoảng đang mười ác đánh thuê năm được lầu mây hết mây thì hàng nhà đâu mười anh xanh quê mây yêu đâu tôi hương sáu bạn ghế mua đá trăng em núi núi chết cửa đồng ba núi ghét xe hàng giết gì ruộng nón may gì lỗi viết đỏ bơi lầu giết biển thương đánh hết mướn trăng bàn ghế xanh tàu vàng được núi lầu tủ nước thế đang thương vẽ ba xanh giày đá yêu ừ đã mướn độc xuồng anh biết giày gió làm hương được làm leo vàng con tôi bạn ba bảy tàu năm bè đỏ bè đỏ khâu núi khâu tủ trời thích vẽ á xe núi bàn độc đá đánh đâu thôi viết hàng hai thương việc ba làm độc núi thôi xanh trời chỉ nghỉ thế đập nước dép biển thuê áo vẽ đang làm lỗi thì ác yêu lầu thôi thương gì đồng việc được vẽ mướn núi ghế hương khoan đồng hàng hết bảy con tủ đâu gì tàu chín bơi chìm biết tám thuê đập trời một lỗi hết nghỉ nha áo hết bàn bốn chỉ đâu thì tô thương chỉ hương trời mượn hàng thuê ba hai bơi thương ghét yêu năm con là mây tủ thế được vá giày áo bảy em bàn ba bạn mượn ruộng mây đánh hết xanh ừ hết ờ vá bảy tui thích khoảng trăng cái viết thế yêu độc chìm năm hai khâu thương thôi lầu nhà chìm xuồng kim chìm tô nước chín viết hương kim trời biển thôi là trời ghế làm thì xanh chìm năm bàn thuyền mua khoan việc đồng khoan đánh núi bảy chìm tàu khoảng biển vá á mây ờ ờ viết chết tô quê gì giết mây nước mua quê đâu ừ vá xe vá gió ruộng quần kim làm hàng bạn xuồng nón giày tám tui hết trời dép ba quê lỗi việc ghế xuồng kim ờ mượn yêu lỗi hết không bốn cửa ba độc anh khâu thuê viết ghế bè vàng đâu mướn xe tôi quê đập ghét ghét máy giày trời đánh cửa nha áo khâu khoảng đập ba biển nha xe xe vá nón biết khâu tám tím việc không không mười quê hóa tủ ruộng vẽ ghế trời đã á ngọt lầu đâu là ờ hết đã tô quần thích nón dép đang xanh đồng ờ đá trời vàng cửa bốn cửa hai trăng được lỗi tím được đá hương chết con cửa vàng bốn biết thì chín kim thì may gì trời ba lỗi hai bốn mười khoan biết đỏ bơi một hóa thế giày nón đã quê mướn biết bè đạp phá vá xe lỗi bơi thì nhà hết ờ sáu cái đá mười tôi trăng.", new DateTime(1948, 12, 31, 0, 53, 20, 145, DateTimeKind.Local).AddTicks(3974), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Thành Danh Phan", "\"https://picsum.photos/400/300/?image=832\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Quảng Bình", "Đào" },
                    { new Guid("6a00ef06-8a3d-4980-8662-887dccb34b49"), "399 Đinh Pines, Kiên Giang, Nam Sudan", "Nghỉ không em bốn thuyền bè xe đã áo nón leo trời đã gì không nghỉ thích cái trăng á ừ hai phá làm gió tím bơi nước thôi bàn biển một đỏ bảy quê thuê đang thuyền chìm đỏ quê đỏ là mua anh đập thuê tủ ừ được bè xuồng làm may ngọt ruộng quần hết không biết năm bốn cửa ờ khoan biết bè cửa lỗi đâu áo gì bơi hết vá anh làm biển mướn xanh bạn tàu may chín thuê quần gió bàn cái đỏ trời chỉ ừ vẽ hết hai ghét ghế ghế yêu thương chỉ không mướn ghét thích chỉ dép sáu chết lỗi biển ngọt thôi chỉ mua thương ừ chín đá mua gió nghỉ á sáu tàu xuồng đánh làm khoan vàng nghỉ núi hết thuê thì sáu đâu thuê bè làm đâu thương bơi không việc vá thì việc đá đánh viết núi chết may đồng chết chín tui hóa thôi lỗi làm trăng gió hết mây khoảng đâu bàn đang nón ruộng đồng bạn khoảng tủ đã đá bốn mượn đã mây giết ghét tàu may mây chìm gì bảy chín tô sáu lỗi ừ hương biết dép ghét ghét chìm xuồng thì không độc núi xuồng phá dép thì đánh xanh bàn phá quê thuyền đỏ mua mướn giết bốn chết tôi phá khoan tàu bàn viết quần đá máy trăng thì hàng hàng tôi giày đá ờ bè đồng giết mượn bè lỗi đồng ghế leo quê khoan đỏ làm vẽ nha ba bàn quê thuyền khâu xe hết đang mua áo đã bàn nón chỉ đang đã đồng may đập ngọt kim hàng ác độc đạp ghế giày á yêu tô việc tô khoảng được trời giết đá tô đã nha lầu nha ghế thôi nghỉ trời đâu biết một ruộng lầu hàng tô một em là ngọt ruộng xuồng thương đã dép ghế thích gió nước thế được giày tàu đang nhà là thuê mượn gì bàn là mười đá đỏ mua khoảng tàu xe áo ruộng đánh khoảng mướn ghét vàng đập em năm á quần bè hết độc một hết tui không thì ghét không hàng nón đỏ khoảng thuyền vẽ hàng anh bơi chết thế gì gì hết chỉ tám khâu vá nhà bốn hóa gió hết thế nón vẽ thích ghế gì thuê trăng thì hai nhà đâu thích nha ờ tôi ghế vá nhà may hóa viết giày khâu tô hương đã ác bàn mười hai bàn một xuồng tím nón hóa leo việc biết áo ờ gì xuồng khâu hết ừ đập ghét anh giày nước đỏ ruộng hết đã bàn hàng vẽ mười bàn phá năm đập giày cửa đang dép núi khoảng giày chín sáu nha dép em ghét đánh cửa bốn làm bạn hóa quần tàu bảy ác con sáu hóa cửa xe lầu núi năm xanh leo bảy tám trăng nước hai đang vàng chết nha đánh dép hai.", "Đánh viết tám đá biển nha hương may sáu ngọt vàng thuê dép núi ờ trăng mười vá leo giày mượn không quần được leo là vẽ mượn làm giày đạp chỉ vá lầu ờ hàng độc ừ làm được gì đỏ nhà tôi lầu độc khâu em khoảng biển đang viết đỏ lỗi mua đang leo mây bảy sáu cửa thôi kim thế dép tui thuê độc thuê tím anh bè nhà thích tủ vàng xuồng đang bạn hết chín gì hết trời kim đánh vá mua trăng đâu con sáu chìm nghỉ tui sáu quần bè chỉ con cửa giày tôi thuê được thích ừ đồng á mua em xe ngọt chết đang bè quần tàu nước thôi thuyền đập trăng hai mua chìm nha chín tím một leo khoảng bè vẽ đập đồng chết cái hóa vẽ mây mười hàng mướn ngọt xe nha nhà cửa em khoảng đá tô núi ghét vẽ tui bàn biết viết mượn quê giày hóa tô con độc quần thuyền giết thương vá thương nhà giày thương bốn áo đâu vàng nước mười hết nhà ác vàng mây nước quê đánh con quê thế nghỉ là tám nhà tám ừ gì lầu phá mây chỉ yêu xanh chìm mướn khoan gió ngọt tám cái đập sáu không ác khoan đồng là độc bơi yêu may viết yêu bảy hai khoan được chìm thương xuồng trăng đạp thuyền mua hết đánh chỉ xe hai bạn chỉ tui gì bơi gió ba em mướn đồng em phá đá đánh ghế bè thế gió viết á thì đang bàn giày thích núi kim thế một tàu chín quần việc chín đâu ghế gì tám hương đập tui hết cái bơi đánh khoan may khoan quê chìm xanh hóa thuyền tô chín đập yêu ghế hóa viết hết khoan nước đâu đang cửa quần tím thì dép mượn trăng hàng ờ ruộng tôi nghỉ cửa chết nhà tui thuê độc nước xanh xanh thì đâu ác tôi yêu chìm khoan gì bàn mướn ác giày nha một làm cửa đánh nha giết bốn tím quê biết may nước hàng năm gì vẽ biết mười vẽ thuê thương xe năm á thì mua ghế làm một yêu nhà quần đánh trời đạp yêu ba em con xe đang gì đạp anh quê mười núi á chết bảy hương mướn làm ghế đồng chết chìm tủ đánh khoan đạp chín hết cửa năm độc ruộng đạp một biết chỉ phá mây việc trời khoan thích thế núi chỉ ruộng ba hai tám giết bốn vẽ chín đang mười nhà đâu khâu ác dép yêu chìm ghét bạn ờ chín thích đánh nghỉ ba thích nha.", new DateTime(1983, 11, 2, 12, 14, 18, 666, DateTimeKind.Local).AddTicks(9510), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Kim Thảo Tô", "\"https://picsum.photos/400/300/?image=97\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Phú Yên", "Trịnh" },
                    { new Guid("865359d1-301b-4199-a759-3208471801be"), "8860 Lâm Dũng Walks, Quảng Trị, Ai Cập", "Ghét đập trăng dép thế hai khâu biết hương khoan quần nhà mướn viết một nón yêu chỉ chỉ thương đã hết đánh gì viết yêu nha chỉ biết tím tím hết mượn ác gì mười xuồng xuồng ừ mua cái mua đỏ ghét lỗi cái thì vá máy hết thương đồng leo nước gì đánh ghế kim biển em thương nón hàng nước đã hết tàu tím đâu leo nước thuê hương đâu mướn đâu ghế quê ờ em đạp thôi nghỉ bè đập mướn đánh ghế xanh lầu hương hàng cái đã hàng mua nước đá máy lầu biển không núi thế ghế ừ mười đánh bảy tám khoảng thôi năm bốn đã đang nhà đã chín thế quần vẽ biển quê tàu một hàng được yêu chết nghỉ là bốn may quần ác hai nghỉ mượn lầu nón tôi bốn nón hết ờ mướn đỏ giết may tím phá kim lỗi chìm hết thích làm trời tím cái bốn đá ờ nón nước hương đồng mướn biết bàn thuyền hết nước gì mua chết yêu viết vàng mười ngọt cái đồng đá núi hết được hàng đồng bạn gió thế thuyền làm mười khâu bàn mười thế thế tô thuê việc ngọt thương ờ hai biết con độc bốn là trăng thích thích là hương tui hương tôi thuyền xuồng vá ờ bạn ác ghét chín máy việc bốn nghỉ thôi đang sáu xanh lỗi nghỉ hóa là ba tàu con đỏ ghét đỏ lỗi mười phá thương đánh vẽ ruộng đạp nón giết khoảng tám giày ba lầu mua tím đạp á ghế quê khoan mượn trăng vàng trăng khoảng đồng giết đánh ờ xe được thôi bốn việc tủ cái được khoan lỗi biết bơi chìm biển biển ghét việc nón mua thương em gió hai thương nhà nước hàng giết á chỉ thì mượn giết hết núi đã đồng đạp xuồng tàu mây ghế tôi hàng xuồng hết kim năm đập thôi lầu tủ hương tám vẽ ác chết leo ba thì mua ba nhà giày bè tô xuồng thế giết đạp xanh ngọt mua mây bàn lầu mướn cửa quần vàng gió thuê em yêu nha mượn á bảy quần quần thì dép giết đá trăng vẽ bàn nghỉ vàng nón vàng tím gió vá lầu tím nha đâu đỏ tô viết ghế nón leo đá thế làm ác kim mười vàng yêu hóa biết yêu đạp nghỉ thuyền mướn khâu kim đang thì biết bạn lầu gì mua nha nhà khoảng mười sáu lầu mượn quê đạp cái độc á hương đánh quê thế á máy leo ngọt một ruộng trời máy chín thương tui tàu chín nhà quần hai chết việc được giết lầu núi khoảng ba xuồng thích mây mua chết được tui đỏ cửa mua ờ bơi kim viết đập giày bảy lỗi vàng thế bè thế ghét may khoảng.", "Xanh tủ thuyền ruộng em ác hương hàng yêu tám ngọt bàn máy đã làm tủ phá bè mười quần thuyền hóa yêu viết đang đang đang bàn mướn khoan là thương quê ác mua biết khoan ghế gió giết yêu leo chìm lỗi mười đập đồng vá thương á tui giày hóa một việc anh dép tàu mua đá xuồng kim hết giày đỏ hóa anh thuyền đánh ba phá đạp là trăng không tui đỏ tô giày ba bốn trăng quần gió mua núi cửa phá chìm lỗi kim máy đồng hàng đạp hai tui ngọt hết chín hết cái thuê không khâu ừ đạp tôi đập được trăng một bàn chìm đánh bạn chết mua bạn ờ đỏ đồng sáu một quần leo đỏ hương chỉ đâu chết ruộng mua bè lỗi vá mười đá trăng yêu trăng bơi tám em năm nhà lầu anh việc leo bơi may xe bảy tím bốn nha anh việc tui đang không đá biết lỗi bơi hương phá dép xanh độc khoan em con năm mua đạp đánh thuyền nón ruộng lỗi làm tủ leo tô đã không ruộng ừ nghỉ trăng dép ừ núi ngọt được khoan viết em bàn thuê chìm bàn thế bốn mướn vá ác đập chết đỏ hai không đang ngọt em máy thế may xuồng khoảng bốn may bảy leo áo mây cửa mượn biết thôi thì thương sáu con dép thuyền nghỉ kim xuồng nghỉ ghế nhà con may đồng giết làm bạn nước thích kim sáu hai đồng nghỉ xe khâu chết á con ngọt chết không á đạp lầu lỗi may tủ thích tủ thương thương em đâu mượn áo chết đánh con hàng đạp biển trời mướn hương hương thuyền bảy bốn con chín viết làm mua làm nha bàn giày ngọt gió ghét việc đạp bạn tui giày thì cái giết thôi em thích núi ghét biết khâu nha anh cửa việc gì khoảng hết giày đồng ghét tím quần ghét khoảng hết ghét chết giày nước quần bơi thuê may xuồng tôi xanh đạp con đá núi ừ cái tủ bảy trời thuyền tủ bảy xe ghế đá vá em đâu việc con mượn mướn đập năm độc tàu đồng trời nón bè nhà chín hàng máy đạp là ngọt hàng bàn xanh hết tủ bốn năm tô gì anh vàng đá ba được nha em khoan thôi làm gió dép vàng mây mượn gì