                    { new Guid("8d2b16b2-13a9-4515-8300-9085ab2ca228"), "89102 Đỗ Meadow, Long An, Mông Cổ", "Bạn lầu đâu hương ba khâu mượn may đang dép tàu thôi ác kim con gió ghế thương đồng xe quần mượn ghế biển chết xe ác mua đạp áo á giết biết năm ba đạp đã ghế máy không thích tủ thích xuồng tô vẽ khoảng ác bàn tôi anh khoảng độc áo thì ừ khoan yêu mười á đạp lỗi ngọt nhà độc núi yêu hàng ghét nón giày yêu xe máy dép vàng xuồng hai lỗi thôi đã trời đập vàng ác dép ghế áo tủ bạn ừ nghỉ ghét đập lỗi được hóa á đỏ gì mua khoảng thuê ruộng thích bàn ngọt xuồng khoan thì áo hàng con giày gì thì ngọt nha thế đạp khoan thôi trăng đập thế nghỉ ruộng giày anh nghỉ bơi chỉ làm làm thương hết bốn tủ viết kim máy biển đang ừ vàng hai đã đang bơi phá hàng vẽ bạn thuê tô vá bàn thích thương chỉ con cửa xanh thích chìm gió khoan ừ viết đang yêu năm khâu mua chín mua nha á bốn sáu tô chỉ đạp tô gì biển hết anh tôi thế thế em trăng ngọt gió leo đang thôi hương khâu khâu giết xe bè xanh đánh vá xanh vẽ quần hai thì hương mười giày đang á con ác thuyền đỏ ờ xuồng mướn con thương ác ác tím tủ cửa gió xuồng đập ba xe biển hết tủ áo cái ghét khâu làm tám con hai đạp bơi nón hai ba con em đã con vẽ hai bè ác được được phá sáu thuyền lỗi một thì thương trời lầu bơi biển ghét khoảng bốn yêu hương nước ờ yêu biển bơi ngọt năm á nước một chín làm khâu ghét hóa xuồng á nghỉ cửa biết tím đâu việc độc vẽ tàu thôi bảy nước á đập leo nhà chết mướn làm đạp ờ thôi tô đá chỉ thì sáu xe hết ghét quần năm ghét xanh xe giết đã quần hết thôi núi chết giết áo leo anh mây khoảng trời sáu bơi nước ngọt hàng hết xuồng ruộng thuyền mười biển giày bàn cái đâu gió đập đạp áo thuê bè tám lỗi bè máy bốn leo độc nhà ba tô áo giết quê hàng ngọt anh thương không thuyền ngọt ghế đồng tím may chết tô ghế hương thích con vàng vá đang nha hàng tô yêu chết bơi đạp việc thương ờ dép đâu ác tám ngọt bảy con vàng gió đồng ruộng chín biển viết nón cái tủ tui bè núi tủ máy chết đỏ khoan chỉ đâu trời vá quần leo sáu cửa 