                    { new Guid("9351b80e-a846-46fd-b990-756bc48f7336"), "61616 Trí Hữu Crossing, Hà Giang, Nauru", "Khoảng việc mười tôi dép một nước biết làm thì viết khoan ba khâu thương xuồng thương mây thuê hết vẽ bốn tô em hương giết quần hết hết ghế được hết xuồng trăng thôi bàn máy á hàng là khâu chỉ hương yêu gió cái bàn trời tô đâu vẽ phá nón dép áo thuê bơi lỗi anh đạp đạp biển vàng làm thương mướn thì hai máy mười máy quê tủ khâu nước con thích thì tàu biết anh năm tím làm vẽ thuê gió quê thương máy chìm trời quê mây hết mướn vàng chết đá viết khoảng tô tủ mây ờ lầu lỗi yêu đã chết hết hai á thuyền xanh thôi ác thích dép leo vàng năm đánh phá em sáu ừ con vàng hết ừ lỗi nghỉ gió việc thuê chết tô cửa hết mua thích đồng đánh hết áo thương viết hết núi tủ con thương yêu chìm năm bàn anh ghét leo lầu hết bạn thương tui vá mượn bốn xe nhà mượn độc bè việc hết yêu vẽ tủ ghế bốn cái dép đạp tủ hai hai quần đang núi tàu gì bè là sáu may phá thế lầu viết giày tủ mười hết cái hết mười đánh bàn bảy ác núi thích anh làm đạp giày khoan biết nha thế trời tủ bốn cửa đá lầu biển thích mua đâu bàn đập không gió con giết đồng lỗi chín thuê trăng độc giày trăng nghỉ khoảng thế lầu tủ viết trời thì cửa xuồng gì gió giày đã thuyền vá tím bè làm mười ác leo thế thích một không xuồng hóa nón ba khoảng nghỉ giết mười gió cửa thương tím cái thuyền đập ba khoảng ghét thôi yêu áo mây ruộng khoảng đã nghỉ là thương xe lỗi việc chỉ hết viết mướn nước mua nón lầu ghét lầu vá nha thương thôi đỏ ba leo ừ hương nón khoan mượn nha xanh quần ừ thuyền xe trăng độc bơi núi quê việc đạp nha khoan mây biết quần đập hóa nước thuê nghỉ ác hàng bảy gió một á nhà bảy việc là nghỉ đánh xuồng bốn xe hai đỏ máy một nha xe viết ngọt nước may nón không hai ờ khâu gió anh mười thì kim ruộng sáu mướn ác lầu ờ đập đồng núi tôi thôi vá chìm sáu vẽ thì con gió em tàu lầu chết bè cửa một á mượn may xuồng em đang lầu ghế chết ngọt chìm độc đâu vá núi được ờ áo thuê em tô nước chỉ vá chỉ đồng tôi thuê mười khâu tám hương chỉ đâu tám gió tủ đồng được lầu chết thôi được quê đập thích vàng biết ờ không hóa sáu hương dép năm trăng một tím trăng độc kim vá mua hết nón thì hàng nước đánh ừ ba hương đâu giết đang ba lỗi á bảy hai được nón bàn thích núi cửa thuê thôi tím đạp.", "Mượn ghế ừ gì hương biết vá vá biển mua bảy ờ chìm ờ ác mây chìm dép ờ hết em tủ ác giết cái một lỗi khoảng xuồng khâu giết khâu tàu độc gió yêu bàn trời leo độc mua bàn hàng là đã đỏ lỗi làm tám mượn mây chỉ bàn yêu mây đang kim hóa hai anh thuyền cái khoan thì hai đỏ vàng hàng đập ngọt hóa bạn nước ngọt biển ghét xuồng đồng mướn khoảng bốn bảy được xanh đập em hóa biết á tui đạp quê nón bơi vá tui tám tàu ừ tủ xuồng bạn sáu bàn đá ba đập chỉ ác xanh dép xuồng máy ghế đã quê ngọt ba không đỏ ba thế máy nghỉ thuê xuồng nước yêu ngọt đập hàng trời tủ hàng tôi thuyền giày biển tủ gì em con vẽ bè gì vẽ hóa phá trời cửa dép cửa dép thuê thương đạp nghỉ hương đâu đang nghỉ tím đâu bơi giết mua thích tô bàn trời giày quê áo mướn bàn ghét đập đạp lỗi bảy thôi lầu một đập mượn tám xe máy là biết á bảy hết hàng hết á tô đồng biết làm may đỏ leo ruộng đồng vẽ giày không sáu gì gió em sáu hương thế ác xuồng nón yêu em trăng á thương ba được xanh tàu giết phá hóa mây con cái dép thuê thích chín bảy nước tủ ruộng thuyền máy nghỉ dép á đang ừ thế hóa lầu con làm phá đang viết là anh bạn đạp quê không khoảng gì lầu vàng nghỉ việc thuyền làm vẽ quê giết giày bàn anh anh thuê thì mây thuê tám hương á bè đánh đã quần đã đánh yêu xanh xe làm ừ làm hóa máy sáu xanh tô khoan đạp xe tám xe năm khâu mua hóa hai tôi may được đỏ được không bảy là mười hai phá đá núi ngọt giết làm hai ruộng năm bốn áo vẽ chìm tàu ờ khâu bè lỗi em tui bốn dép á khoan núi dép chín á một kim xuồng đỏ chín cửa nha năm chỉ tím leo em con mượn một ờ bè đỏ đã nước phá gì được lỗi biển ngọt đập bốn núi vẽ thương một đã nước thế đánh chín việc gì được hết trời ruộng chín đồng leo thương thuyền hàng áo khâu khoảng ờ ừ tám đá ghét ờ xe dép là ruộng giết sáu thì không ghét hàng giày viết xuồng núi may hết mười em cái sáu bàn hương cái tủ mướn chín chìm cái bảy á bạn thôi áo đỏ đỏ thuê.", new DateTime(1948, 7, 5, 9, 52, 41, 949, DateTimeKind.Local).AddTicks(5934), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Bữu Toại Đào", "\"https://picsum.photos/400/300/?image=746\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Sơn La", "Lâm" },
                    { new Guid("9ad5804d-32b6-4bb5-b046-d43ef30288b1"), "290 Mai Linh Park, Hòa Bình, Hà Lan", "Đỏ một sáu con ờ kim leo lầu anh xanh đạp lầu tủ đánh ừ đánh tui ừ anh hết hết biển quần tủ việc một may chìm ờ leo chín cửa hết hương vá ghế là đồng xanh gì không trăng mướn đỏ nhà ghét khâu bảy bốn xe chết ruộng tám cái lầu vẽ đá chỉ giết lỗi xuồng ghế mướn dép vá biết anh thích lỗi vàng biết vàng vàng thích thuê năm bốn giày quần ghét chìm con nha một tủ trời được ngọt khâu kim cửa ghế làm thuê kim nha nước chín thế phá nha chết chín thuê kim kim chìm gì ác lầu ừ khâu núi làm gió mây nhà mua ghét bè ghét áo gió viết chín trời đá trời ba đâu mượn không nước hết tôi em ờ làm hai nha là thế vá cái xanh vàng mướn khoan đạp ghế ruộng nhà được lỗi việc trời khoan leo đỏ hương chỉ áo mướn cái chết độc áo tui đá ác ừ mướn mướn mượn đã vá á nón khoảng tám chỉ trăng tím quê kim tám áo khoan bơi anh thì đang cái ác khâu mây năm là là kim tôi tui lầu một anh thuê ghế đá ba bàn leo thì chỉ chìm ghế thế đánh xanh ờ cái trời năm nghỉ kim thì trời áo cửa khâu kim độc biển hết thích nhà ruộng biết giày nón thương tôi thế đồng yêu đỏ giết thích cửa khâu bạn áo ác hai hàng bơi dép mướn chết gió ghét việc xanh tím ờ tím gió dép vàng nón mười đâu hương hết nhà á đạp khoảng nha năm hết may anh tui mượn nghỉ tím ba đang bè không đập trời ruộng leo biển áo con thương lỗi khoảng vàng làm sáu xuồng đá ghế cửa viết tím việc bàn yêu tím hai độc hương bơi nhà một trời chìm tủ thương thôi chỉ hương mượn hết đang bảy không hết mượn viết gió thuê dép đá ừ mây năm mướn tám thuê độc thuê chết tôi đá cửa á viết xanh kim lỗi ghế đã em quê mượn ác ờ gió trăng dép biết lỗi đâu ba đạp bạn trời hàng áo may cái mướn làm thương á đang tàu khoảng ghét trăng mướn đồng mướn biển may thôi bàn trời xuồng chết nón khoảng ba đạp á kim yêu vàng tui phá tô khâu năm xanh ghét nhà.", "Thuê ghế chết một gió giày em tám khâu ba khoảng chết phá ừ nha bàn hương thuê hương mua viết mười sáu hết được con em viết đang tô bàn được hương thế mây làm đang việc hai bơi biển khoan mười đá leo yêu lỗi phá gió áo hết ừ thì quần nghỉ việc đánh vẽ áo giết bảy máy biển ừ thế cửa mượn gió phá đồng đang hương nón viết dép thuê thì đập không gió trăng đá thuê chết nón nước quần nón một làm thuê việc bạn khoảng thương khoan bốn đỏ tôi trăng biển xuồng chín thích chín bốn tàu bảy núi ngọt sáu khoảng đỏ bảy tôi xuồng mười thích một không phá trời quê chìm giày đánh tám quần ghế ngọt quần nước thế một ruộng dép mượn hết mây đang đồng máy là ờ thuyền khoảng vàng sáu biển ruộng một vá ba bảy đâu ghét yêu mượn phá bạn đập con ờ thương chỉ đỏ hóa vàng chỉ cái áo dép đâu hết quê đánh vá đập mướn áo hàng ruộng tím ruộng đồng năm núi được giày viết nghỉ tím vàng ngọt cửa chìm nghỉ sáu hai ờ sáu gì đỏ ngọt leo chết lầu phá hết đá viết ba tôi giày thích nón mười khoan hết tàu cái tím yêu biết áo ừ biết thì được xe cửa xanh ba khoan lỗi xuồng giết chìm thương ừ quần tám đã ác không chỉ giết là tím quê thôi máy trăng ghế áo nón một đang đỏ biển trời nhà được thì nước giày gió chỉ mua bốn đâu nghỉ thương tủ quần đã biển hết một thì bơi đồng chín tui khoan mười hai đá giết viết sáu máy đỏ tủ tím là thôi tàu là bốn ruộng bè xe độc trăng núi năm yêu nước ừ thì hóa cái cửa may trời tui dép khoan thương nha đập nhà hàng hai đồng thuê tám chín bơi tủ trăng giày đỏ nón bơi vẽ được biển anh lầu áo một thế thôi là phá đang nha đã vẽ được ghét chìm khoảng bảy chìm lầu xanh kim kim hương làm áo tàu viết khoảng ờ là tủ dép xanh quê bảy kim vá tủ vàng tui làm ác bảy xanh dép bơi được đang tàu mua cái cửa quê nghỉ hai mây hai anh chỉ ghế tôi đỏ viết là chết đạp tím con ừ trời hương cái sáu năm ác bốn con hết đã bạn nước tôi tô may viết cửa tủ xuồng mua tím á hàng núi việc tàu biết không đã biển gì không khoan tím hương cửa ghét bảy may hai dép ruộng ác hàng xe á thuyền vàng làm khoảng.", new DateTime(1972, 2, 16, 7, 40, 1, 572, DateTimeKind.Local).AddTicks(4026), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Sao Băng Mai", "\"https://picsum.photos/400/300/?image=900\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Yên Bái", "Hoàng" },
                    { new Guid("a141f4ca-5a71-4a78-880c-19fc4dbbe87f"), "22879 Gia Lập Divide, Hưng Yên, El Salvador", "Tím hết phá ruộng vẽ em vẽ ghét đâu bơi cái lầu khoảng đã leo chết thuyền đạp cửa mây vá chết xe kim khoan máy thuyền nón là ờ bốn bàn tôi sáu máy núi mua ghế xanh là ba con ừ anh ruộng kim vàng xe hóa ba đâu lỗi em áo biết leo núi chìm đập bạn đã thuê nước bốn cửa đá bốn đã cái chìm chỉ hai mượn lầu ừ yêu đánh đập cái mượn quần tôi tím quần hết không ngọt chỉ tô ba leo bạn nghỉ năm vá bơi tám chết chết tui mướn thì biết nón vàng ờ bạn thuê nghỉ yêu tủ nghỉ hai là kim bàn ờ bè tui mướn khoảng làm độc đá dép hai cái bè ba đánh hóa mây biển áo được kim mượn đạp năm khoảng máy một độc hóa năm tủ đá kim ruộng đồng đồng hóa ghét năm nha sáu là nước hết bốn năm khoảng tủ á đỏ mướn năm bè đồng gì hóa núi ừ năm ngọt biển nhà tím tím trời xe tủ sáu vá vá đồng tô được bảy á tám bốn tôi bốn vá nha đang em độc xuồng bảy giết gió thương đá trăng ruộng bảy nhà trời thích hết bảy cửa em ờ vẽ vá ruộng lỗi gió vá tàu độc thuyền ghế bảy ừ làm xe đã mười gì núi nha tô được mua nón tô giày khoan nước nhà mua thì hóa mây dép một tô nước núi tui biển lầu hóa làm chỉ thuê viết sáu ghét biển đỏ dép thế không việc ờ thuê vẽ thuê phá tô bốn đánh kim dép lầu trăng làm việc một năm không đạp bốn khâu quê bơi mượn nón em bơi đỏ thôi ba đập máy tô đỏ nghỉ bàn giết hóa kim hết bè trăng con khoảng bốn đá năm tô tím đạp vẽ đồng vá thuyền tô tui tui mười lỗi nghỉ thuê ghét độc chết hết khoảng con chỉ anh mượn đạp một đâu cái tủ bè phá bàn gì mây may áo độc ba thế ừ chín hương cái thích đập độc núi dép nón đỏ tám dép việc bè ghét nhà thì hết bốn vẽ sáu mượn đồng gì mười gì hóa đạp khâu cái mướn hết máy biển độc một mười viết hàng tàu xuồng máy khoảng ờ mười sáu mua hai hết nghỉ thuyền vàng xanh ruộng cửa nón dép khâu gì đánh đỏ thích tủ đâu nghỉ.", "Chỉ leo ruộng mượn hương yêu thuê khoảng tím trời hai tô thuê đồng sáu vá hết kim nón giày ừ tui lỗi đã tủ cửa được thôi hương hàng thôi nha mượn nhà hai hương xanh quần xuồng mướn khoảng sáu gì chìm đâu may việc khoảng xe nhà may một đỏ năm gì tủ một quần quê đỏ chín quần tám biển chìm bốn hương ngọt quê đồng ruộng kim bạn trời đâu thương ngọt trăng hết thuê một chín thôi đánh nghỉ viết ờ đâu tím thôi biết nhà ghét thế nhà cửa quần xe làm xanh nhà ừ vẽ vá tô độc vẽ lỗi chết ghét xe tám khâu phá chỉ trời phá hóa xanh thuê hết hết ruộng bơi em nhà khoảng xanh bè bốn ghế bàn vẽ gì tím vàng lầu chín khoan mướn tui tô gió quê quần khoan tủ đã phá tàu chín núi chết tôi quần chỉ ruộng gì thích viết đá áo yêu ừ viết áo ba mười trời việc trăng quê chìm bàn ngọt thuê thuyền ba việc gì xe ác năm hết nha cửa leo đập nước gì hai đâu lỗi tủ anh mướn hết thuyền tôi thì không một nón cái chết đá được việc đã nhà ghét đỏ chìm mướn là con viết anh leo anh lầu đồng yêu gió độc giày đá nón viết em được chỉ lỗi hai tôi tàu thôi ờ đồng vàng đang chỉ mười giết năm quần bảy đang lầu mây con leo thuê ruộng tím ghế thuê quần biết quê kim chìm tám sáu giày khoan áo lỗi trời được áo tàu núi đỏ thương chết máy leo ngọt bảy anh thuê vá hóa tôi núi tủ đang tui hàng ờ trời hóa bè viết ngọt thương cửa đá giết đạp bạn việc biển anh nước đâu cửa anh máy chín trời cái máy ờ đá tui hết may thì ờ giết thì leo ruộng đá bạn núi tám máy hết vá được ngọt khoan đá lỗi ruộng đạp mượn đá thôi vá bàn viết cửa áo em ghế đạp hết cửa đỏ một biển một thì chết nón lỗi độc gì thuyền hết ác áo hương cái độc tàu áo bốn bơi cửa tui máy là cái khâu bảy nghỉ bảy em gì áo hóa mướn yêu thuyền quần hai viết gì bơi năm giết núi một ừ ghế đã mây gió hàng tui khâu đang gió ghế kim thuê giày xe lỗi đập bạn nước đã áo thôi chết tím sáu cái ừ anh hàng mây độc trời áo máy giày phá lỗi phá năm em vá đã lỗi chín tủ đang xuồng mướn yêu bốn hóa vàng chìm xe khoan.", new DateTime(1992, 10, 25, 4, 19, 33, 561, DateTimeKind.Local).AddTicks(4392), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, nu