                    { new Guid("a50e9d57-236f-402a-92e3-d79b62768579"), "5579 Nguyễn Road, Đắk Nông, Úc", "Mua cái tui kim núi vẽ quần khoảng hóa giết đã thương máy con cái bốn mượn dép giết đâu dép yêu một hết nhà bè khâu hai hương đâu xe đã đồng chìm đánh vá quê ruộng hương leo vẽ đã chín con bơi đánh hết đỏ thuê quê đánh biển cửa tui núi thuyền tám nước áo mượn nước ừ khoảng tô kim hết gió trời phá thuyền thế gì yêu xuồng giày ờ đập nha lầu ngọt leo giày tủ bơi tủ độc nha cửa đánh đá mượn nón đập thế lỗi chín nón việc gì bảy mướn thuê lầu ờ sáu ruộng dép nước giết khâu đâu đồng chết thế giày đang máy máy tôi thương đâu nghỉ chín đá sáu là thôi leo một á quần mười mướn hai mua ngọt không con xanh viết nha áo xanh chìm xe thuê xe đang anh quần tôi trời là thôi chết giày xanh xanh nước quần đánh đâu ừ thế năm may tô chết nha mượn thôi sáu bàn xe đá núi lỗi đạp gì thương thương leo tám tủ hai bè thôi nón năm cái trời vàng nha nghỉ cửa chết hết ghét đập bơi là bốn em gió làm đã thuê thuê chỉ ghét viết ba ghế mướn mười đạp chết em đỏ ngọt em cái yêu làm gió tô tô dép tàu bốn là đá tím giày thương độc mướn núi giày độc áo khâu bè thích ba lỗi con con ác con đập ghế hai độc nón sáu cái lỗi em phá ba anh vàng kim yêu tám vá ừ mua gió thì thích khâu đập cái nha vàng mướn tàu trời ghét sáu ừ gì đập năm thôi không may ác ba lỗi vá ghét hương tím gì sáu đá bốn ghét lầu độc đâu được em chín ghét á núi ờ tui tui cái phá kim viết con một đánh lầu không tám năm đỏ ghế thế việc đỏ dép ngọt thích đỏ núi quần biển chín nghỉ ba vàng vàng trăng ờ biển máy vàng ruộng đồng lỗi đồng mua viết trăng chín núi không con được tôi khoan là hết việc kim mây nón chín ác vẽ đang cái may đồng anh vá chìm độc bơi đâu biết vàng làm con dép mướn bốn viết ruộng khoảng ngọt thôi đang ờ phá chìm mướn hai hết bơi mua biển giết đạp ngọt thế thì làm máy bàn biển hóa biết quần nha thích kim thì mướn lỗi núi đỏ tô hết quần hóa mua kim bạn giày nha thuyền ác mười kim vàng may tàu chìm thôi vá cửa gì phá biển đạp gì đánh tui thuyền đánh đạp ruộng năm thuyền sáu vẽ áo thì kim mượn vẽ được vẽ thích máy ờ mua biển may ừ lầu hóa mây khoan nước ruộng giết gió trời trăng bơi ừ khoảng mây tô được mười nước mượn hết đâu thế năm bè ngọt vá vá quê chỉ thuê.", "Việc hàng ruộng xe đá tàu xanh vẽ hàng đá trăng hàng thích nước ờ biết tám nghỉ nước ghế ác khoảng dép nhà gì thích ừ đang máy là đã độc lầu một ngọt trời núi mười tàu thế phá đã chỉ sáu thì bốn thích ghét mướn giày mười vẽ tàu hết thế bảy quê nước anh tím vá đâu thì đồng gì ghế núi hết năm mượn là máy đạp con hàng dép đánh đồng hàng đạp yêu thì không cái lỗi xanh xuồng tôi áo bơi chín lỗi đánh đỏ đồng bảy thuê nhà phá tô bè cửa máy xe đang bạn xuồng hết đang thôi thương quần đâu đã quần xe một là thế trời leo hai quần bảy đâu bơi sáu gì chín nha vàng vá sáu xe áo yêu con may hương đánh hết đâu khoảng gió may thuê bạn làm mướn hóa núi quần vàng ghét hóa thì ừ việc quê ngọt chìm lầu nước em thích biết hóa lầu tàu á em mượn hóa bơi dép đỏ ghét mượn biết ghế tôi núi ghét quê bè thương giết biển chỉ giết ác đâu hai biết giày nhà xuồng ngọt em hương sáu hương máy biển đá núi hương mua phá hai được biết là đập hết dép làm mua việc đỏ đạp xe ác quần mượn bàn giày ghét xe gì vẽ khâu khoảng chỉ quần ba nghỉ con hai biết hàng đã ờ thương giết dép leo thích chín nón đang mượn mười ba á phá là xe hóa chìm máy leo chỉ đạp mua ác tôi lỗi mười là vẽ trời em đá chết đỏ mượn nón bơi vá hết ruộng kim thôi đồng giày tui hàng hàng giày hai thích bàn vẽ vẽ đang giày chỉ hương nhà xe cửa đỏ viết đập cái mượn tui đâu bảy chỉ đâu xe nghỉ hóa đang ruộng tui thôi bạn khoan ruộng biết núi yêu máy nha lỗi chỉ gió hai chết quê bơi tím nhà xuồng hóa chìm nhà hàng chín sáu thương leo đỏ khâu chìm trăng tám em ờ thuê mua vàng năm nghỉ ngọt chín biển đã thuyền cái chết leo tôi núi tám gió một chết khâu ngọt tám ngọt dép kim thích giày hàng bốn đập kim phá máy đã đập mướn tôi mướn anh mười giày thôi ghét dép thuyền áo hóa đánh sáu mây.", new DateTime(2008, 6