                    { new Guid("b3ad4574-9234-4488-9ef6-b6e4d107d817"), "97596 Vũ Causeway, Thái Bình, Suriname", "Em ờ nghỉ lầu biển tím ba hết mướn khâu ruộng được bè viết nghỉ một làm nha gió thuyền giày chìm ghét mua anh sáu mười năm khoan trăng bơi nghỉ nha mua đồng biết thuê bàn thích đá chín làm bơi tàu yêu hàng năm lầu chín em bảy thế giết đồng quê tủ tủ hết tám tui phá ác tôi thuê ba đá đập ngọt máy khâu xanh được nhà ba hàng hóa tím vẽ tui phá lầu hương máy quần chìm vẽ mua hàng bảy xanh đá đập biển tô ruộng nhà vàng xe tôi áo đang đá viết mượn quê nghỉ khâu gió thôi bạn nón tôi tám phá đỏ biển hết việc em con sáu dép máy lỗi con đã giết hết tím trăng độc dép sáu tám đang tàu dép tủ quê chỉ nha hóa nước biết đồng anh gió giày bơi nhà dép bàn đã tàu khâu tàu bè giết hóa ừ phá bốn hai hết bàn vẽ chìm sáu vàng không lầu thương năm mượn mười bốn đập dép mây hóa thuyền quần nhà tủ dép biển nghỉ quần chết anh bảy leo bảy em đồng quần một hai sáu bốn cái không được giày đá viết em ruộng hóa đạp mướn nón vàng khoảng khâu lỗi thế nhà cửa phá ba dép ghế hết đánh gì cái nhà giết dép bàn giết nhà thuê dép ba thế hàng cửa là máy là lầu ừ bạn em tím ba xanh vẽ em ba thì ruộng xe ruộng được tôi mây mua máy hết là là bè mười thương máy anh nha quê mướn đập hai chỉ đã thích nha thích thế tám là ruộng thuê lỗi kim quần khâu gió vá nha hàng xe vàng là ghét nghỉ tím bè bảy mượn lỗi độc kim hai mười tím yêu xanh nghỉ năm tím vẽ vá tô giết đập không một biển ruộng hóa ruộng đồng dép may bảy trời con hương bàn biết tui á anh xuồng bàn hai xanh ruộng ác xanh nước em làm ruộng tàu vẽ đâu không giết mua lỗi cái khâu ác đã đã làm leo tám hương xuồng hai đập đạp hương đạp chỉ cửa tui ghế nha núi ruộng vá mây thôi kim bảy ruộng khoảng xe không mười tôi tám gì cái thì viết mua một bạn ghế biển hết được vá vá tôi tím nha dép việc trăng là ừ thì ba tôi bàn xanh ruộng giày núi biển mượn tủ ba máy đá vẽ khâu anh đồng nón trời tủ hương vá tui bảy chín mười bốn hết gió tàu đánh làm tui con nón ừ năm giết đập không chìm yêu mướn việc hàng nước đang được nhà xuồng mướn bơi hai kim hàng hết á tô thuê mua ngọt việc gió viết giày tám hương xuồng tô thương tàu kim hóa hàng tô hàng thì ác ác không khâu không ghét.", "Vẽ thương áo lỗi viết được mượn viết áo bơi mượn sáu kim mua dép gió quần hàng cái thì máy thôi biết thôi leo bơi vàng quê thì sáu bảy núi khoan áo dép yêu năm nón viết biển tôi tám tô đập thuê xuồng tám mướn tui một ba nghỉ núi trăng tủ tàu em viết khâu giết đang chết đang đã tím làm lầu leo sáu núi cái tím chìm lầu nhà máy gió ba nón không đá hóa cửa vàng ghế khâu tím bơi anh được hương thuyền vá ba khoan mướn biển núi giày quần hàng bạn thôi ghét hàng lỗi bè mười leo là là chìm bạn độc lầu tô năm hóa ác mây thuyền không mây máy mượn tủ lầu ngọt yêu ruộng thì hóa đã bốn chỉ ghét may gió gió bảy con xanh mây bàn gì bốn nha xe thích quần con khâu tím đạp leo mua xe đã chỉ nhà á nón thuê bơi bơi nón tím chỉ gì đánh cửa dép một đỏ thì xuồng lầu mua em thế đánh ba ờ hết đánh ghét mây hương nha vàng kim hương nha quần khoảng nha đánh thích lỗi leo vàng ờ mua bạn nhà vẽ ngọt chỉ tám trăng ba em bàn núi khoảng con tủ ruộng con tám hương gì cửa ba thôi yêu thích làm ác đánh tám chỉ viết nghỉ tô ba cửa bè bạn quê tím anh thôi đỏ đạp thương bốn đá bốn đã lỗi gió bơi tủ đá thuyền khoan hàng ghế đã kim trời nhà đã thì thế ruộng nhà á hương leo lỗi chỉ sáu tôi đã áo tủ việc ghế mười chết mây biển dép đánh không nước đập gì viết chín khoan tôi gì tui leo tô khoan đã phá tôi á xe vẽ ác anh đang giày xanh quần biết tô biển mướn sáu xanh kim sáu vàng nước ghế giày hàng sáu xanh mua mượn nghỉ hóa gió bè yêu thuê thế tím xe quần mây không mượn khâu khâu hết anh áo một ruộng thích thuyền thích máy bè em bạn xe tám quê kim bạn tím nhà núi năm tím yêu đỏ quần thuyền hóa bơi mướn một tám nhà chết chết ghét khoảng làm đánh em quần thuê tám viết lỗi leo bốn cái ác tui mua quần hai đá việc được bơi nghỉ lầu đâu sáu khoảng bơi quê tô leo năm viết máy tui thuyền con viết may bảy vàng áo cái mượn mây quê thì đập chín khâu đang ừ thích đỏ thuê độc không việc đỏ núi.", new DateTime(2008, 4, 27, 12, 20, 17, 869, DateTimeKind.Local).AddTicks(3689), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hàm Thơ Mai", "\"https://picsum.photos/400/300/?image=847\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Lạng Sơn", "Phan" },
                    { new Guid("b489c1be-272f-4d16-939b-2d5298b67fbb"), "3086 Ðình Phúc Skyway, Vĩnh Phúc, Samoa", "Bè thì tôi tô nước một mây tôi mây mây quần hai giày vẽ tô dép leo anh nước sáu kim hết trời tui hàng sáu làm cửa cửa thuê quê ừ lỗi giày mượn làm ờ là hết hai lầu vàng á yêu đánh đã việc phá đỏ tui đá đồng bạn hóa chỉ mây một xanh quần xe đạp nước thôi chìm ừ ghét bè thì đồng bốn thương mười chìm nón tám ba tàu đâu nước vẽ trời làm gió ruộng tủ được trời ba gì hai hóa ác sáu nhà á nha nha đạp được lỗi tủ núi đã không thuê hết chỉ khoan làm thích bè khoảng khoan ghế bạn ghét năm bốn nhà nha trăng vàng bè anh chết bảy tím ác trăng trăng quê đã năm mười yêu vá đâu hết nhà mua sáu chỉ thôi đã một kim một việc phá hết thì máy nhà máy gió sáu lầu á tàu tám nhà á giày nhà quê bè đâu thì đâu đâu đá hương bạn độc tô anh năm giết hết vá bè đánh tàu chín chết đã vẽ áo nón đập mượn xanh làm vàng ờ trăng bè tui xuồng giết đỏ dép biển thì lỗi thuê năm giết trăng thương hết leo chín gió hết đánh biết tàu đang thích đâu xuồng nhà tám nón may xanh đang một mướn sáu thế thì ừ bàn ba leo ruộng ghét thích biết làm hết yêu xuồng ghét biển đang nhà tím ruộng quê tủ nón thôi tàu khoan thuyền khoan ghế thương vàng leo tím giày đỏ gì ừ dép tám núi em phá may tô biết khâu trăng may chín ghế ruộng năm tám biết mượn mây năm núi ghét được thuyền bè tủ xanh ngọt tui đập ruộng nghỉ ghét đạp ừ gió thương ừ leo bàn năm may xe á ruộng chìm hết đập sáu cửa được hàng con phá được thuyền vá viết ngọt thương chết quần hết tô gì lầu kim vẽ cái ờ làm hương ruộng gió tám gì tủ thương không chết hóa mướn đã chỉ khoảng xuồng nghỉ ghét leo việc hết phá lỗi thương giày con ờ đang ghét vẽ được hương dép tủ bàn leo gì thương mây tủ đang chín nha nha bạn ba nhà xanh gì tám nha quê nghỉ mướn hương vá hai trời sáu thôi hai chín ba dép nhà quê vá dép xanh gì mua tàu.", "Phá thuyền kim thuyền đá hết bơi được khoảng giày cửa hết giết một hóa giết tôi á ghét biển mây nước may em ghế đồng mười leo ừ tám khoảng làm mướn gió được nhà đạp ba tủ gió núi đỏ thích em lầu đỏ hết nghỉ đập yêu thuê kim ừ tím may lầu đâu tui em đánh mướn ờ núi quê đâu nhà mướn con trời bảy giày đập thích hai chín kim mua tám mười thế mây đồng lỗi tui ba không lầu thì núi á năm mười một là mười gió không hàng ừ một đánh đồng một chín trời chín vàng giết cửa nghỉ tui ghế tím con áo máy chỉ cái mười vàng khâu chỉ xe cửa đang biển ghét đập bốn gì chín khoảng đỏ tôi chỉ khoảng giết chín chín làm bàn gió tôi đạp đã ác khoảng tám không một xuồng khâu trời phá khoan khoan lầu không gì kim nghỉ khâu quần tủ được chìm nghỉ may đang đỏ mướn độc ruộng lỗi chết chết nón leo bốn xanh đạp xuồng mây tàu đánh chìm thế khoảng ngọt gió mười mượn tím tím đánh kim quê được nhà á đồng kim leo biết khâu hai vàng được hàng ruộng dép trời độc biết độc bảy tui biết gì sáu ghế xe thích được đã nhà năm nước biết hóa trăng yêu là em đã thích ừ đồng khoan tô máy mượn độc chỉ năm gì tám gì phá mướn đã đồng hai anh trăng tám nghỉ đã thôi thôi mướn thuê độc á mua được trời gió ờ khâu ba viết giết chỉ biển bạn vàng độc tôi hết cái bạn bạn khâu em á thuyền mây thôi thế bảy kim phá hai ừ đang chìm lỗi ác giết lỗi nhà núi chín cửa năm thuyền thôi đỏ hết hàng không thích ghế biết trăng xanh ghế ngọt thích lầu tui bạn đá ba đập ờ tím yêu ba đỏ dép mây khoảng phá lầu hết bốn núi con chết chỉ ba mười quê gió may bốn thuê đạp độc hết đang hết quần nghỉ khâu trời bốn khoan ừ xuồng khoan thuyền đâu thì thì núi đập ờ thì mây được em ghế leo thì mua bè tô lỗi chín kim bàn á đập biển làm nước bốn khoảng thôi bơi thương á đỏ thì núi gì giết xuồng gió ừ chìm á ruộng đánh núi đã cửa đang trời tủ mượn ngọt làm đỏ trăng hết biển ờ nghỉ ghế đánh thôi đánh nhà tô hóa may anh mây biết cái khoan năm biển.", new DateTime(1984, 6, 23, 3, 56, 17, 136, DateTimeKind.Local).AddTicks(1464), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1,