                    { new Guid("d26d1831-4886-491d-b0ee-61942328177b"), "747 Đào Oval, Quảng Trị, Tonga", "Máy nón biển hai đồng xe yêu đập nhà khâu nước gió kim bè lầu nha tôi ghế đạp chín lỗi thích gió á đỏ đá ghét xanh hàng năm á việc đánh đâu ghét tô trăng đập viết đập hàng dép thích tàu mượn mướn tím tô phá lỗi đá biết thuyền trời mướn giày việc gì sáu mua hóa một leo thuê một vá bè hương bạn xuồng nước việc mây trăng mua cái đang chết chín ừ dép khâu làm bốn ruộng bảy nghỉ khâu nha đạp thuê nha đạp cái á thì tàu khoảng vàng hai nhà viết thuyền núi mười xe anh trời đang mướn nha em giết bạn việc phá ừ may biển con con hóa đạp là bốn hàng núi thì được mướn thôi vàng tàu viết ác bè kim phá máy bạn thương quê thì thương thương bảy việc hàng xe đang đánh bốn vá sáu cái nước đang biển thì núi ruộng hết trời đỏ thế thì dép lỗi mua bạn á trăng chết đá quê ác xanh ghế mây là mướn bơi đá kim thì dép áo ghét núi được tui hai hết biển chìm xanh dép một quê đâu là một tám tủ em yêu nhà tím tô khoảng đỏ đồng leo thì nón trời bảy thì vàng hết tám thương xe khâu nha biển đá leo sáu quê bạn quê á ghét dép tui bạn chỉ tô năm mướn bảy đạp đỏ em hàng nón nước thế chết khoan khoan thuyền bè ngọt xe là trăng sáu ba thì đã nhà một việc thuê ngọt ác đập biển sáu ghét thuê chết phá chỉ sáu nhà nước đã tàu kim lầu tôi anh thuê khoan phá ác ruộng viết nhà vàng bàn chỉ núi hết thế cửa tím anh gì quần núi ờ đỏ ba dép ghế á bốn mây chết chỉ mười nón hương đỏ nước đạp hàng quần chỉ lỗi tím quê máy chỉ làm bảy hết chín cái xe trời ờ năm tím đánh em may không bảy đồng một chết tám cửa chết khoảng khoan xanh khoan viết vẽ kim ghế đâu núi ruộng đạp mượn tàu chìm đâu ghế đồng tàu thuyền khâu mua lỗi hai xuồng á đã đạp giày tám khâu lỗi hết nha nghỉ chìm nước chết tàu thế vẽ bè nón bốn ghế giết xanh bảy chìm mười hết tám thích việc mười bảy con may tám một xuồng ừ tàu hóa ừ thì bốn ghế áo cái đồng giày khoảng yêu.", "Sáu đã được gió chín thuyền lỗi chìm kim đang bàn ghế không mười đã dép vẽ giày cái gió mây hóa trời tím hết đỏ đá nước chỉ biển anh đang đang em đập tui hóa gió bè mướn tím trăng đá tô một đâu làm biết vá thương ghét hết tủ bốn xuồng thuê trăng quần phá là hương hóa ba mây khoảng đá ruộng lỗi khoảng trăng bè bảy xe gió đang vàng ghế thuê trời em làm xe quần ruộng sáu tui việc thế không nhà kim mượn tô biết chết cái thương con cái con máy một bàn mười mượn tui hương ờ cửa vá máy phá ờ được con thích gió nghỉ lầu kim đâu dép thích sáu mướn hết dép độc mướn áo trời thế cái trời thuê nha mười tô nước nhà mua vàng tàu trăng thuyền thuyền khoảng tím đạp cái nghỉ áo ghét viết thích cửa đang được vàng nghỉ viết ruộng bảy không mượn vá bảy lỗi vẽ núi vá đập ngọt vẽ năm ngọt đã việc ruộng chỉ lỗi được cửa cái tôi mượn tám ba bè đập xe bảy tám khoan khoan anh vàng á vàng sáu anh máy nước cửa hai làm đâu ờ dép ác thì mượn khoan khâu sáu bè đánh dép giết thôi hết hương nha vàng được chỉ ruộng tôi máy bảy nghỉ một thuê nón ờ khâu nước đập tủ hương nước không cửa hương hóa xuồng vẽ hai quê biển hai thương hết năm chìm làm dép giết đạp giết hết bè mây tui hương gì kim ờ vá mười làm chín tám anh không biển đã bè không bảy nước xe em đang thôi đồng đâu may thích mây khâu mây mượn biển ba hóa thế kim một cửa đỏ nón nón á nghỉ mướn bốn anh trăng thương thương hai ba việc một hết ghế giày ngọt hết nước mướn lầu giày vẽ tím đánh đánh chín ác giày vẽ làm mây mua phá nước lầu ba ừ quê gì chỉ làm ừ đập đá mướn khâu đánh không là tui ghét máy ngọt xe là cửa nha hai hương vá á cái mướn bốn đang không núi quê bảy ruộng anh tô hết gió mây chín đang lỗi ghét mướn á sáu giày đã biển xanh ba nghỉ không đập xe cửa làm thuê mây khâu bàn hóa.", new DateTime(1979, 1, 18, 17, 39, 27, 769, DateTimeKind.Local).AddTicks(6640), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Quang Nhật Mai", "\"