                    { new Guid("e652d7b3-8578-4277-ac5c-3b1123b99968"), "21075 Hương Mai Ford, TP. Hồ Chí Minh, Na Uy", "Bảy con bàn nghỉ mười làm tô nghỉ ghế xuồng đạp hóa khoan thôi khâu dép ờ khâu đồng mua vá đồng máy khoảng tô nón đang xanh ghét bảy viết bạn không thích thuyền hương phá phá anh yêu giết tám leo kim xanh bàn cái vá độc dép mua đâu xuồng bơi bạn mười một cửa chỉ đạp ừ thuyền chết chìm xanh khoan thích đã nón tàu độc khoan lỗi chỉ đỏ tàu việc dép thích xanh thương giày đồng giày gì xanh tàu xe được nha vá chết gì mượn làm lỗi tủ ruộng đồng tôi tàu may máy năm thôi yêu biết mười mây leo hương mười xanh chín tàu trời khoan viết hàng đâu con đang đồng xe vẽ hai ác dép tủ một đỏ bàn bơi được núi leo leo ghế đang đập mua đá nước giết lầu bạn bè mượn thế nón tô nón ba nha áo được tím ba mượn bè gió thì máy gì thế đâu tím độc tui áo đâu bạn giày leo tui máy áo độc chỉ đã ba vàng tủ nha thuyền đâu hàng cửa ghét hương nhà tô dép biết khoảng thế tô lầu bảy nha thì khâu núi lầu đã lầu bảy mây thôi hàng xe núi không lỗi xanh trăng ừ tôi ghế đang bạn khoảng dép bốn ruộng một năm xanh không cửa biển đã bàn thuê không thuê hết tôi độc tàu hóa áo năm đồng vẽ gì bảy năm đồng chỉ quê vẽ lầu leo tàu dép mướn quần anh tám chỉ chết dép xe mây biển bảy ờ lầu bốn tím đánh đánh chín đang nón anh làm hàng khoảng mướn mướn xanh mướn đạp tủ khâu vá đâu cái máy bơi thuyền đập cửa biết không quần giày chìm viết bè yêu mây một đỏ khoảng đang em chìm lầu anh ác vàng lầu là kim tủ quần bàn chết năm cửa hai trăng trời cửa cửa tui chìm đâu ba kim giết mua mây viết dép đạp hết ngọt năm lầu xe leo cái ghế yêu bạn con thế nhà tô giết máy tám biết hết được trời vàng nón đang được chìm đánh biển được bàn khâu bạn tím leo quê độc mượn mây bảy hết lầu quê máy vàng trăng bè việc mây việc nón tàu anh tô đang khâu giày đang viết mướn là xanh lỗi mây khoan mượn thuyền năm biển độc vàng tui giày lỗi vá chết khoan độc khoan trời làm phá khâu bốn mây khoảng quần cửa bảy máy hóa vá ác chín ba nha đang chỉ may anh tím xe vẽ dép tám dép thuyền yêu gió cửa hết mướn nón ghét thuyền đồng việc là gì vàng đồng hương em gió là đánh lầu ừ yêu ruộng sáu trăng vá vẽ cửa nghỉ ghế giết á xuồng không ba ờ núi lỗi đỏ thế tủ ờ năm hết thương đang áo độc một vẽ ác tím đang.", "Em leo hàng bè chết núi trăng ghét thì vàng gì núi em hàng đã thuê hương viết đã đã bảy được không là thuyền quần leo đánh thuyền gì quê tui đá khoan khâu chỉ biển leo năm ruộng ác thôi máy núi xanh gì vá vẽ ghế bốn ờ tôi mướn đang máy vá đỏ quần tàu thế bè tủ lỗi mười trời thuyền bạn nước việc kim lỗi đỏ thích đâu vá áo nha đang ngọt ác bàn chìm tô hàng tôi may đập thương nhà hóa đồng thích may ba ruộng mây cái thuyền thương chết biết ghét yêu độc viết khoan là đánh vá độc hết bơi chết vàng tôi một leo may mượn khoảng kim á nhà lỗi đang thuê đồng thuê ghế nha vàng cái nghỉ ghế đang tím tím mười máy lỗi tô nước đạp hai đỏ không hóa áo bè con trăng khoan áo được giết chết biển xe lầu đá thương vẽ xuồng được khoan tô áo chết khoan thương mười lầu vá ghế năm chỉ thích trăng chìm hàng gió gió đang thế được thuyền đánh tô năm tím tàu bốn độc việc nước được á ác thuê may xe trời á biển cửa giày lỗi chín mua một bảy hóa đang vẽ chín tủ hết đập việc độc lỗi cái làm chỉ chỉ bốn đá biển thương giày hai chỉ biển xanh đỏ phá tím may xanh đâu việc ác bè bè ghét hết may vẽ leo ờ ngọt nước thôi tám tui vàng độc gì thuyền trời con tím mượn hai ừ máy là thuyền á sáu khoan mượn nước quê dép được xuồng bốn đá chín kim thuê phá khoảng may may yêu là giày tui bảy đá phá biển chết máy chỉ may yêu giết ruộng áo núi may tàu thế chỉ mướn thuê tám đã cửa việc gì may hương bảy thuê việc xanh bốn nhà lỗi khoan nhà năm hóa gì tui đá ngọt ác việc quần giày phá phá lỗi làm xanh khâu lỗi bàn giày nhà khâu thôi xuồng máy bốn vẽ xuồng áo nhà tím xe tủ mây không gì mượn một thế khoan tô độc mây tím vẽ thế chết bạn cửa hết dép ghét xanh khoảng á mua viết trời mượn hết không đồng làm đánh đá nha ờ nhà quê việc tui thuê đã vẽ xe chín viết khâu hàng thì mây giày ngọt đá bơi quê dép con cửa việc độc ghét trời đã kim leo dép ngọt thế thế vá mượn bốn tôi đập cửa xuồng thích thôi.", new DateTime(1950, 9, 7, 18, 48, 2, 896, DateTimeKind.Local).AddTicks(7661), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Thanh Tuyền Hoàng", "\"https://picsum.photos/400/300/?image=227\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hà Nam", "Đặng" },
                    { new Guid("f7b0089b-956b-4e44-8d24-9ba22d95f9c5"), "30620 Nhật Hồng Brook, Trà Vinh, Liberia", "Nước độc bốn năm biển thích đỏ xanh đỏ trăng quần giết đỏ chín là ghế năm năm bốn đá xuồng đỏ tô khoảng nghỉ đâu biết hết quần làm gì vàng việc thì ngọt làm một trời hai tủ bốn ngọt viết làm tôi lầu xanh phá sáu chết thuê con lỗi đâu thương ghế đập khoan ờ đạp tui giết máy giết lầu mua chết phá nón không chết con máy ghế đập tô leo xanh máy là ừ cửa là thôi chín năm đập hết bốn khoảng núi cửa leo gì đồng vẽ hai thuyền bốn khoảng trời hương tui bơi đồng đồng mười xuồng anh bơi thì tám đập ngọt khoan hàng nhà chìm đâu xe việc đang ờ không ừ nghỉ lỗi anh độc ngọt xanh hàng dép mướn thôi bơi mua mướn leo chỉ khâu độc gì nghỉ mua hương ác ờ đang ác khâu khoan năm kim chỉ cửa tô trời nghỉ tím mây hết quê mướn ghế hết đánh yêu khoảng được bốn đánh leo chỉ khoan hóa ghét hết thuê chết lỗi nha được lỗi máy xe ừ lỗi biết áo tôi đập mướn leo tôi hàng biết nón đập đạp sáu quần đạp đỏ một leo thương giết chín độc nghỉ mượn kim đập khoan chỉ nhà đâu leo mua thuê hết áo hai hết hóa áo ngọt đâu hóa chín quê khoan việc đâu em máy gió trời anh không đâu bè nghỉ nước là thôi đồng mười máy mười mượn hàng đạp năm hương thích lỗi hương bảy thương nước đâu tủ vàng vá tô gì viết quần ờ máy bơi việc em nha thế vàng không đỏ đồng phá đã kim độc con đập hết cửa trăng vẽ giết hương trời gì nón ngọt chết cửa mua leo ờ làm đá chìm áo bè nón tủ trăng đang thương lầu giết ờ thích xuồng bạn mây đá năm nước xe gì chìm biển giày thế thì tui độc hàng đạp làm tôi bơi quần bè máy quần viết hương biết thế tô anh mua mướn cái ờ thuê thuê nghỉ được ờ bốn đang gì nón quần anh dép xuồng thôi được vàng tô vàng đá may đang làm núi phá trời thế biết hương tám mua mua được núi chết là đánh kim á dép mua thuê đang viết ác đập biển áo thì vá tủ vá xanh tủ quê trăng nhà đồng đâu đang tím con lỗi mây đã xuồng không không thuyền ruộng biển gió dép tám núi vá quần chỉ mượn vẽ bơi ờ kim hương xanh việc cửa ghế đập vẽ em bơi bốn nhà tui leo chỉ ừ thương đánh may thuyền ờ tô một tô biển thích đá được được việc xuồng chín thương năm nghỉ bàn nha ba khoan lầu kim khoan đạp tám kim.", "Là xanh đỏ thuyền chỉ ba mây hương đánh nón đồng bảy thì xanh ngọt thì hết hương nón thuyền em thì chín làm gió gió đạp độc áo mướn bè nghỉ dép mây lỗi dép ghét con thì tủ đánh tám dép biển may đang tôi tám nghỉ một quần thuyền tô núi ba yêu quê trăng hàng việc xanh mây nghỉ thế ghế bơi biển ác chỉ hàng á đồng ừ sáu ruộng một vàng vẽ xe nha nha tô sáu thuyền chết anh tám đâu đánh một thì anh yêu nón biển quần bốn chín tủ thuyền ruộng đỏ núi xanh ba thích kim trăng thích bơi mười cửa độc thuê không em xuồng được làm trời một leo khâu ghét tôi bè chỉ cửa bảy con xanh vẽ thích tôi cửa núi biết á bạn đồng việc tui khoảng ừ trời bốn nhà ờ nghỉ vá tôi độc cửa xanh năm tôi mướn khoảng đã quần dép đồng hết đâu xe lầu nước trăng độc hàng mười thì thế phá anh thích ác ừ thôi quần thôi phá núi ghét tôi thì tôi đã quê vẽ tím yêu tôi hết hương xanh may bạn áo vá thuyền là đang đập ừ nước vá bốn thương việc tám áo thuyền dép nghỉ hàng thích thích mười leo kim núi ghế nước thôi được bảy ác đánh đồng ghét ừ bơi bơi đỏ ừ trời khoan đỏ ngọt ác tàu khâu ghét chỉ hàng phá ờ núi em đánh trăng giết thích thương nước may tím xuồng sáu vẽ ừ sáu đỏ đồng thích quần là hết thương biết hàng không khâu leo bảy cái bè bè tám thôi ác hàng nghỉ quê sáu trời thích chết nước thôi yêu cái gió bạn ba nón khoan nước con hương hóa ghế vàng đỏ được mua kim bè ác hết hết mướn xe năm ghế thế bàn đỏ á đã xe ác bảy tô hết tô chết khoảng hương thuê nón cái đồng tô á leo thì thuê giày bạn tám tám độc thì thôi nha không đồng thế chín đánh thì đỏ lỗi đá mây tám thuê kim tủ không nghỉ làm á khoan tôi tô xe leo bảy biển mua á kim xuồng tô thuyền đâu á quần hết giết nghỉ ruộng ruộng đang đang ghét biển con núi gì ghế nha chỉ mây việc dép hàng thì ba mây ghét đá độc con tô thế sáu hóa hết nước đánh thích đang tủ nha tủ phá thích lỗi hương đang mượn khoảng á nón thích hóa ờ đỏ trăng đồng mười núi nha năm nước tui hết trăng mây.", new DateTime(1969, 6, 11, 8, 41, 51, 343, DateTimeKind.Local).AddTicks(6011), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Mỹ Uyên Trần", "\"https://picsum.photos/400/300/?image=1059\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Điện Biên", "Hồ" }
