                    { new Guid("0a830dee-6453-472b-aee6-d776d6533224"), "23594 Huy Quang Shores, Nam Định, Paraguay", "Sáu thuê bơi phá một chín thế vẽ máy dép chết bơi là kim biết tô khoan nón việc ác quê chín yêu hương bốn đang bảy xe mười thôi gì độc nón phá nha đỏ trăng đang ngọt xuồng viết thì mượn việc tủ trời một nón viết thích nhà con đã bàn nghỉ con bảy bốn ờ đập khâu ruộng sáu ghế thuyền hương ác yêu phá trăng leo bốn xe quần thôi hai được chìm vàng hàng leo phá đỏ may ruộng kim bốn tím tô tô ghế đâu bạn biết bàn đâu chỉ bè mượn yêu gió chết gió năm nhà hàng lỗi may hàng ghét vẽ nước đang thuê con yêu xanh giày nha trời thuyền đâu bạn yêu ờ trời tàu ngọt tàu kim đỏ trăng sáu nón vàng tô bè lầu vẽ kim nha đá chìm núi thuyền tô leo mua hương tím nhà thế đang chín á đập đập độc vẽ hết tủ thế bàn bơi đánh vẽ cái cái năm đá khoan giết bạn chết khoan quần sáu áo làm giết hương đâu giết mây thương hết cửa xe ba bốn đang bốn một bạn leo đang chỉ độc làm ba thì vàng xuồng ghế được bạn mướn nhà giày may đập ác tím trời sáu đỏ trời nước trăng kim ruộng xanh cái xe tủ nước xanh tui bơi máy ruộng thương biết chín chỉ ờ hết ba thuyền phá viết bảy chín á gì may một chỉ đâu áo á mướn hàng ba thôi chìm biển bàn ừ tím hàng khâu biết vàng không áo làm gì áo hết đang nha ngọt thuê nghỉ giày hóa hết vẽ giết năm quần khoan mua nón tôi ừ mua làm đâu vàng một mây thích thuyền mua bốn chỉ đá vàng ba đánh lỗi gió trăng đạp yêu gió xuồng biển ờ ừ trăng quê hương leo khoảng ghế gió bảy biển trăng thế cửa quần tím chín sáu ờ chết á quê vẽ được là kim tàu khoảng nghỉ hàng bè nha hai thuê tám dép bàn kim ghét thì núi thôi tô bảy vá hai làm tám thôi mượn thuê tôi làm kim ghét thuyền ruộng xe lầu ác vẽ ghế em trời ghét mướn may nha tôi năm núi vá chết không ừ nón khâu khoan việc hai em thế leo chỉ tím ngọt độc xe bơi phá đá mười mướn quần thuê thì xuồng là một.", "Leo em đánh đã cửa làm năm trời vẽ năm việc đánh mây viết đập nha đâu độc bốn á trời đâu viết năm là hóa anh xe bơi đá khoan xanh sáu bạn vàng đá ờ thuê tím chìm việc thích cái vá gió ngọt yêu đang đâu mướn thì hai hết vá gì xanh sáu đạp trăng đã mua đang xuồng độc ngọt bè xuồng sáu gì mười áo thuê bè vẽ mua mua nước chỉ hàng thuê giết khoảng ác đâu cái mười hết đâu làm là hương thế áo cửa đánh đá kim bạn ờ áo lầu thôi đá một nha đã ừ ghế bốn hết gió quê đồng bảy em gì gì máy gió viết mượn chỉ áo đâu tám đánh biển lầu giết tủ trời dép đồng khoảng thương thuyền em đánh lầu chỉ bè nha anh đạp tàu lầu bàn cửa leo giết máy thế bạn chìm may mướn mười thì nón hết hóa chết biết mướn đánh khâu nước dép xuồng cái thuyền cửa nước bạn quần xe ruộng yêu ghế vẽ không chìm em tui kim tô được đạp vá ghế kim áo tui xuồng đạp chìm đá cửa xanh thì khoảng xanh đạp núi đang con mua một thì ghế khoảng tui ghét độc ừ ghét dép giết khâu phá cái biết chìm xe quê việc hai hương cửa may đánh thôi hương mướn hàng mướn khâu mua quê tàu đánh núi xe nhà thì đồng gì không sáu chết tủ bè chết kim giết lầu giết tui nghỉ đâu ngọt hương năm tám ừ bàn áo việc trời mua gì chết anh tô mười thuê ừ thế quần ừ may ghế viết hàng ờ tui mượn làm mướn ghế máy biển hương tím độc được leo khoảng là thuê đã bàn anh thôi độc mây biển sáu ruộng quê tôi một dép nón kim năm việc cái thôi độc làm mua tui trăng nhà ừ viết tàu thì khâu đang khâu chỉ sáu biển vàng ba nón mười khoảng xuồng thì ghét nón nghỉ độc may chìm khâu mướn ừ được vá con ừ quần bàn gió nước tô vẽ khâu mây tám cái ba vẽ thuê khâu xuồng đập phá ba ác ờ độc viết tám đồng phá bè đã biết nhà là được chỉ ba đập chìm núi ngọt bơi biết quê tui đập áo việc đâu ba nón độc máy tám chìm thì chết hết bè tàu năm bảy biển leo nghỉ ờ quần leo lầu cái đánh tím biết thuyền dép xanh anh khoan đang con tám em cửa dép quần biển tủ thích ngọt vàng năm đỏ một khoảng chín mười hàng ba đạp trăng hai ruộng tôi mười tô ừ hai vẽ đâu chết khâu đá hai tám khoảng chết bốn nghỉ mướn chỉ chín.", new DateTime(1983, 6, 2, 0, 27, 48, 148, DateTimeKind.Local).AddTicks(9013), null, new DateTimeOffset(new DateT