                    { new Guid("0ae48d7d-1283-4eb3-8f36-d1a45f76c287"), "80587 Hải Anh Canyon, Bình Dương, Slovakia", "Đang ừ quần đạp bơi hai cửa trời tím anh tôi ừ con gì thương hàng leo á đỏ ba chín em thương ghét cái áo ghế lầu nhà làm khoan cái chín áo trời năm một tô kim năm lầu chết hóa đập tám dép giết mây kim tím nước ruộng khoảng hai độc thuê năm bạn ngọt đang tô kim khoảng lỗi việc biết được nha đồng hết thích chín áo đập gì ừ đạp tôi nước bạn thích chỉ thuyền tôi trời dép ừ vàng mười em ruộng ruộng năm em đồng là dép một núi cái thuê trời hai biển nón em vẽ trăng á con mướn phá anh mướn lỗi tui đâu giày thì thương viết ghét năm đập tui thuê đã tủ ba áo quê thương biết là anh anh hai mượn ờ chìm đánh tám hết tui sáu ác viết áo đồng may làm tô ngọt năm áo gì xuồng anh hàng thích chìm bảy áo tàu giày hết viết thuyền lầu đã quần vá sáu đồng quê đỏ ờ mướn quê hết thương bơi đồng làm ghét xe là lầu làm nước chìm hai khâu ác gió biết xe đá ruộng dép ngọt ờ kim dép ghế nghỉ máy tím trăng hai tô hương leo bơi vẽ không thôi đánh dép con đánh kim anh bơi dép đồng anh một ờ trăng năm máy khoan việc hết ác là cái thương viết hai bàn hương đâu bạn cái chết trăng trời bàn khâu mua phá giày biết năm anh đỏ xanh là thế nghỉ chín hết đạp quê con độc chín hàng gì ờ năm máy yêu bàn tô bảy đánh bè khâu một đập tui thì ừ giết biết ba lỗi đánh chìm đâu ba ruộng bảy mười mượn khoan một chết đá thế yêu bơi cái đá vá bè bốn nước bè vàng viết biển tàu bơi thích lầu hết độc phá leo con đang kim vá thế mười ruộng là xuồng chín quần phá bàn bàn độc chìm thuyền gì ừ ruộng độc năm nhà nón leo khâu thương tủ đánh trăng bảy bạn ba dép khoảng con thuê ghét hai vẽ hóa chết việc nghỉ leo làm độc được ngọt năm giày hương thích đỏ kim ba chìm tôi may hết xe đập vá hương là mua đâu đã đá đỏ leo mượn bàn nghỉ hàng một được giày làm ác ờ giày hai núi làm khâu gió đá khoan tàu hàng thích ghét năm bàn á thuyền độc đánh giết đánh ba máy vẽ việc hai ba tàu ghế dép khoảng biển vàng được lỗi quần đánh lầu hết đang ruộng thương ờ đâu thế dép vẽ mười dép may ghế phá ghét ác mượn.", "Mây bảy đạp vá giết mười năm tám xe khâu chín cái con xanh ờ khoan ờ nha nghỉ chín chỉ ba đánh sáu trăng được lỗi em thuyền biển là thương bạn một phá tui may năm hết hết tím chết kim mượn tím hàng khâu nha mười dép thuê thương mười khoan tui em bè đá mướn vá mua khoan xuồng việc tô ngọt tím ác tàu chết dép đồng ừ bạn bảy bè hết đánh đang quê xanh đâu xanh hàng núi ờ tám biết mây vá may khoan khâu yêu nha ác được tô yêu đâu hết thuyền đồng năm tủ thích quần cửa thuyền đỏ năm nha việc thôi tôi đồng tui chỉ á ờ giết biển vẽ đồng may giết mây áo độc gì giày yêu trăng nghỉ á núi nón núi xuồng nhà thương bốn núi nón em tàu phá mây vá xanh lầu thích không tui thương khoảng con đạp mây giết hết đang chín đâu nha thương viết cái á đỏ năm trời độc mây hóa việc đỏ mây năm bàn khâu núi trăng bạn hàng ờ đã yêu tui thì biển ghế mây thích em mượn đạp bảy nón giết giày hết ba em nước độc được lầu núi giết leo vẽ bốn đâu việc thế mây đập ba hết bạn mười áo á cái bàn phá nón thế vẽ máy bàn máy đỏ ruộng mua không giết bốn hương leo ghế vá đá leo mượn đánh giết được bàn bạn hết tôi không quần ghế gì thôi lầu quần hết chìm là tàu đánh giết năm núi ờ là hương không đang thuyền ừ kim khoảng ờ xanh ác tàu ba tui không xuồng giày chỉ đá ừ núi chỉ chín cửa biển may độc vàng chín bốn biển cửa nước tàu tàu một tàu may tàu khoan tím máy gió một tám áo đá leo độc xuồng con trăng tủ yêu không khoảng xuồng cửa ác quê hương nước quê bạn đỏ tám đá xe ừ hết giày nha kim thì tám bàn tàu xanh bàn đâu thuyền nhà đâu em mượn mây hết trời bè vá nghỉ đồng đạp nghỉ tô nước mười đá đang nhà em gì ngọt thì chìm giết yêu gió hóa nước lỗi vẽ đồng tôi biển giết bạn quê giày xuồng hết viết mây mua biết lỗi đã ngọt cửa quê tủ nhà nghỉ núi anh đập đá máy con đá ba hai giày thương yêu thì con bàn tôi bảy leo vàng áo áo hàng con nghỉ chết tàu ừ con tôi may việc năm gió ngọt độc đang trăng ờ tám tám tám chỉ ngọt quần đã hàng ruộng không thương được cái thương xanh chìm mua xuồng phá quần máy năm đập ba bè ruộng tám máy biết tủ tàu việc mây bè đã chết vẽ thích.", new DateTime(2000, 4, 26, 15, 5, 24, 981, DateTimeKind.Local).AddTicks(6693), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hải Ngân Phùng", "\"https://picsum.photos/400/300/?image=844\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Sóc Trăng", "Bùi" },
                    { new Guid("256c3395-1d81-4ce6-adb1-72cf8b16e95d"), "94274 Hoàng Hiệp Bridge, An Giang, Bosna và Hercegovina", "Cái tô mượn biển đánh làm ờ đập mua tôi đập ờ kim thích tôi kim hàng biết cái máy ngọt anh lầu vẽ ngọt xuồng đá quần giày tôi anh bơi đạp hương bạn xuồng kim máy máy quần nhà thế thôi tám xe chỉ tô chìm khoảng áo khâu mây hương ờ trời khoảng tám leo đã giày vá tôi đánh bơi ba bốn bạn tủ nước hết năm ghế ác hết ghét khâu tủ tôi đá quê giày hương quần đánh trăng trời giày chìm tui vá quần cửa tôi việc mây nghỉ bảy nha ghét chìm ghét ghét đồng ba nhà đã thế là ba vá biết bè mướn vàng em tủ thôi ghế mượn đâu đâu khoan thích quê đâu ghét tôi leo bốn việc chín thương ừ lỗi một ngọt bè thích thuyền bơi sáu cái đánh yêu đang thuê ngọt em khoan hóa kim bè chết ngọt áo tui hết nhà đạp hai khâu thương vẽ may bàn máy chỉ bảy tím phá thuyền tám bốn thích là nón bảy nón thì chỉ quần dép thuê tím ừ khoảng may vẽ thì bảy ghét tôi chín mượn ghét thôi được mười hai ác khâu xuồng mướn là tủ hết ghế thuê trăng xanh thuyền năm độc ừ chết trời nhà chìm vàng gì vá biển núi tui không thương biết việc ghét đâu đồng khâu may xuồng sáu quần á năm nghỉ một sáu đánh thích ác núi viết leo bốn thuê hóa vá con tủ áo giày hết lầu thương nón mướn quê gió sáu núi giày giày tô kim giết tím phá làm một ờ núi cửa đồng gì mượn được đồng viết leo hóa bảy chìm việc dép khâu đạp chỉ mây may bàn nước tôi lỗi quê biển khoảng chìm việc mười đập sáu việc gió ừ chín thuyền được tui lỗi xe quần giày bảy đỏ anh viết chết đang năm hai bạn nước không may anh làm máy gió gì khoảng gì trăng chìm hóa năm nước hóa hết may nha đạp tôi một vẽ sáu đánh mướn nghỉ vàng quê tô nha khoan bảy độc thế tím một xanh xanh lỗi giày mây ờ vá mây thì thích tô bơi năm mướn khâu chìm thích phá em biết thích đỏ khoảng thì ghét thì bạn không tám may mua đập nón tủ nhà anh thuyền biển tàu giày bơi tím đã may giày mướn thương gió bảy tủ núi bốn mây hết may tím gió leo đã bơi hương là chỉ mượn ghét áo chết đang núi em núi em chết thương biển lỗi xanh á ghét xe ghét biển độc áo lầu mây đá là núi thuyền một kim mướn hai hàng con xe đạp việc cửa một nghỉ.", "Đập phá giết đạp đá lỗi ghét ba ruộng hương tám áo ghế hết ghế tàu hàng yêu đỏ độc thuyền đánh sáu xanh thì bốn thôi tàu mây hai nha không đồng gió xe hàng đập khoan chìm ruộng tàu vá dép tím đang em chìm xanh mướn cửa nghỉ đỏ ba ngọt dép vẽ vẽ chết biển mười đang lầu ngọt chỉ bè đá là làm ghế vàng chết đá trăng quê chết xe chín yêu trời thuyền khâu nón hai chín đánh quê tàu xuồng leo khâu bơi vàng việc một vá tủ yêu thuê kim tô anh thuyền khoan chết đã nước tím yêu hàng sáu sáu á dép ghét trăng chín đỏ tôi vá chỉ thuyền quê quê bạn hết biển em kim núi giày được cửa trời thế đồng đỏ chỉ mướn thế cái máy bảy leo khoảng lỗi chín hàng thì dép xanh tô á tám tủ chết gì tím thôi hết năm ruộng kim vẽ quê núi ngọt đỏ mướn mua bốn quê thuyền đang viết á dép ờ tím nghỉ á được đá ruộng gì sáu ừ xuồng khoảng máy thế áo chín tủ thì kim viết ghế tôi năm lầu nha ác trăng mượn năm biển ờ lầu đã thì không kim tôi đồng ruộng hết ruộng em kim anh con hàng hai anh tui tám ghét thích ừ dép đỏ con ba trăng vẽ bơi đá quần tủ tô mua đang đánh trăng bè nhà con yêu ruộng hóa gió dép thôi việc mượn leo đã tôi tô thuyền hàng vá chết hóa ba đánh ruộng đỏ núi vá thích bốn mượn á anh thuê ghét việc nha vá tám phá khâu trời giết em may cửa máy đang đâu mướn làm hương áo lầu mua máy mười việc đạp được thích ngọt biển giày tím đang máy lỗi yêu giết vẽ con mây tôi nón được viết nghỉ biển đã nước tủ mượn chín nghỉ ngọt hết dép không thích ác chỉ bạn tủ giết may cái lầu hết mượn phá thôi năm ba quê tàu xe tô tui làm mượn xe một lầu leo bè mướn bơi nha tôi khâu chìm nón kim kim trăng viết thuê năm làm trời ruộng thương tui vàng khoảng độc xanh đánh bè đồng mây kim nha làm bàn đánh thương sáu chín vá thế bàn tủ gió cái quần biết đập nước năm thì máy em đập bảy được ác.", new DateTime(1968, 11, 5, 19, 2, 20, 545, DateTimeKind.Local).AddTicks(570), null, new Dat