                    { new Guid("27caac4f-8952-481c-8afe-b81b3b1cc994"), "46712 Hồ Valleys, Thái Nguyên, Antigua và Barbuda", "Khoan việc khoan cửa tàu tủ núi gió xe thích ngọt thuê cái hàng thôi bàn cửa kim á nghỉ bè lầu đá á ruộng không một bơi đạp ngọt đồng tui ghế phá chết ác bạn hương mua lỗi đâu thích hết nghỉ đá khoan xe mười em xuồng khoan máy thích đỏ đồng ruộng năm núi áo leo nước ừ tám xuồng bè độc được anh vẽ không tủ ghét yêu đá không hàng thuê được may thuê thương lỗi giày là phá hương xe mua chìm không viết viết bảy sáu quần bảy trăng trời ghét đánh mướn mười yêu yêu gió hết lỗi thuyền tàu đồng không khâu dép giày năm làm nhà cái quê giết vẽ làm mây thuyền hai mười ngọt vàng may ngọt ừ phá tôi thì độc giày không độc nước khâu khoan phá được giày ghế nước bè chìm ác khoảng khoan khoan bốn khoan cửa nhà chết được thích đạp không ruộng bảy đá thuyền viết mượn tím leo mười đánh đang máy lỗi tím con gió bạn một may nước mây vá trời áo một tám cửa núi xuồng hai chìm mây quê đạp là đã việc chết em đạp nghỉ tui mướn bơi làm bè đạp tủ leo thương đồng may hết giày xuồng biết con đạp em cửa nha cái kim ngọt đang tám bàn thích là bạn thích tui dép trời độc nón bàn leo nhà bơi núi vá thuyền biển kim xanh ừ hết sáu sáu lầu hai đang lỗi khâu giày tím núi bè nha giết á ghét yêu gió ác hai xanh khoan gió viết trăng trăng chết đã là may anh lầu yêu độc vàng đạp giày chín khoan thuê anh tám làm thôi ừ giết bốn anh bảy viết giết đá ngọt được tàu không dép đạp việc tô viết cái núi may thích mười xe bè tàu yêu khoan đâu nước sáu làm vẽ biết hương bạn thì chết phá núi lầu ruộng ngọt mua máy tô thôi tôi nón chết đỏ hàng mượn thế việc vẽ giết giết sáu ác leo năm đánh đã độc đâu giày đã chết sáu dép quê ghế áo trời dép biển nha ác đỏ bốn mua khoảng giày hết quần ác mây tàu nha nước đâu cửa nha quê trời xanh leo mua sáu hóa ghét ác mượn xuồng ghế nước thuê khâu thuê nón quần đồng phá á gì quê không đâu á bạn hết yêu anh năm biết tím lỗi trời đạp con việc phá sáu nghỉ hết bàn chín tui việc vá yêu tủ dép tô sáu á bốn bảy đánh quần sáu quần thôi đá tàu đỏ leo leo làm cái hương nha bàn bảy thuê ghế thế chín hai chín thôi vẽ đã mua yêu bè đỏ đồng lầu bơi giết ghế á dép kim đánh.", "Mượn thương bảy vẽ á nước phá em tàu hương hóa chỉ ừ giết yêu bè tàu phá tủ mây trăng là bè thương năm nhà đang dép là thương đánh giày tôi bốn đâu ghế giết bốn xanh sáu đánh ba trời tô trời bạn khoảng trời giày hóa thương xe tui nhà mướn phá chìm tôi độc tôi ba ghét mười dép ghét được khâu đã khâu bàn mua mua khoảng nón lầu quê lầu lỗi mua kim máy hết khoảng là khâu năm một đang đánh may năm bốn núi phá độc khâu vá mượn không nước á lầu mười cửa tôi thôi bảy chín thuê chín trời kim xuồng á thuyền làm thôi bạn khoảng năm đã ghét hai tàu tím đạp bốn giày áo chín được mướn ờ cái gì vá kim nha mua sáu bàn đập vá mượn thế thuê đồng biển năm anh á đỏ bạn đồng mướn bạn thuê thương khoan đã gì nha giày bàn đã khoảng tàu kim hương ba phá đã tôi tô quê khoảng tôi máy ghét nước nón không xe viết hết núi tui dép quần việc nhà áo vá giết bốn chết hết năm khoan hết lầu bảy tím đang đánh sáu chết ghét ghế bàn xe tàu tô biết đâu xuồng hàng biết ngọt thôi tím lầu viết vá hai con leo hết tui đập năm chín bốn khâu tám xe nhà bè vàng việc gì ờ tám bốn mười lầu độc nha may tàu bàn vàng đã ghế chín hương mượn chìm sáu anh mượn mây yêu đâu gì áo là đập chín chìm chìm biết anh thích năm núi tàu đá leo áo thuê quần ờ hết máy nước thế tám núi tám mây hết yêu hết biết bè ừ tô nước một mướn núi trăng gì bè quê năm đá ác chín xanh mua ừ xuồng sáu kim chết ngọt đồng thích độc phá khoan được cái độc khoảng bốn nón tím chết tui mướn dép may việc khoảng hóa tôi em tủ vàng thích giày con chìm cửa khâu hết khoảng sáu tủ thì chết phá mượn mua giết khâu đánh thuyền leo ghét gì một xanh trời thuê may việc quê việc đánh khoảng giết tím vàng xe hàng leo tủ chín trăng may hết tôi xanh lầu tô là tám tím dép hóa khâu ờ thuê tủ gió thuyền bàn nha sáu dép lỗi ác lỗi đạp thích chín vá con được đã sáu chín bơi thế trời thì máy chết ruộng chín năm may chết đã nghỉ núi ba cái tôi biết đâu mây nghỉ thương đồng gió anh sáu quê hương sáu cái tàu cửa nha một vẽ hết sáu leo nhà được trăng trời bảy vá trăng cái vá ừ tám khoảng tôi vàng tám trăng thôi trời lỗi nha thương con nước cửa máy đỏ hết cái chín thích tủ dép ờ em tám phá nón giày thế ừ xanh là đập.", new DateTime(1957, 7, 26, 21, 3, 4, 645, DateTimeKind.Local).AddTicks(3676), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Việt Thắng Lê", "\"https://picsum.photos/400/300/?image=425\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Quảng Trị", "Hà" },
                    { new Guid("27f90bfe-3dcf-46ef-82b0-ba1ada16edef"), "880 Việt Yến Squares, Quảng Trị, Áo", "Gió tím mây chín dép nghỉ đâu á năm bảy mượn ruộng chìm mây mười anh chết quần trời thuyền bốn tím biển gì áo ba kim chín cửa ác nón may chỉ mượn đập áo chết thuê anh thì ờ việc thôi một trăng cái gì mười năm đánh leo may thôi tô đang gì đâu biển anh đập tủ xanh việc hóa trăng phá khoảng làm lỗi viết tím khoảng thương bốn đá giày khâu mười ngọt mua bảy chết cửa nghỉ hàng em biển tui hết tàu nhà việc yêu bàn khoan mượn vá thuyền bạn đâu làm thế trăng khoan biển thôi độc vàng may quê vá tím làm thích tím ngọt em được đâu chết cái gì bạn chỉ làm hết hương đỏ cửa xe một hai khoảng giết hai thuyền nhà đánh ba trời kim nón hai vàng đánh ngọt mướn xe thì thuyền leo gì tôi làm quê nhà chìm sáu tám đá nước tím hàng tô sáu nhà độc mười lầu anh hết thì trời máy một làm nha tui áo đã bốn hai nghỉ ừ thuê quần thôi đá thuê không trời sáu nhà nhà thích nha bàn bạn em nha tôi cửa hóa bơi nước đạp núi là năm năm việc bơi chín tím không giết ba chín hết việc được núi xuồng là quần được ờ giày tủ may lỗi ác tô hai máy may đá biết may tô sáu ừ bảy ờ năm thôi dép ngọt giày đạp xanh nón vàng một giày tàu hết tui vàng đập đạp kim lầu nha á chìm leo bè đâu bè năm vá tui đồng xe xanh độc thuê nhà núi biển viết nghỉ trời con quần lỗi khoan con một ruộng khoảng dép chìm máy viết đang leo thương nước đã một tui khoảng máy hết khoảng làm cửa vá ác nghỉ vàng đạp gì khâu ừ vẽ dép ruộng em tô ác tô nghỉ gió làm khâu viết quê xanh chìm nghỉ ruộng nước bạn kim gió không bàn thương bốn bảy thế đỏ mây năm gió tám bơi con hóa biển tô quê áo nhà trời biết xuồng vàng tui núi đồng ác giết vẽ ghế khoảng lỗi thì biển vàng bốn bè biết một ghét hàng việc ác giết tàu tàu bàn thôi lỗi đã vàng vàng dép đã lầu đỏ hết viết dép con việc áo thuyền dép tôi gì hương ruộng đỏ phá bảy đã ờ quần ruộng mười lỗi thế núi lầu vá hóa thích xanh đang trời bạn hết tôi quê giày leo ác làm giày xanh tàu hết cái thì thế không đánh bốn tím ừ chín mua may vẽ thì được một đã đỏ đạp ruộng chỉ vá chìm ba áo tím quê ba ác chìm thế đập xanh bốn bàn ba hóa làm gì hàng tôi mười hết.", "Nha hàng quê ngọt nón ừ lầu hai mượn ghét ba thôi khoan may ngọt bạn thích ba xe núi ghét hết cửa xanh chết đâu bạn dép mười hết con giày anh trăng anh may leo xuồng mượn nhà đạp việc tủ bảy việc xe anh hết đập đồng hết leo tám leo cái tím nha anh nghỉ mướn ngọt mây yêu thôi thích leo nha thuyền sáu ờ viết tủ bảy hai núi giày trời thuê trời mười bảy làm ờ tô ruộng hết xanh đã chỉ đâu lỗi giày chết nhà không ghế cái thì vá được hương hóa thích mua tím bảy vàng thương trời may dép đạp may hết năm ba nghỉ lỗi tôi máy kim thuyền đồng nha ba chìm tàu lỗi giày dép con thuê nón chết mười nghỉ làm ba áo thuyền đã giết ác hương bảy hóa tủ tám em nghỉ áo thuê nhà mượn xanh cửa biển được năm ừ đập thì tám mượn ruộng độc đồng mượn ghét thích cái việc là nha bơi lỗi á mượn đá tôi trăng là độc biển kim tàu gió thuyền thế may đâu tui anh ác tàu giết hết áo quần đồng gió là tím thuyền khoan tui vàng ghế nhà bơi tô nước giày hóa tôi ghét độc thuê viết độc hóa làm đá con thì hóa giết nhà trời nước vàng tui chìm giết á tím xanh tím kim núi tủ hết tủ ruộng may khoảng hương đỏ giết đập biển thương tủ xe nghỉ thích nón hương may bạn năm vàng bè một mượn tám quần đỏ đạp ba á ruộng tàu á leo nón được bảy đã ghế á trăng hết đỏ bàn biết ghét mướn biết ba lầu tô mua nón độc đập ruộng tím thôi việc dép đập chỉ tám viết việc mua hết tám một khoan được cửa được việc leo giày em đập năm chết quê xanh núi thế vẽ ghét khoảng thôi đập mây đồng á thì bè đỏ ác đã bơi bàn đạp là độc ờ bơi hai bè đá ờ dép việc yêu khoảng thích việc thế chỉ đã lỗi đâu may năm giày thích việc mua làm biển anh mượn đạp bơi mượn độc khâu thôi mười quần em bàn hàng kim giết tui xuồng cái tàu lỗi thì tôi tôi vá bàn việc leo tím tám quê viết thuê năm đập mướn khoảng ruộng thôi giết thì bàn biển ngọt chết hàng thích cửa xanh xuồng nón kim đỏ tám vá khoan thì hết giết quê thương giết biết đá hết trăng ghế bạn núi nước ruộng bè dép khâu việc yêu em tàu thôi lỗi bảy mây tám là ruộng.", new DateTime(1986, 10, 8, 0, 58, 12, 27, DateTimeKind.Local).AddTicks(1025), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Mạnh Ðình Dương", "\"https://picsum.photos/400/300/?image=910\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Đắk Lắk", "Ngô" },
                    { new Guid("2d716ad2-ea77-4a6e-a189-b1253018df3d"), "679 Hà Passage, Gia Lai, Bhutan", "Vá chết quần việc hàng hương hóa mười mây đánh áo may trăng giày hết thuê không khoan làm làm tô ừ việc hương núi khâu đạp giày núi hương ngọt thương hóa viết hóa thương ghét bè hai tím ừ sáu yêu mướn hết mướn quần ờ thuê ác chết hết máy ba khâu nước tàu mười đạp ừ mượn việc tui em nón tủ quê đã thuê trời bốn đập nhà bơi lỗi đánh là ác đánh ờ chín không ác leo ừ vá tàu lỗi nha xanh thích đã hương hết yêu bốn sáu sáu chết giết tàu á tám quê quần áo thôi vàng đập hết trời cái bảy mướn thế xe chín mượn một bàn giết kim hết mướn nhà làm quê hàng giết thương nghỉ sáu á chìm giày ừ ruộng quê gió xuồng lầu tím mây ghét bốn hương thuyền khoảng lầu thuyền tui xe bảy đá khoan đạp tô hóa chỉ á sáu biển bốn chìm khoảng áo trăng khoảng năm trời đá tám vẽ bè thích thương vá ghét vàng chết bàn tô đạp phá khoảng em nghỉ đồng thuyền yêu xanh bạn ghế đập tám nước đã núi mười mây thuyền thuê đã quần cái làm mướn con con đâu tui làm giày giết đánh khoan viết tủ phá thuyền vàng thích lỗi chết thuyền nha tô mây đạp nha quần vàng hết thích làm may vẽ đồng chỉ em lầu sáu áo ba ruộng bốn quê tàu hết khoan xe khoan nha nha đỏ bảy làm thì chỉ không tôi nước ruộng ờ vẽ hàng nghỉ chỉ đang con bơi nước độc hai không đập vàng hương nhà gió tám chín trời núi cửa ba cửa khoan giết làm đỏ hàng tàu không đâu bè nước biển đang được quê mười đập chín việc trời phá vàng dép đạp làm ruộng con lầu một thuê đạp đâu đang tui đập trăng thích quê biển đồng mướn mượn bàn viết khoan đạp sáu lỗi được viết không thương tám xuồng cửa chỉ anh biển phá thôi tủ thuyền mướn nón ác thích chìm thuê ngọt gió quê đánh độc tàu nước hóa ngọt nghỉ cửa mây leo ờ ba chín xanh viết nha độc bảy thuê ghét tui chín may dép á máy bơi chỉ giày viết xuồng đỏ chín kim vẽ bảy một khoan một máy gì lầu một chín giết bốn núi khoảng bảy hương thuê may chỉ lầu hết thích xuồng vá thôi kim tui tui bơi gì khâu bảy gió máy thì mua tôi nón mua hàng mượn đỏ hương ghét yêu thuê ừ thôi gì đá ruộng bạn đang cửa là tàu đạp khâu tui sáu tủ tui trăng xanh lầu tím xanh ruộng con bạn ruộng ngọt gió chết khoan tôi bốn kim trời nha biết tím quần phá gió ba khoan đỏ yêu quần chín phá núi nước tím giết hết bơi bè giày gió ờ bơi ác xe.", "Nha nha giày ba máy ghế cửa mười nước cái thuê nước tám đập thì xe bạn khoan tủ hóa ngọt năm xuồng quần đạp bàn khoảng năm hai là đập hàng đạp nghỉ được đạp tủ khoảng việc nhà biết mười trời ừ hai chìm biển ruộng xe chìm thì nha mười bè ruộng xanh thuê thương ngọt nón khoan nghỉ tím tám ghét hương lỗi nghỉ độc đã biển mua ghế khoảng chìm xe giết lầu mười ba núi kim nhà xe không tôi thuê đã đồng chết độc xe sáu lầu hóa nón thôi hóa xe biết dép tôi được bốn vẽ lỗi chín anh máy quần năm bơi viết tui cái con máy cửa mây làm hết vẽ giết tàu gió trời nhà là ừ chết giày leo đỏ đạp dép mua đâu á trời ba tám phá phá thế tui chết gió khoảng chín ghế á thì ác anh vá đâu chìm tôi độc ghế giày lỗi núi cái hương nghỉ mười lầu bàn hàng anh hết mười đỏ quê kim một lỗi nước bè hai anh áo chín chìm đỏ năm ghế nhà xanh bơi quần đỏ ghế bè tím cửa dép việc xanh hết bè máy được nhà chìm là độc đồng đập đỏ nón nước kim ba một á ác chỉ kim sáu con khoan biết biển hai nhà là á bốn giết con xanh mướn chỉ mây đồng một kim chết giày lỗi quê thế ác núi leo ghế lầu khoảng hương thuyền xuồng khoan thương ừ tím đâu biết tám nghỉ xanh mây là thuê núi nha tui thuê tôi hàng kim hết ác là độc đánh nhà bè cửa nha bè đập chìm việc đã ba là bè đang gió đập nha tím thôi tủ không dép nước đập thì bảy nha bơi kim hết thuê biết yêu thôi gió xe tủ ờ đạp năm ghét đang khâu tàu nón đá thương cái lỗi thì quê năm tám hương tui á xuồng tô leo việc hai ừ giày chín ác kim ngọt chết yêu quần cái kim thế hết ừ ờ anh khâu tui mười nhà thế á ác năm xe hàng nhà hết khoan vá kim mười hàng bơi đạp hết núi ruộng sáu hai tôi bè đang tám bè trời khoảng tô khoảng không được vẽ nghỉ hàng chín viết xanh đã tủ giày tui mượn khoan yêu ngọt khoảng trăng làm ghế giày trăng nước gì em xe viết máy tủ viết xe nghỉ khâu năm ác viết thích bàn tám ghét xuồng đâu lỗi giày con tím giày.", new DateTime(1995, 9, 20, 15, 28, 41, 160, DateTimeKind.Local).AddTicks(6110), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Huyền Trâm Hồ", "\"https://picsum.photos/400/300/?image=478\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Cần Thơ", "Tăng" },
                    { new Guid("36b5e8e6-4943-4592-9c28-b37304d312c0"), "74708 Lê Fields, Tây Ninh, Việt Nam", "Thích cửa mượn trời em tôi gió viết ờ khâu chín đỏ xanh vẽ bơi ngọt dép việc một ghế trăng tôi con nước đâu tui biết việc bè tôi đâu quê leo quê thì mua may vá khâu thuê máy chín đỏ đập năm may ờ tím yêu con hóa một ừ bơi quần núi đạp một là tím thương leo đỏ ừ mây nón yêu ba hàng vàng tủ vẽ đỏ quê viết thuyền bè được đang bè xuồng khâu vẽ mượn ừ bạn thuyền thuyền kim xanh bạn khâu viết trăng con con mướn xe làm biển phá quần mười không anh giày thích hàng một đập thuyền yêu leo tô tô đạp anh máy thích biết chết tủ chìm bốn ba chết được viết ghế xanh tím mua lầu tô hết bảy tàu quê gì bạn viết thương núi nhà khoảng phá hàng hương việc ghế hai tô chỉ biển đỏ khoan ờ nước mây đâu ờ xanh yêu quần dép không làm năm tủ khoan hàng đánh tôi xe dép thì thích ruộng yêu ngọt giết gì tôi mướn con chín nón không đâu viết tàu tui một mua mười ừ phá thôi vàng mười nhà nón đạp gì mướn cửa yêu hương vẽ gì vá tím độc viết cái gió bốn khoan ba ruộng mây hết đỏ thế sáu á nha xuồng đạp thôi hóa mượn đang chỉ không cửa ghét yêu biết phá quê làm tui bạn sáu giết bơi đang yêu ngọt thích là ghế trăng khoan tàu ác bảy bàn đỏ đâu quần em con năm thế trời núi chỉ chỉ bè việc hết bè bảy quê trời bơi yêu thuê xe sáu vá bè mua ba hết chỉ yêu chỉ thích bạn sáu trăng đâu đồng chỉ chỉ chìm ghét chín gió con đánh gió viết tám khoan hết bốn thích khoảng ghét đâu hết chết gì bốn việc thuyền thì thích chín thuyền hóa thuyền núi á hương á cửa bạn cửa quê tủ xe tôi em nha độc xanh đâu sáu nón ghét núi nước leo đang phá không gió bơi tủ thuê kim con khoan trăng xe kim chín xe cửa đang chín nghỉ sáu tủ ba độc khâu núi giết hết chết máy chín á vá bè một núi quần áo thế chỉ hết nước thôi quê tím may năm bơi khâu mười thương nước ngọt em nón mây đỏ ác khâu nha gì tui biết một thương thôi nón sáu trời chết ba mượn quê thì không bè bơi bốn đã thì tàu năm thuyền một tàu đạp.", "Gió thế bốn khâu trời biết lầu bàn máy chỉ bơi đỏ năm một xanh vá thôi đã kim ừ leo đạp dép em con mười đạp bảy ba không bạn thương vẽ thuê mây mười quê trời đâu khoảng yêu tui xuồng dép đang hết lầu anh ừ biển đá gì quần làm khoảng vàng núi ruộng đâu bè yêu thích thôi bảy á giết tô trời thuê sáu tô biết em sáu leo nghỉ khoan dép chỉ ruộng con đá á bảy quê mua tô khoảng nha tám em máy là quần thuyền nha chín thế chỉ tôi may thôi đánh bàn thuyền ruộng chìm hóa thế phá năm đạp hóa dép thích ác hai lỗi xe yêu quần hóa nhà tui là ờ sáu ruộng may ừ ừ chỉ chín thì độc quê em tủ chìm mượn đã hóa gì bơi mười tôi quê kim máy cái may em mượn mây tô ngọt lầu đỏ hóa chìm con tàu đánh là biết khoảng mua lỗi khâu đỏ ác bàn nón chỉ anh nón máy em tám á may á giết ngọt mua bạn bảy xe xanh chết đồng dép hết mây thích xanh mây lỗi núi nghỉ ruộng thôi chìm gió hai bốn tui thì ờ nha lỗi vá tám đỏ con núi thế tám tủ cửa được xanh may nha mây ghét thương tui mướn đạp bảy cửa nón đang con em việc vẽ bảy thích bè ngọt mướn đồng thương đồng đã viết ruộng ghét con gì bàn leo đánh tàu nha là được chìm biết độc cái đá gió việc chết được ba nhà việc viết đập đã á hết hết vẽ quần kim ghế thích quê vá bạn khoan vẽ hóa là anh trăng nước hết tím mua sáu độc ờ mua đâu nhà may không ruộng khoảng thuê em bàn núi nón thế giày áo may nha bàn làm được tám năm độc thì là vàng nón đồng đánh một gió sáu vàng nước núi máy anh may đâu biết may đâu gió mười leo hương thế mượn mướn sáu phá mây giày đỏ anh chìm thuê em ruộng á vẽ ác thôi độc ngọt lỗi tám dép cái tím ừ hóa đang con khâu quê thì viết độc tím núi áo là khoan đỏ đang thương vá ghét viết hương năm con bơi quần ừ làm một biển ruộng anh thuê một làm cửa xuồng ác độc ba là núi được bảy tám con mua một ghét vá đập ngọt mây bốn việc leo hết viết thích xe bốn dép tui đỏ đánh bơi bảy viết anh tôi viết thì.", new DateTime(1978, 1, 17, 11, 31, 55, 520, DateTimeKind.Local).AddTicks(1104), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Thuận Toàn Phạm", "\"https://picsum.photos/400/300/?image=1042\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Yên Bái", "Hà" },
                    { new Guid("4ef2900c-c905-44c4-aff3-ee7a25c1873f"), "847 Ngọc Hiển Station, Lạng Sơn, Pakistan", "Đang khoảng đá trăng thích viết lỗi chìm quần vẽ á chỉ năm tô vá vá cửa chết á nghỉ quần khoan đang hàng được nước kim đồng lầu vàng nón mười xe quê tôi thương hết xe thích chết trời may ba núi thương nón trăng là quần thuyền nha áo tô hóa khoan ác hết ghế dép đập yêu đang được tủ thì quê may nha đã nước hàng máy lỗi sáu làm máy lỗi tui tủ hết mướn hết đá hai dép hết trăng á leo kim đã nhà đánh bè ghế chín đạp áo thế gió anh tàu tô năm mười mướn xanh hóa khâu giết ừ mướn ruộng giết đá hương nhà hóa chết ờ biết áo ghế áo vàng đạp á đồng đang ngọt thôi cửa đang biết bè cửa chìm thương khâu á trời chìm bè áo mười hai thôi đánh vá khoan xe xanh bạn đang giày ờ máy á việc máy bốn bốn thì ác mua thế khoan áo thích nha núi thế nha trời năm bảy bảy trời tôi gió nón núi chỉ nha khoảng thôi núi đâu trời tôi mười giày tôi nước nón xe nhà núi trời ghét bạn làm đập tui á tủ hết thương thế trời nón khâu việc thương một mây gì ừ tám núi đỏ hương chết thôi mười bốn bơi thuyền tủ là trời tàu gì dép khâu đánh thương hóa không ác ừ ghế hàng biết mười nghỉ vá bè năm quê tôi đập tô là trời tủ chìm ờ bảy ghế bơi trời bè tám được mây dép thuyền lỗi ghét ờ mây tàu trời tô hương bàn anh chìm khâu tím ba hết dép ruộng thế việc tím trăng xe mua chỉ cái đâu thuyền đạp bạn quê tủ là xe trăng vàng nhà một mượn lỗi việc bạn lầu đồng khâu áo một ruộng ừ xanh em thuê tôi đạp phá nhà đạp leo leo vá khâu một tám giày hóa đã ba một nước là giết lỗi hết cửa bốn kim cái ghét nước thế mượn yêu thế viết nha á trời ừ anh bơi mười máy đập xuồng bảy gió thuê mười tui ghét bàn lỗi lầu đâu đã đỏ chín bàn là hai mượn giày thôi mướn đâu hết con nước đang đỏ thôi may nước trời giày tím mua mây tám được khâu tôi nghỉ xe mây chết hết quần thôi á chỉ áo vàng anh máy thương đồng bàn bốn quê bạn bảy ác chín mây con hàng vá hương con mướn bơi ác hai đã phá lầu ác mười không chết hết bàn độc nghỉ năm anh thế trăng dép gió xuồng ừ dép may kim đá bốn ừ nghỉ lầu bốn bè đá hóa cửa nhà gió tủ may.", "Ba giày ác mây trời á á đánh đập làm đã hết ác đã cửa ghế máy ngọt áo khâu ác biết đồng đập biển viết ruộng xuồng may bốn tủ làm tô mây nước thì năm việc may thuê đang gì đã vàng tím độc bốn ừ đánh biết một dép yêu thuyền vẽ ghế thuyền kim bảy đã bảy thế nha mây may bạn khâu đỏ một cửa tàu giày vàng vá nhà khâu ruộng trời chỉ núi hết hết tím hai đang đâu con thích đập đỏ quần thích mượn nghỉ nghỉ mười viết núi tám máy cửa tôi bè hương thuê là máy năm bơi máy sáu nhà quần thương dép được bàn cửa giày chết chín hết khoan là khoảng hóa độc quần tím thương đánh mượn lầu quần giết cái á tôi em em tô cái ba ruộng cửa đã biển phá ờ may xanh nghỉ đỏ mười ghét trăng vá mười vàng thôi cửa thôi lầu mua em nhà leo áo xanh ruộng lỗi viết tôi đập giết việc núi bè tô tui gì quê chín tui em đỏ biển tô ngọt đã thế trời nón thuê không áo gió chín may thương trời kim vẽ tím mua tàu làm thích anh giết đang không bơi tím mười xuồng trăng khoan dép khâu chín bơi là năm được anh ghét máy gió vàng cửa tím đã phá mây biết khâu áo núi hàng đánh hết ờ vẽ giày sáu sáu hóa bè khoan áo ác xanh gió hàng đỏ nha bè kim cửa mua tui ác bơi đâu tô gió làm đỏ mười không việc xanh thích tôi cửa đã đâu viết xanh thích nước đâu thì là nhà hương nước đập không thích lỗi biết ba mười xuồng việc gió nước mượn á núi tô hai khoan nghỉ mây nha mướn ờ cái xe không giày nước nước thế biết bơi ngọt biển mướn tôi ghế hương bàn xanh được tám chìm vẽ đánh gì nha phá máy mây bàn thuyền hương tím hết giày ác mướn sáu bạn hóa núi ghét biển đánh ác gió mây làm núi á đá đồng phá ghế trăng hết hương gì chỉ ba tím làm may tui chín thôi kim kim xe năm ba cửa viết ờ em núi thương thôi nghỉ leo thế quê hết khoan chín đạp không tui hết biết mười gì.", new DateTime(1981, 4, 4, 6, 29, 24, 669, DateTimeKind.Local).AddTicks(9791), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Thục Oanh Tăng", "\"https://picsum.photos/400/300/?image=624\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Tuyên Quang", "Vương" },
                    { new Guid("54dd63ed-f75b-4249-910f-74b77cd04303"), "17227 Mai Street, Kiên Giang, Libya", "Máy ác thế ừ mua giết hóa vẽ mười độc đánh bảy lầu đỏ việc nhà ngọt vẽ là thuê lầu bè xanh bè chỉ ác gì sáu ba ngọt tàu ghét bơi dép mười trăng tô ruộng năm dép nón khoảng là quê hóa quần bạn xuồng gió đâu máy sáu nón xanh bạn núi là biển tôi hai quê cửa leo nón dép năm năm áo nước bạn trời cái giết thích gì giết máy nhà trăng tôi bè mua máy là không đỏ hết con tàu hết năm ngọt chỉ bảy lầu may biết tôi bè em ừ ruộng đạp tám con đá bè viết bảy đập bốn được tám đã bảy con xuồng lỗi xuồng ghét đập tôi máy biết hương khâu xe áo núi khâu việc tôi biết tủ một thương đang năm hương chỉ đỏ chết con đập mướn giày khoảng thương một ngọt trời lầu sáu vàng ruộng thế xuồng giết một đánh đồng bàn á đâu chết ờ á đỏ ghét ruộng máy giày hương em đâu là tím quần mây máy gì mây hai ngọt mười nha vá bốn tôi hết khoảng biết đập bàn biển em một không hết chết trăng gió đồng chìm trời tô thuyền nha mười tám biết thương hết đạp nhà ngọt ngọt bảy áo vá thuê quần quần giày mua xuồng ghét cửa việc thế đồng cửa thế leo yêu máy ghét tôi xe trời tủ thế xanh là cửa xanh việc ghế ờ lỗi ruộng biết anh dép ừ thích núi giày là bàn việc hương nhà tàu dép chín máy anh làm thuyền ác mây hàng em quần tui nha con mây yêu biết khâu thích hết việc năm xuồng giết ngọt chìm ờ ờ việc nón hương thôi cái núi áo á dép năm phá xe sáu đang ngọt thích viết bạn kim may làm hết gió kim thế tám đánh ruộng trăng xanh không ba tàu thì gió vàng con xe chỉ tàu thương leo em núi gió năm nón bè mây mượn bảy trời nha ngọt máy thuyền dép dép đá núi tám bốn hết đỏ á thích mười hết vá đạp biết khoảng được á hóa đồng đạp mua khâu máy lỗi mướn bơi mây bơi chìm leo đâu được bàn ghế quần mướn bốn máy ngọt đập yêu ừ xe đạp mượn hóa tui thôi viết vá đỏ quần giết viết vẽ đã đã bạn lỗi quê thương đạp hóa quần tím tàu gió đạp bè nhà áo chết vẽ quê giết anh đạp thế dép chín việc mua trăng ừ may yêu đánh yêu bạn viết khoan trăng hóa em mướn tám được đạp quê hết sáu một viết núi không phá việc khâu tui hai con ghét bơi khâu.", "Nghỉ tôi năm ờ nghỉ hóa máy vàng hai tàu ừ bảy may độc á đang ruộng giết kim vàng quê em tô thích khâu đánh gió quần trăng phá thế vá áo chín khoảng tô đã chết nón năm em mượn tám may là vẽ biết ghế ác hết chết nón hai hương xe mười tôi mượn núi bạn tím mười leo chín sáu được chết đá con ruộng xe đồng đá thích tủ giày bốn năm tủ viết ờ yêu biết chìm khoảng tím anh nghỉ tàu cửa thôi tui gió phá bảy mua biết đang bạn bè chết khoảng bè chìm hai vàng khoảng quần hàng bốn khoảng mây tàu thuê xuồng hàng trời lầu tô ngọt vàng tủ nghỉ hương tủ nhà mướn làm trời leo là bè nghỉ đang nha thương tím ngọt tủ chết lầu ngọt nón ba hết thích khâu hai mây biết ghét tôi thích hết đang độc thích tủ là sáu lầu ba quần đang biết độc nón bạn vàng mua hết hết chết mây chín trăng á tôi viết thế biết đã quần biết vàng con tàu nón hết bảy may tám độc khoan phá thuyền phá chết bốn vá năm mây thuê vẽ quần đập khâu chìm chìm chỉ biển chỉ tàu tím anh tím thì việc tui lầu hóa nghỉ làm nón ác hương tủ gì ghế đỏ đã vá ngọt á hương leo yêu trời đạp trời quê nón ngọt nghỉ áo em áo khâu được mướn không năm khâu nhà ngọt hóa hai khoảng năm hai núi bàn anh nhà thích quê hết gió ngọt vàng ờ đỏ đã ghế nước kim đạp giết đang tám kim được mua thuê ghét tám phá quê chìm cửa nhà chết khoan máy khoan cửa anh hàng hai chín năm xuồng núi tủ mây áo mua xe xe em bè một á thế trời á bàn hàng cái thích đánh độc thuê núi thương chết giày không giết hết xanh em chỉ quê bè nón ừ độc đánh đồng xe đang vẽ trăng đạp mua giày ghét tím khâu tô trời ba phá thuê con mây ngọt hết ba em vá mua bàn hết trời biển gì gì đá mượn hết thuê ba được đã mười may khoảng hết đã đỏ đồng làm mây biển xanh hết viết phá thương giày hương áo độc làm nha quần núi thì xuồng ghế đâu đang tôi quần lầu khoảng thì nghỉ bạn viết mua việc bạn mượn bảy một xe vàng chìm may được không thương.", new DateTime(1953, 11, 12, 19, 40, 38, 716, DateTimeKind.Local).AddTicks(8739), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Duy Khang Trịnh", "\"https://picsum.photos/400/300/?image=353\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Quảng Trị", "Trịnh" },
                    { new Guid("716850c4-806c-404f-91ee-ea1e10072316"), "3349 Hà Canyon, Sóc Trăng, România", "Tím ghét áo chín nón tủ mây thích con hết chìm thế mây đạp hai đồng quần hóa mười hai sáu ba khoan trăng xanh đá thế bàn tám hai tủ giày được khoan hóa thích việc độc nha mua nước leo là bơi đã ừ năm mướn á đập chết mây em mượn anh ghét thôi hai ruộng đã thích áo hóa làm thì cái ngọt nghỉ biết làm dép leo thích con mượn nha khoan ghét nước đỏ thuyền leo gì yêu tàu tui thích á dép kim vá bạn đâu gì yêu trời ruộng mướn ngọt viết phá lầu viết chìm biết thì á khâu bè cửa thương đang con chín ờ năm đồng giày giết thôi tui chỉ ngọt anh tàu hết chìm bàn thích áo bốn tui giày giày năm sáu nước dép ngọt á ác chỉ con áo việc tám hết anh đỏ phá khoảng là bè tàu xe đập sáu kim độc ghét khâu mua xuồng được bốn giết viết thích nghỉ anh tui hàng bơi mượn ờ kim khoảng thích biển năm tô thương vá biển hàng phá tui chỉ vàng nón năm đồng gì tui quần việc ghét tô leo gì ba áo tàu tui chìm đang vàng cửa xanh mười dép mướn nón tàu ghét khoảng biển gió đỏ thì mượn tủ đánh ghét sáu hóa núi bảy thôi đập khoan ác một đỏ hóa nha biết nón xuồng áo thuê thế hóa hai ác á phá thương nước tám bạn phá hai áo tím đâu khâu sáu là anh ghét năm khoảng thương lỗi máy là vàng thì nhà giết bè anh tím núi cửa ghét cửa đồng thôi cái phá hết máy yêu đang ruộng hóa con thích nha quê tui tàu đang thích đâu đồng nghỉ em tím một quê giết độc em em hóa sáu tím xe bàn quê mượn sáu bơi yêu năm ba độc ác nước vẽ gì hết hết khoảng lầu thương em tui dép nón đánh khâu tô bàn ừ đánh biết thuyền mua bạn thuê ác vẽ viết giết nón bạn đạp đập tô đồng tàu kim mây bốn xuồng giày chỉ đồng hương bè quê bè đánh hóa mượn hóa quần giày dép gì giày thích thì ác đạp lầu mua thuê việc ngọt biển khâu trời ác trăng bảy ghét đá thì khoan giày thuyền độc thuê mượn hóa đỏ xanh thích vẽ dép quê nghỉ đã hai ghế ác bơi núi không lầu tô được xe khâu vàng tui chín nha yêu xe á tủ đỏ mướn nón tui thích hóa là lầu ghế giết yêu giày mây đá tím ruộng lầu ừ hàng mua trời khoan bàn em vàng nhà đá ghế viết bơi mây tàu xanh biết chín mượn bốn hương khoảng không chìm em chìm không hương đồng hết hai độc xuồng lầu anh tủ phá giày bốn núi tô vá.", "Biển xuồng đâu chỉ quê tui leo năm hết không mua giày sáu hương ghét ờ bơi ruộng mượn đang ừ quê con gió viết bàn chìm nhà tàu bạn hai hết tám bè ghét một bảy ghét ừ vá nha lỗi mây hết á ruộng phá xanh máy ờ thuyền gió bè hóa tôi thương kim nón mua chết thuyền đập bạn thích dép xe thuyền mây dép lầu ghế mây hàng đánh hóa thôi nhà bàn leo lỗi mướn cái lầu lầu ờ ba leo bảy xuồng lỗi em làm yêu thôi tủ gì tôi bảy tím tàu nha cái thôi tàu tui đánh nghỉ đánh trăng ruộng đang máy giết thuyền mua thế bè nha ghét biết gì tám nhà giày đập vẽ xanh tô không mây thì quê ờ được bè tàu khoan chìm leo máy xanh đánh xuồng mua bốn lỗi vàng giày là ruộng làm tám núi hết gió quê xanh ác dép quê con mười bảy được năm sáu nghỉ em trời ghét khâu cửa biển tàu tô em cửa lầu tủ đâu được thuê chết nón chìm gió phá mười vẽ bảy á xanh cái nón bàn tủ thuyền là ghế đánh hết tô được đỏ biết cái khoảng vàng bàn mười năm nha viết bơi thương ừ một kim giày khâu biển mua nước nước áo là xanh giết bơi không biển leo thôi mười hóa ghét tô không vẽ mây chỉ nón quần cửa mây bốn chỉ nghỉ đá sáu trăng tô đâu kim thuê thôi ba bạn ừ may tám thương khoan hết xe đá bốn mượn biển giết ờ tô ừ leo đâu chỉ thuê mười thích không thích mua đồng may độc ghế thương đập thuyền phá ác vàng một nước năm thương dép xanh đồng trời đánh quần vẽ quê thuê một chín bạn xe tủ tàu leo em vá đập quần thôi nha sáu mua nước đá tôi hai trời vàng độc hết anh chết bốn làm đâu em bè thích năm hết cửa tàu vàng hết ba ruộng đạp gì nhà mua ờ thế ruộng thích anh bè không giày biết phá trời không thích việc độc biển hai kim trăng biển ghế bạn hương mướn máy trời tám là áo vá lỗi áo đồng mượn làm vàng tôi ác đạp khoảng chỉ bè đá anh đạp biết đánh hóa hóa dép tủ yêu sáu ba là ác đỏ chín tôi bàn giày ờ giày tôi bơi bạn xe ác kim hàng hàng đá đâu đồng đánh hóa chín hương anh leo trời bơi con ngọt nhà thuyền ghét bàn là hai cái áo được đâu nước phá kim đồng bạn á việc lỗi dép con ừ thích hết á xe yêu quần con không làm thế biết yêu ba thương tui lỗi nha hết hai giết yêu quần vá kim chín đỏ tím may bơi lỗi.", new DateTime(1993, 7, 26, 18, 31, 14, 576, DateTimeKind.Local).AddTicks(9810), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Yến Loan Lê", "\"https://picsum.photos/400/300/?image=19\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Khánh Hoà", "Đỗ" },
                    { new Guid("7cd26b9a-5b8b-4a08-a958-90dc79915a1f"), "086 Phùng Burg, Bến Tre, Kazakhstan", "Tui là yêu nón tím á bàn thế bàn thế nghỉ gì bạn đỏ viết á bốn nghỉ lỗi viết nước là núi nghỉ kim leo chìm núi độc tui năm nón áo bạn tô bè hóa bàn hết nghỉ ba thuyền ghế cửa đá bơi lầu áo nhà tui bơi quần mười đang tô mua dép trăng thích ờ con vá tủ ờ em nước bàn dép việc thuê bảy ngọt xe nghỉ cửa hết thuê làm thuê hai đập vá mượn đá khâu bạn thương tàu cửa hết bốn mua biết hương gì hai đồng đỏ bạn ác em bảy xe tô giết mua tím lỗi một tàu biết tám đỏ phá mua sáu kim hóa hết ừ đánh mười vá vàng chết nón thích ghét xe tám ờ thuê khoảng leo khoảng làm mười lỗi cái mây con á hai thôi núi tui làm máy tôi ác ác kim không đâu vá thương khoảng bảy sáu đạp hết việc khoảng tàu hàng độc em yêu xuồng mướn tôi một mây hàng chìm ngọt đánh phá anh bàn hết ngọt tô nghỉ tô tím tô lầu hàng nón cái tủ hai lầu nha trời lỗi một tô máy yêu năm thuê thế mua mượn tôi may khoan đá á tui năm giày bạn bảy ghế thuyền mười thương hàng khoan á quần thuê thuyền tô ruộng tô ngọt hết đạp cái gì ghế anh con thì yêu việc chín viết áo ờ đỏ mây thôi đâu vá ừ tôi thôi biển nhà ờ đạp hóa nha chết làm dép hóa ghét lỗi thuê làm mây lỗi giày hương vá quần hai khoan áo không bàn núi em sáu á sáu đánh là hai ừ cửa làm không biển bè ruộng đánh thích đang tím nhà chết chỉ tím mướn đá ghế tôi leo hóa viết mượn gió hương ghét ruộng khâu độc dép đang biết anh đâu viết đá nghỉ gió trời trăng vẽ anh tôi áo kim tui xanh hai chết thuyền may thuyền xuồng núi thương ba con vẽ phá đánh ghét em không khâu biển thôi một chết độc leo anh đồng tui đánh tám anh đỏ mướn ờ đang tàu chỉ cái tím mua một quần sáu lỗi ghế ác giết leo dép vá tủ vẽ ba leo vá ba đạp khoảng làm em cửa bạn hết núi hết ba tui biết lầu ác gió bàn vàng cửa trời ghét việc viết ngọt ngọt dép đánh ờ chỉ.", "Cái ghế năm kim hương năm yêu đã đánh tím đạp gió con khâu sáu nghỉ tím khâu hết đang thì áo vá lỗi gì biết đã vá mây bè hóa xe biết núi hai mua bàn độc tàu thế khâu quần thôi ba cửa đồng xe không ừ độc chết cửa quần nón thôi xe được trăng con lầu chỉ đâu việc em đang ghế tôi nước tím tô thôi giết kim được tám tô thế cái yêu quần dép gió ờ nghỉ năm vàng khoảng thế chỉ thì không một độc quần biết hàng ờ đồng mười đỏ hết ừ thích việc áo vàng xanh viết nha mướn tôi ghế tô năm kim gì mây con kim tàu khoảng bè gió nha biết chìm ờ đồng hai nước nón tím đập bơi khoan núi chết nước lỗi máy mướn năm đá con kim không ờ tui đánh tủ hai nhà con áo mua quần thích lầu con tui mây một phá hai thuyền tím khoan độc trăng mười làm chìm em tủ đập tàu hai đánh việc leo mượn vẽ khoảng anh á sáu lỗi đã tàu đang độc leo chết vẽ biết cái nghỉ khâu máy mười áo máy không lầu trời đập bạn lầu xe đang con chín ruộng cửa tím mướn việc thích ghét đỏ đánh ờ kim áo giày bàn khoan xuồng hương tàu leo một vá tui đánh vẽ biết gió thương á chín yêu bàn thế mượn ruộng làm bè thương cái việc đập tàu em núi hương lầu ba khâu leo thế viết cửa trăng em tàu may nón tôi lầu giày thuyền chín mướn em độc ừ bơi năm đâu tô sáu bốn hàng tô ngọt mua nha máy á xe giày một hương nón được giày ba viết dép bốn kim tôi kim ngọt leo gió là nón mây tô đá đỏ thuê đang đã đâu thương chìm mười trăng đập ngọt á phá con độc á vẽ hóa mây tôi độc ngọt một biển quê leo việc áo bàn biết khoan bàn chìm tui em mười hàng vẽ hàng độc may ngọt đang thôi thì năm gì ác sáu dép ừ tàu may khâu sáu hàng máy leo bàn xanh tám cái đạp thuyền đỏ mượn em biết tím hai thuê tám mười quần hết leo phá chết thuê gì nón bàn tôi giết đang đạp tôi nhà đang núi yêu bảy áo nhà quần mây tô bảy hai núi đồng con nhà giày năm sáu chìm núi núi tàu xuồng đánh quê bạn á nhà chết mượn dép ghét làm mua bàn thích bảy tủ nón thì leo tàu nhà trăng lỗi nhà ngọt đập áo quê chỉ anh đá đạp đá hai đâu gì được trăng phá bơi mướn nón quần tám vá thương vàng trăng độc lỗi mây nón con bốn là thích trăng hai khâu.", new DateTime(1978, 8, 22, 8, 45, 45, 194, DateTimeKind.Local).AddTicks(3485), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Mỹ Nhân Tăng", "\"https://picsum.photos/400/300/?image=983\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Sóc Trăng", "Tô" },
                    { new Guid("8d2e7672-8df5-4ea0-ae4a-56fa8f7dec3e"), "080 Chính Tâm Common, Sơn La, Burundi", "Ghế được biển lỗi con hết đỏ vàng ruộng giết ác là đang lỗi tím tàu thích kim nhà con vẽ thuyền ghét tím tôi hai viết gió thuê leo xanh trời con mượn đập sáu thôi sáu một biết hai quê mây trăng tui tàu phá á tím hương tím khoan thế mây bạn mướn á vẽ quần nha tám ba quê xe phá em nước mua ghế cái thì vàng bạn được chết hàng tám cái nha mướn thuê hóa thì gì ghế độc bốn cái máy thế phá tui con máy thuyền ngọt bàn tám tím là đồng đồng đồng thôi mua đâu tui ba nha tủ áo ghế vẽ ờ biển thế mười xuồng năm tô gì nón giết tủ bàn dép ba xe ghế năm chín là khoan không hàng nghỉ mười ghế một hương gì cái chín xuồng thế núi trời hai lầu trăng cửa đã mây leo ờ một ruộng phá bơi xe vẽ là xuồng đỏ ngọt chết đỏ khoan chết đã xuồng đánh nhà sáu may mướn thương vẽ ruộng chìm mướn thì thế chìm chín bạn tím biển hóa hết chết đỏ gì sáu hàng núi được việc tím bè hương nghỉ tàu đỏ yêu thích biển bàn yêu ghế yêu hóa được giết quần đạp quần được khoảng leo thương hóa đã chìm thuê bốn hương thì sáu vá khoảng xuồng hết được không ghế hết anh ừ hai mượn đồng hết giết viết đâu nhà con ngọt hết leo bảy là thuyền bảy tím đỏ vá ác xe hương làm bảy khoảng hai hương nha mướn kim hương cửa mượn hóa trời nha thuê ờ thương vẽ đang hết đánh sáu gió quê năm hai không áo độc đỏ lầu mua khoảng bảy hết nước tím là biển nón là dép vàng thế ba nón gió mười nhà sáu nước ừ thuê đang là mượn phá xuồng tàu xanh không leo hết lầu chìm ba biết là xuồng ghế biết ngọt chết hóa hàng con ghét anh á hàng chìm hết con hết đỏ bàn máy kim đỏ trời bốn chìm ngọt mười tô nghỉ chín quần lầu bạn trăng hàng chín giày được bốn tui đồng nha bơi lầu cái vẽ hết năm đập bốn ghét khoảng được lầu tủ thuyền tủ yêu ruộng độc đang chỉ chín phá chìm em cửa ba xuồng hết áo anh năm ghế tô yêu thuyền đồng thuê một giày xuồng phá mua quê đồng được đang ác dép sáu bàn không núi hóa vẽ mướn tủ xe ghế thế đạp mướn độc mây thôi thế đập lỗi em chìm xanh xe hai tám lỗi tôi làm mua đồng mây ngọt bàn hai quê gì kim đồng xe leo ờ năm sáu ghế thương tím đập xanh vẽ quần đánh vẽ.", "Hết chín mười biển hương hóa đạp mười con đã ghét nghỉ tôi chỉ đang yêu việc gió áo xanh xe hương yêu hương đồng vá mượn thuyền leo máy giày bè con phá thuê biển khoan đánh được thương viết leo sáu mướn thôi bàn tủ dép nhà yêu quê thuyền hương ác đang trăng mua cửa ừ đã ba may lỗi lỗi một đập nước ghét đã á leo nước khoảng thương tui khoan hai giết dép xe nón cửa hàng dép mượn xuồng làm ác bốn ghét tàu chết bạn gì tám làm nón ờ nhà giày mây quần phá thôi hóa yêu sáu bè khâu nhà dép em bốn trăng tui mướn đã đập giày leo bơi ghét leo đang mướn mướn hóa vá nghỉ làm không mướn bạn hết đập hết thích bè lỗi nón trời độc giết năm thế mướn ác trăng bảy tím lỗi máy chỉ biển thuyền bơi lỗi giết khoan á tô ba ghét đâu nha hết giết xe lầu nghỉ hương việc trời thôi thích vẽ một đá tui yêu ngọt bốn nha thương tàu trời độc anh khâu cửa hết tôi thì hết ghét hàng đâu tô chín tím yêu tím đập độc nha tui đồng hóa bạn phá phá được sáu hàng làm chín không hết giày tôi bè núi hóa trăng mười bảy hóa đỏ chết thôi mướn nước một hàng ngọt thế đã thuê xe thuê hương tám vá hai không hết mười xanh nước vẽ thích mua gì sáu thích viết chìm gió lỗi trời hàng á làm nhà mây ruộng giết xanh độc trăng hai nha khoan nhà á thôi nhà quần yêu yêu việc gió mượn đạp hương cửa vàng sáu được thì xe mướn đánh làm chìm biển giết việc dép quê ghét gì mượn ghế ờ viết chỉ em bàn sáu việc được ghế thôi ác anh năm được hàng ừ thôi kim hóa kim giày nha tôi xe đập mua thương tàu mua ngọt ờ tám mua không thương núi ba chín đập may ghét vá chìm ác đồng quần thích con may thuê chết bơi đã giày lỗi ghét khoan một mười không nha khoan hết được xuồng á làm cái được thì ba một nón là mua ác áo mây gì biển chìm đá ba chìm đánh yêu hàng sáu hàng việc mượn độc lỗi nước gió đạp lầu tô bốn cái vá xe em ừ thôi mượn vá gió việc chỉ là đánh thích bạn bốn á ờ tám tôi vàng máy đỏ chết đá ghế giày một anh chỉ gió mướn tôi một thuyền ghét thuyền nghỉ may thôi quần trời tui gì ờ việc máy mượn áo ngọt quần em thôi hết việc núi làm phá lỗi đập trời khoan được không việc bè đá leo bạn.", new DateTime(1998, 4, 26, 1, 12, 54, 202, DateTimeKind.Local).AddTicks(7373), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hữu Hùng Phan", "\"https://picsum.photos/400/300/?image=722\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Đà Nẵng", "Trần" },
