hâu hóa đánh thương tui xuồng tô vẽ viết leo biển.", "Bơi cửa đâu trăng một nghỉ gì giết tàu ngọt chết đâu ghế yêu đã mua tô quê bè ngọt xe tui nghỉ may làm nha chỉ ừ ghế chỉ thôi yêu thế tủ là làm bè ngọt hóa anh hết trăng ừ nón vá thích được đã chết áo nhà máy quê áo đồng hai mua tủ hàng ừ nhà thôi hóa quê đập mượn mua mây trăng trời gió khoảng đỏ thích là lỗi quê ba thôi ghét đỏ bạn ngọt mười đã đạp trăng không đập giày viết may biển đâu mây đạp đỏ chìm hết may ruộng bơi ghế vẽ thuê em hết trăng xuồng đỏ đã mười tui xuồng mười hàng khoảng ghế ờ làm gió ruộng bàn không khoảng đâu con bàn hết tui ờ chết tàu vàng thế cửa mười á một khoan biển đã đâu tui mượn thì áo kim con hóa hết chết năm giết hàng đang đồng cửa thương đánh trời thích tám đạp ghét bè tủ dép chín thương bốn bảy kim viết anh tui tủ việc ác biết cái đã trời vàng lỗi cửa vá làm khoan yêu tô không một thế giày cái hết đá vàng tui thì yêu cái một núi vẽ leo quê lầu yêu đạp thuyền lỗi đồng hàng khoảng vẽ đâu không tím viết bảy thuyền hết vẽ độc con ghế năm giết dép thương tủ tủ chìm đồng ác tím bơi bảy gì mây anh máy kim ba thương đập một hết biết giày ờ khoan biển ừ đánh ngọt giết bơi đâu bốn là ờ nón gió trời ừ thuyền thì ngọt áo cái con bảy trời khoảng mây thuyền mười bốn ngọt đá vàng khoảng hàng thế nghỉ bạn khoan quần thế ruộng viết trời mướn máy ghế á năm tui nhà hết xuồng anh yêu chìm gió viết nón may viết tui quê đỏ hết cửa được nhà yêu máy bơi giết hai hết cửa vàng chết lỗi hai vẽ gì thương quê một đồng chết vẽ việc đồng hàng em khoảng vàng phá ác thương anh lầu vàng lầu thích ruộng viết đập vẽ núi bạn xanh biển đang yêu may lầu đập đập biển nha vẽ biển anh quần biển xanh mướn á yêu hết việc biển chìm sáu không leo dép núi vẽ thôi việc hai thuê biết tám viết việc nón viết mười ghét ngọt đồng một tám đã mười xe vàng hương con hết hết áo phá xuồng quê ngọt độc.", new DateTime(1966, 9, 14, 8, 56, 41, 522, DateTimeKind.Local).AddTicks(1264), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, 