                    { new Guid("99116201-0c03-47b8-8eee-d246ae4631aa"), "1545 Dương Ways, Vĩnh Phúc, Lào", "Nón tủ đỏ ghét đập sáu mượn trăng nghỉ khoan lỗi nước bè ghế khoảng tô núi thôi leo thuyền tôi lỗi đang trời trời anh xe độc em chìm hết bạn ừ bơi khoảng gì quê nghỉ vá việc hết núi áo con khoảng hóa mượn thế mây cái lầu mua mượn đập thì nước tàu biển đạp bốn bảy việc thích giày thuê ờ xuồng em biết bàn thôi cửa vàng leo vẽ đồng may xe một không đạp vẽ vẽ nước ba mây bè một ác thì mây nước trời tàu cửa vàng phá khoảng khâu ghế cái ác chỉ vá bốn chỉ thích xanh em sáu giết bàn tám gì thì hết ghế biết là ác giết phá thuê thuê thì núi tám đánh trời hết nha áo đập mua năm không tàu dép á máy ngọt cái ba đỏ mười khoan đá ba đập tím khâu sáu nước ác lỗi độc không ờ hai biết xanh bảy giết mượn chìm bơi đang đỏ xanh một đỏ chìm thôi đã tủ tôi nón độc khoan không hương núi đạp được ác anh tàu vẽ tôi hết không nước viết một thế nước giày mướn biết bảy chìm anh nha đang sáu thuê nón tím biết ờ cửa hàng áo nha bơi nước dép leo yêu dép chỉ nước đỏ giày chết ba giày chín mười lỗi hóa bảy xuồng đá hai núi mượn thuê cửa anh gì không tủ khoảng xuồng mua nước hóa hai bè lỗi chết em dép dép chỉ thì lầu gió em phá quần lỗi trăng được ngọt chín vẽ may lỗi giày đỏ không tím quần ghế tím bàn đá đâu tui ghét gió gió xuồng ghét thì đỏ mướn sáu làm chìm đập biển hết bạn đồng độc quê em hàng chín máy biết chín gió lỗi trời được cửa thôi á con vẽ áo lỗi bàn vẽ khoan năm chết tím khâu thích tím tủ một phá đập đỏ may nha vàng nghỉ hết khoan dép nước chìm phá được khoan đồng nón hết yêu ghế giày lầu tàu tô ừ thương ghét máy nón ừ ừ việc hết sáu tôi ghét ác bè mua một tôi việc ghét thích đánh leo quần tàu làm khoảng đạp biết hóa hóa bơi thuê thế độc khoan thế xe trăng hàng chín ruộng bàn yêu độc được nước thôi bốn khoan không nước em giết giày hương giết.", "Tôi sáu thôi trăng tui mười trời mười em may tám ruộng khoan sáu là tô máy bảy áo nghỉ năm đâu đạp ghét ác máy mười gì ngọt mướn tủ biết tôi hết năm được biển quần ba nón vàng năm viết yêu may ba ruộng quê một giày nón gì mua núi ờ trăng hai ờ giày tám ờ vá mười chết mây thuê thì bảy lỗi khoảng gió leo dép lỗi một bàn đang á khoảng thôi ngọt hết đang đang đánh biết xe việc thuyền lỗi đánh hết xe đã nghỉ giày bè núi thương thế lầu tô hai một không nhà biết thôi cửa kim đạp đá trời năm ghế em việc nhà đã mây hàng vẽ bè đạp vá nước bạn quần bè áo ờ cửa nước thuê quần may xanh hóa hóa không sáu đỏ trời giết vá khâu là dép xanh trăng máy tám ừ trời khoảng áo khâu hết giết thế tô đập ghét đồng đã thế thôi đạp khoảng trăng máy dép trời nước bốn chín làm biển chỉ đập em tím tôi xe chìm sáu khoảng quê hết yêu thương núi hết sáu thì thôi em đã tám biết tàu bàn bàn thì năm quê đã mướn á lỗi biết đồng chỉ ghét tím biết năm chết là làm biết thì tui sáu lầu gì bè tủ nghỉ độc làm đập không giày ba tôi bè con thôi chỉ thích nhà bốn sáu tím gió áo hết nước hết xuồng gì giày giày đá ừ nón tôi mười đạp nhà tím nón trời xanh đã ngọt thì xuồng nha bạn đạp xuồng xuồng lầu không đánh thế viết đạp đồng tàu thuê cửa quê mượn ờ đập làm ghét ác hết nón viết lầu khâu đánh leo biển leo hai mua em vẽ tôi vá đập thôi em cái đập hóa vẽ hết ác tàu chỉ máy quần độc bảy ừ ờ con chìm đá hóa là hóa giày phá yêu vá trời bạn cửa mây núi dép nhà nghỉ nhà mua xuồng tủ kim dép đã nghỉ leo khâu mua áo bạn vàng là khâu phá ác mây đang độc bạn hóa đỏ xe kim nước ngọt đá tôi bàn ác trời ừ hàng thuê quần quần thuê khoảng vá anh bơi bè thương hết đập sáu bè leo cái giết tôi hết viết vá em đang nhà áo ừ đâu ngọt anh thích hàng một con xanh nha ghét giày leo đồng gì một tím tàu không nha đang độc vẽ chìm tui bốn thì vá anh ờ tủ phá việc kim là trăng bạn tím anh nước mượn mướn đập biết xanh ghét áo việc phá mây đã phá trăng xe mướn dép thế phá độc đá đá lỗi đập chỉ nón anh thuê khâu đồng việc áo yêu thích hết việc tô quần em.", new DateTime(1986, 8, 22, 20, 13, 57, 261, DateTimeKind.Local).AddTicks(9782), null, new DateTimeOffset(new DateTime(1, 1, 