                    { new Guid("9984d9a0-955f-4280-af86-2090b691fbe0"), "01443 Đặng Ranch, Hải Phòng, México", "Viết áo ừ núi không đang vá mua khoảng cửa tôi tàu nhà tui nhà ờ đập nước ừ anh đang chìm thuê tàu trăng đâu kim hàng ruộng nón hương núi thích ba mười đánh năm áo á nghỉ em á hết vàng máy thương quê đá lỗi biển mướn em dép may tủ thì đỏ vẽ thuê tui xe nghỉ núi phá năm ngọt biển gió tô chết xanh con hết một mây mượn khoảng tủ bạn bơi đã ruộng không ác dép thì tô bạn đạp bảy hai thế nhà ruộng yêu mây xuồng hết vàng phá đang vàng bảy ba nhà mười tàu chìm bạn nước hết giày quần mua đánh việc nước tủ thương ngọt đồng hết chín ừ mướn hương tám bàn chín viết nghỉ máy bốn núi giết ờ mượn nghỉ trời mười á em vẽ trăng cửa bạn được gió quê mướn máy bàn em nón nhà đá xuồng ba may trời quần ghét mua viết đạp trời bè xanh yêu máy trăng em khoan hết cửa trời mua kim tôi tám viết bàn may hết đập hai cửa hương gió ghét được đá quê cửa đồng nhà đã việc độc tàu phá biển vẽ mây chết sáu vẽ cửa là vàng mượn trời khâu bàn bàn khoảng anh vàng nón quần tôi mua hương vàng tím biển gì làm á bàn lỗi bè nón nước hàng chìm đâu một hương em đá mười tám tàu con lỗi bốn khâu ừ leo thì ừ hàng ờ nước may mười bơi đạp chỉ gió núi máy nha tô thuê thôi leo vá ghế ngọt kim lỗi yêu gió bốn ờ hương bơi phá bè đập đồng đỏ ác tàu thương độc ác bảy viết mượn anh anh tui cửa chỉ một quần gió ba xanh đã biển nước nha viết đâu độc mười ừ vá hết làm bảy yêu ờ ờ may trời tủ tô khoảng phá làm ruộng đập bốn giết trời trời thế hai mây con thôi ác đá vá bốn cái hết lỗi đang vá đạp bàn tủ yêu ác thuyền mướn tôi xuồng không cửa mây mượn mười bàn tám vá đá không phá biết ruộng nước làm máy thích nha mướn bơi mượn nha quê ờ núi bàn không vẽ hết trăng làm hương nha á ruộng hết bốn vá phá bơi thích yêu làm mướn viết thì nhà đá bảy đánh thuê ừ quê mượn ngọt hàng hương đã thôi gió tủ đánh không nước núi tám việc cửa thì đá phá áo quê thôi là lầu mướn mây máy mượn em núi xe đâu vẽ trời đỏ hóa trăng khoảng nước máy ờ bè con thì hương biển đỏ bốn ừ thương làm giày thuyền thế bè đạp xe hết lỗi ờ cửa chỉ đập thương đập đâu được áo một tô đá mượn thuê.", "Độc tủ biết hóa cái nước bơi hàng leo chín đồng hết thuyền giết mười thôi tám xanh chìm hết giết khâu đỏ á hai thế năm khâu thôi nón em lỗi khoan đỏ mướn xe đập bơi xuồng ghế thôi cửa cửa đánh thuyền nghỉ ừ áo quần đồng hóa gì nhà biết nước viết vá tôi đập tím hóa hết trăng cái ba bạn thế bốn tôi hết tủ thuê thuyền mua khâu viết được tui việc tám độc chết phá hai ba bạn mua xanh thương ba ba việc thế anh đánh khâu xe vẽ tui ghế thích yêu khâu vẽ quê năm đang trăng anh năm giết tủ bạn mượn leo thích viết đang cửa tô đá thế nón kim xuồng độc thế tím sáu đá xanh đâu bạn bảy nón thuyền độc thích ờ khoan mười đâu ghét thì áo mua nhà ngọt lỗi mười tui vàng bốn hàng ờ bàn là quần quần vẽ hàng ruộng tôi thích nha là đánh bốn viết xuồng cửa quê hàng viết đã tím ghế viết ác khoảng ruộng khoan phá dép cửa sáu ác đồng nước nước may ác vá em bảy đá bơi nhà ba á yêu chỉ đâu khoan một dép tôi áo chết nón đâu xanh nha là chìm không độc núi chết đồng là đâu vá thích nhà leo em năm đang thôi đánh chỉ em cửa một may nghỉ hương thuê cửa giết hết sáu gì thôi dép thôi hết hương tôi thuyền nha biển bơi nha tám làm bốn tàu bàn tôi nón biển sáu mười hết làm á tủ đang đạp đã phá vá bơi ác biển đạp phá ừ thì yêu thôi hết nha giết làm thế không quê may biết máy khoan ghét mua đỏ không mướn yêu bạn dép trời cái thôi em máy thế trăng hết quần vàng đá nhà được dép ghét mười khoảng bảy nha gì đâu tàu hóa sáu tám máy ngọt chìm ờ chỉ tàu thuê giết hương mướn chín mây ba chỉ tôi không nón giết tám con khâu được tôi nón dép thương hết đá thuyền gió tàu quê thôi mây ừ là thôi đạp mây cửa mây vàng xuồng nón độc thì ngọt không tô quê may núi ghét chết bàn ừ hương vá viết vẽ nha nước đang tàu ba chín bảy trăng hóa bảy ác may hai hết gió ruộng tui đá tím leo việc thế thế khoảng yêu đạp được dép chín hai xuồng biết đỏ yêu trời ruộng trời mượn hương ghế leo á mua trăng chín tô ruộng cửa tủ đồng đã hai vẽ giết mướn dép bảy ruộng ừ bảy áo khâu thuyền xuồng bè đâu việc ờ xe vẽ hương đã nón trời thương vẽ hàng mượn hóa bè tím.", new DateTime(2005, 5, 24, 8, 34, 1, 639, DateTimeKind.Local).AddTicks(4287), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Hạ Uyên Hà", "\"https://picsum.photos/400/300/?image=1066\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Vĩnh Long", "Tăng" },
                    { new Guid("ab753b1e-63c3-4062-8253-47452ca1e73d"), "158 Toàn Thắng Meadows, Quảng Ngãi, Suriname", "Nón nghỉ đập xanh áo thì đập hóa khâu giết đạp khoan cái trời quê trăng sáu ngọt độc biển em vá hàng trời trời mượn đã nghỉ hóa hết khoan gì tàu đạp đang bơi thuê hóa đỏ tủ chỉ bơi lầu lỗi chết xuồng thích thôi bảy hết xanh chín gì ờ thì lầu máy khoảng phá là hóa chìm bạn con sáu bạn chìm không lỗi đồng sáu trăng thế anh xe chìm tím biết cái đạp hàng đâu được yêu làm mượn anh ừ áo trăng tủ đang á đánh ruộng tui á vàng đâu đỏ vàng tôi đánh một đồng nước bè chỉ tám tàu độc mướn ghét xanh nha mượn tàu nghỉ cái biển dép làm khoan thích nón tô ngọt chín thôi đâu núi nghỉ được viết em dép núi hương viết vẽ khâu vẽ đang bè hai mướn tôi khâu sáu độc mua sáu ruộng gió đỏ tui giày may thuê bảy đồng quần hương gì năm giết sáu ba phá cửa chìm thuê trăng tím chỉ giết mây ghế hàng bơi leo thương hết may nước leo đá độc ừ kim thương mười việc mua vẽ thuyền là vá đang đập khoảng đạp ghét biết khâu là chìm ghế tủ đạp ngọt trời đá thì lầu hai không đâu biết trăng biết con được yêu đã chết ờ leo thương thế viết nước khâu thuê gió lầu ờ biển cái xanh ngọt máy đạp trăng hàng mây là khâu bơi gió tàu tím biết độc bơi xuồng đạp bàn tám đồng việc dép tàu biết khâu con chết nghỉ khoảng máy quần đồng đỏ thích mây tím bơi nước thích yêu thuê xe ờ nghỉ leo đâu thích bè nước ừ ừ ba nha đồng xuồng giết đập mây phá bè mây mua hương đồng đỏ xe đã hương nha một thuê leo ghét được khâu tôi phá đồng chỉ biết hương xe quần cái thích chết áo đỏ nước đạp bạn thuyền sáu hết mướn chỉ ba khoảng gió áo hai mướn leo mướn may ờ đồng khâu trăng chết bơi hết thế em mười kim gió tui xe hết cửa đỏ không con á đã vẽ ghét chỉ khoảng chết tôi cái cửa gì anh khoan một ờ tui vàng ừ mua tủ tám hết nước dép mua mây chết xuồng nhà đạp mây đỏ phá dép máy cái khoan đập gió hết giết tủ ghét thì hết ruộng xuồng đá thương khoan được bơi nghỉ được ba năm ghế áo sáu viết mướn mười trăng đã thương gió ác vàng chín yêu chìm tám quê bàn bốn là cái trời đâu.", "Khoan bảy thôi cửa thích tui tui đang giày làm tàu biển bạn vàng chết đồng đồng á hàng ba đánh mướn ngọt tám mây ghét con chỉ mượn hàng xanh hương nón áo giết mướn hàng hai trăng khâu làm xe bạn nghỉ giày cái được xe được giết tàu nha tui vẽ mây tủ biết vá gió ừ ừ đã ghế xanh vẽ phá vàng xanh hết đâu áo áo xanh giày đã bảy dép thôi bạn đạp bơi đã bạn thế vẽ cửa nước thôi tám xanh đập thích viết đồng bạn kim khâu thì nha thôi chìm thuyền sáu ừ quê bàn thôi chết chín khoan chết đá trời ba một sáu viết trời máy lầu chỉ thích đã ruộng tô thế vá bạn thuê tám khoan anh nhà mười gió đang chín khâu mười lỗi bảy mười lỗi chết vẽ cái chết khoảng thương tủ mây trời tàu lầu ừ nón biển thuyền thôi trăng hàng ba gió núi máy chỉ mướn hóa là bơi khâu dép hương độc dép mượn kim ác đã cửa sáu gió đỏ ác nón đạp yêu bảy gì việc xuồng khoảng chín một nón yêu vẽ được núi thích việc thương bạn tím bè nghỉ bạn áo mua phá tám hết con tím mây đồng á ba biển đã chết tám tám ba năm nghỉ tôi chỉ đang là hết trời ghế trời xanh tím bảy quần tám chìm đồng áo khoan gió đâu gì đạp khoan mây chìm bốn quần ừ lỗi ngọt ghế thương đánh yêu đỏ trời trời mượn tím hết một chìm nha một đã mười vẽ dép leo năm lỗi anh hương hóa nước thích xuồng á đang mượn hương lầu thuyền trời đâu xuồng ba lầu tàu đạp mười leo anh con thương việc hết biết gì biển khoảng vàng quê cửa bảy tô mây giày thế mây đồng gì biết thuê hàng yêu nghỉ khâu giết tui đồng một cửa vàng khoảng anh là xuồng ghế ruộng may thương chết được may chỉ viết nghỉ biết đỏ hàng đồng tàu bàn nghỉ trời xe khoan em vẽ chết hai á mượn mượn leo thế xanh chỉ khâu á ác năm bảy thích quần yêu nha thuê năm hết hàng áo đánh cái ruộng biển kim xuồng thôi khoảng máy độc sáu mướn tủ mây đang xe quê tủ cái mây chín lầu kim ghét nước giày viết thích núi tàu thương ác vàng phá được ghét tô nghỉ tôi con tôi may thương đánh con giết á gió nhà ừ tôi biển phá tám một một mua đỏ cửa ừ vàng núi chìm nón phá mây hết biển phá không đâu ghế nón mướn việc khoan con thế chỉ gì anh mười quần may áo việc thuê khâu nha nghỉ thích chìm mười tủ giết không một quê kim đồng khâu một bè tôi ruộng hết lầu.", new DateTime(1948, 1, 12, 17, 50, 6, 590, DateTimeKind.Local).AddTicks(2297), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Ngọc Lan Vương", "\"https://picsum.photos/400/300/?image=1032\"", null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), "Tây Ninh", "Phùng" },
                    { new Guid("ad5ecaa0-45c2-4113-8dfb-ec4237fdc214"), "136 Trương Plain, Hòa Bình, Trinidad và Tobago", "Vàng em anh thuyền thích xe thì bốn tím nhà đập hai giày mây hóa xuồng thích áo việc lầu được xuồng tím hóa ba nón ác bạn dép viết cửa thôi việc mười đỏ nha ruộng tím ác chỉ làm là trời là cái bảy hai đồng may đâu con xe mướn đỏ chìm mượn gió khoảng khâu nhà bàn chìm khoan đâu sáu xanh thì kim là em bốn thương em tím thì độc khoảng vá bốn dép ác con việc đồng nón đã hóa hương em không tám anh áo ghét đá quê viết biết bàn tám gió ba ba mượn tàu tô em dép may tôi núi ừ mua leo quê giết anh hương cửa núi đang hương sáu lầu cửa chìm độc tô ghế dép nha leo xuồng ác tím vá phá hương trời nha biển hai là hai dép mượn lầu thuyền đánh hàng dép vá đạp trăng bảy tô một đập nón phá thôi quê giết thuyền trăng ruộng chín hết biết sáu yêu chỉ hai áo tím xuồng xuồng hàng viết bơi biết biết lầu đang tím ghế làm đánh năm giết may á vá leo thương ác làm ngọt máy vàng giết hết ruộng áo yêu đánh ác xanh khoan thương đánh vàng á gió chỉ đã thích thương đã thôi đá đá bảy độc đâu lỗi thương gió thuyền ngọt thích tui em dép bơi việc xanh sáu ruộng quần giết thì tím bạn tui bàn mượn xuồng hai được ờ gì nón khoảng ừ ghét một thích tôi tui làm ghế bốn cái sáu biển nghỉ tôi một nón ác chỉ nha tím biển bơi cửa hóa đâu chỉ may may làm ờ đá tủ áo gì giày biển biển hai năm kim việc hóa lỗi nha phá dép khâu mười mười dép mượn khoảng lầu mướn tô anh em trời viết mướn gió bạn được trời trời biết hàng hàng một thì thương tàu khoảng thương hàng ba đã áo bốn lầu giày phá vàng áo thì ghế độc đạp không gì đã nước bạn may em tím mướn được biết nha lỗi mướn thích thì hàng đá tám chỉ sáu xuồng ruộng đang gì làm năm gì nha ba xe núi khâu một thế á đâu hương chín áo làm quê trời chìm núi là làm giày tui dép thì thế yêu khâu tám bơi ừ ừ.", "Vẽ quần độc tui hết ruộng bàn biển con giày kim sáu hóa thuê cái ngọt giày thương ờ thương mười ờ nghỉ vẽ lỗi lỗi giày thuyền giày ác áo ngọt việc mượn giết tím việc con xanh là con thuê con xanh biển viết đã thôi ừ một thôi con mua xuồng hết là kim hai chìm thì lầu chỉ biển đá bạn khâu mướn trăng thích mười xuồng xe phá núi kim ngọt may biển tàu biết đạp tủ biết ờ xanh là tô nghỉ khoan quần tàu biển biển tím đánh ghét thuê nước tôi thuê ác ừ nhà biết bạn phá tủ mướn khoảng chết tím một nha thuyền em bơi ruộng nước hóa thuê bàn độc đã trời xuồng mướn đỏ khâu bàn đập thương trời ghét tám nha yêu đá ruộng biển mua chỉ khoảng ghế thôi trời gì máy mười quần biết mượn ruộng thuyền ác chìm giày yêu nha á lầu lỗi tím đồng yêu đâu á năm tô tủ xe chín việc dép được thì thuê ờ thích con hết tui ác bơi cái nghỉ xuồng độc á đồng thôi là thương hàng may nha hai biển khâu bè thuê thích tím việc ờ đập dép ruộng đá bốn chìm bảy gì đâu hương ờ tím dép vá hết chết thích mướn mướn thuyền thuyền yêu gì ờ yêu đánh ngọt hai việc nha hóa đánh thích anh nghỉ ờ tôi bạn tám lầu sáu mướn nón đã yêu gió thế khâu cửa đập chết mười tám em độc ba con bốn chìm một kim lỗi biết tám lỗi đạp kim may hết thế ruộng nước ba chỉ hóa ghế đỏ con ừ quê chìm máy hai á biển núi lầu ngọt đang trời áo lỗi giết bốn gió đồng yêu bốn năm bơi đá ba nón sáu xuồng đỏ núi quê dép được đánh tám thuê tui cửa trăng ờ trăng ruộng hết thôi tủ ba tàu tím bơi bốn không cửa trăng làm được ừ nha gì hóa đồng anh con tám phá hương vàng thôi ghế tô anh bè nha sáu chìm tàu kim yêu thuê xuồng tám tím lầu đánh quê đang đã may làm tủ nước bè dép ừ con vàng bàn một hết thì thuyền mượn tủ bè nón đã nhà biển bè đạp là lầu nhà xuồng may bàn xe lỗi tám bè viết giày một quê ừ cửa tàu bè ghét á hóa giết ghét nha thuê tô anh thuyền thôi mướn nhà thuyền lỗi đã thích khâu tui việc mướn trời vá con đang chìm đỏ mây chỉ cửa đạp mây chỉ đang.", new DateTime(1996, 8, 13, 2, 1, 15, 671, DateTimeKind.Local).AddTicks(2198), null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), new TimeSpan(0, 0, 0, 0, 0)), false, null, new DateTimeOffset(new DateTime(1, 1, 1, 0, 0, 0, 