                    { new Guid("ee05b78c-7ba6-4230-aa3b-70057e429cb7"), "09874 Trà Giang Land, Lạng Sơn, Chile", "Hai vàng tàu ngọt mây bảy khâu chín nhà thuyền xe gì hết cái không bàn mua chỉ ba xuồng mượn lỗi biết khâu mười không quê yêu được trăng em thì là dép áo chín giày gió bốn ừ nhà trăng ghế thôi trời việc đạp nước yêu viết không chìm phá núi mướn năm tô chín thì máy anh ruộng anh tàu chìm thế tôi hết phá tím tô xe đá giày bảy nhà vẽ nước quần khâu đá kim làm ngọt tủ phá bàn là tàu bốn đánh vẽ thích hết mượn áo yêu xanh đã trời đã tủ hóa kim bàn thế giết em tôi khoảng hàng tui áo trăng leo ác đồng ruộng thôi nước bàn tôi ghét tô leo biển chết ngọt may trời đập biển ruộng hai giết dép đạp hai mây con ruộng tô đập dép mướn nha ghét mười bè đá hóa hai ờ thuyền biển thế ba viết con áo chỉ xe chết đánh giày yêu yêu hai xuồng đang khoan tủ trời ruộng việc ngọt là bảy á em khoan tô áo yêu thương khoan bơi anh dép thương may ngọt tôi đánh sáu thế sáu ruộng lỗi hai á lỗi cửa mướn nước vá thương đang đang hết thương trăng xe nước làm áo cái dép chìm cái khâu chín chết giết tàu bảy mướn xuồng thuê mượn á yêu em đang mười hóa bảy đạp gió đồng xanh ác thì hết viết nha vá con thuyền nha thế ba thuê bạn nước mua kim lỗi núi giết ác phá đập vàng thuê chín chết mướn việc ác bạn tám máy á đạp leo bè xanh sáu kim đồng chết gió tủ tô năm thế mua máy hương quần con hết khoảng tôi xe xuồng chết ghế chỉ gì chỉ bè nước thôi thì thế viết đâu viết thuyền ừ xe khâu vàng nước bàn giết em xanh chín giết dép khâu độc việc gió xanh ngọt mượn thôi đạp năm hương tàu mượn hết chìm quần bốn thế đang việc nón được phá đá gì hết nghỉ vàng xanh em tui tôi bảy hóa cửa thương đánh không đập đồng tám giết ờ nhà ghế được tô một tui mượn trăng tủ ruộng nha núi là thế bè tô bàn đã quê khâu vá vẽ ừ con quần lầu biển độc trời nghỉ độc là hương quê dép là ruộng ruộng làm đạp thuyền sáu biết quê vẽ phá mười đỏ mười ác khoan kim thuyền con kim thương yêu vá trăng thuyền núi thì lỗi xanh đánh nha gió phá bảy mười vàng mua thì tám xuồng ruộng ruộng hết bảy phá vẽ anh gì bàn thương.", "Ba anh phá chín trăng em xanh là một một tàu là thì anh thuyền anh nước đánh leo vàng ghế chìm nón ruộng ruộng mười dép tím chết đang bảy đỏ quê thích mượn xe tui tủ tủ con nước bốn mướn xuồng là ghế đá việc khoan bạn tàu kim đạp giày xe kim tôi chín năm đã thích cửa cửa bàn vá áo khâu quần ờ yêu đạp độc chín giày thuyền ác ghế thế thương đập đâu thì xanh giết cái vàng năm dép thương mượn mua hết mây thuê ờ được núi tô năm leo độc tôi hàng ừ mượn hàng không đá trời nhà độc yêu giày núi á thế thích tui bè không tám đạp không dép vàng cửa chìm khoan thuê bè kim chỉ hai biển kim viết trời thuê thì mười chết chỉ chín nón nha áo vẽ thuê xe là xe khoảng sáu trăng tàu cái được xanh đỏ kim sáu ác sáu đá chỉ không hương nghỉ tui năm tám hai ác anh em lỗi tui leo thuê bạn đập bạn anh vá kim vàng chín bàn cái được núi gì trời leo xe yêu đâu quần ghét đánh vàng con tô lỗi dép ruộng xanh kim đồng hàng nhà được sáu mười hết giết cái ác bàn hai quê em gì á yêu vàng cửa đâu ba ngọt ừ chết đạp năm vá tám khâu bạn nước tô đập xuồng dép chết mây là làm nhà thích anh hết việc mượn gì chỉ được anh ruộng tủ đạp tám quê mượn may lỗi núi chết kim đã một vẽ trời tôi xanh không nha chỉ mười xanh trăng mướn gì nón trăng bè leo thế anh ác xe được thế mười biển lỗi lầu thích không áo mướn vá không dép chỉ dép biển thích biết hương hai yêu bàn máy khâu thôi biết lỗi bảy được đá mướn thương đỏ á biết ác viết xanh áo em xe quần xe khâu không quần đồng xe bạn tám tui bốn tàu bạn giày giết nha tô mướn may quần á yêu con hết bảy ngọt yêu vàng đâu đánh con đâu tô chết ác ờ ghét chỉ hết xuồng đồng thì giày leo bàn đâu đồng trời thương dép lầu đá chết bảy bè tui tui ờ không khoảng sáu nha tàu được hàng làm tôi yêu bơi gió đã thương áo cửa phá ba độc ngọt đá bàn tám ờ nước gió á tàu tám ác xe thế anh đập thương viết mượn cửa không tui sáu gì á được hai hai tàu mười vàng mua ba lầu em làm núi thế chết viết chín ngọt năm thương